INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('18', 'Shenzhou 1', 'La Shenzhou 1 fu il primo lancio non abitato di un veicolo spaziale di tipo Shenzhou, facente parte del programma spaziale cinese. La navetta non fu provvista dei sistemi di supporto viatale o di quelli di salvataggio di emergenza (LES). Dopo aver orbitato per 14 volte intorno alla terra, venne dato il comando di accensione dei retrorazzi frenanti. Il rientro andò come previsto e atterrò correttamente a 415 km ad est rispetto alla base di lancio. Shenzhou 1 fu una missione con lo scopo principale di testare il razzo vettore, il meccanismo di separazione dei moduli, lo scudo termico, il controllo di assetto, il rientro balistico e il recupero a terra. A fronte di ciò la navicella non era ancora completa. Soltanto 8 dei sottosistemi erano funzionanti e non possedeva alcune caratteristiche (come la possibilità di effettuare i cambi di orbita) che saranno introdotti nelle successive missioni.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Shenzhou_1', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:25', '2013-05-02 13:32:25', '11654', '1020', '11776', 'NULL', '1', 'NULL', '2');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('19', 'Sojuz TMA-15', 'La Sojuz TMA-15 è una missione spaziale con equipaggio umano diretta verso la Stazione Spaziale Internazionale partita il 27 maggio 2009 dal cosmodromo di Baikonur con a bordo tre membri dell\'Expedition 20. Il 29 maggio si è agganciata alla stazione spaziale. Il 1 dicembre 2009 ha fatto il suo ritorno sulla terra.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Soyuz_TMA-15', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:40', '2013-05-02 13:31:40', '11656', '1021', '11765', 'NULL', '1', 'NULL', '3');
