INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('21', 'Sojuz TMA-18', 'Sojuz TMA-18 è una missione del programma Sojuz diretta verso la Stazione Spaziale Internazionale, lanciata il 2 aprile, 2010. La navetta trasporta i tre membri della Expedition 23 che abiteranno nella stazione spaziale. TMA-18 è il 105º volo con equipaggio della navetta Sojuz dal primo volo avvenuto nel 1967. L\'aggancio con la stazione spaziale è avvenuto il 4 aprile alle ore 5:25 UTC. La navetta è rimasta agganciata alla stazione per tutta la durata di Expedition 23, per essere utilizzata in caso di emergenza per abbandonare la stazione. Le fasi di distacco e di atterraggio sono state ritardate per indagare possibili problemi nelle sezioni di collegamento fra la navetta e la stazione. La procedura, che marca la fine della Expedition 24, ha infine avuto luogo il 24 settembre 2010, alle ore 22:02 EDT. La navetta ha seguito una regolare traiettoria di rientro, per toccare terra alle 5:23 UTC, presso Arkalyk, in Kazakhstan.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Soyuz_TMA-18', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:29:21', '2013-05-02 13:29:21', '11661', '1023', '11761', 'NULL', '1', 'NULL', '5');
