INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('24', 'Sojuz TMA-20', 'La Sojuz TMA-20 è stata una missione verso la Stazione Spaziale Internazionale (ISS) e parte del programma Sojuz. Il lancio è avvenuto il 15 dicembre 2010 dal Cosmodromo di Bajkonur. Il 17 dicembre, dopo due giorni di volo, la Soyuz TMA-20 attraccò alla ISS. I tre membri dell\'equipaggio Soyuz TMA-20, Dmitri Kondratyev, Catherine Coleman e Paolo Nespoli rappresentavano le agenzie di Roscosmos, NASA ed European Space Agency (ESA) associate nel programma ISS ed erano i primi tre membri della Expedition 27 (gli altri tre raggiunsero la Stazione Spaziale Internazionale il 6 aprile del 2011 con la Sojuz TMA-21). Il 24 maggio 2011, alle 02:27 UTC, la navetta atterrò senza problemi nelle steppe del Kazakistan.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Soyuz_TMA-20', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:28', '2013-05-02 13:32:28', '11668', '1026', '11754', 'NULL', '1', 'NULL', '8');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('25', 'Apollo 10', 'Apollo 10 fu la quarta missione con equipaggio del programma Apollo e la prima missione dalla piattaforma di lancio 39B del John F. Kennedy Space Center. La missione includeva il secondo equipaggio ad orbitare intorno alla Luna e il collaudo del modulo lunare in orbita lunare. Vennero eseguite manovre di discesa, di risalita, di rendezvous e d\'aggancio. Il modulo arrivò fino a 15,6 km dalla superficie lunare durante la manovra di pratica.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Apollo_10', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:28:36', '2013-05-02 13:28:36', '11670', '1027', '11743', 'NULL', '1', 'NULL', '9');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('26', 'Shenzhou 3', 'La Shenzhou 3 fu la terza missione di un veicolo spaziale di tipo Shenzhou, facente parte del programma spaziale cinese. A bordo non c\'era un equipaggio umano, ma aveva tutti i sottositemi completi e un manichino atto a simulare le reazioni del corpo umano al volo spaziale.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Shenzhou_3', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:50', '2013-05-02 13:31:50', '11672', '1028', '11766', 'NULL', '1', 'NULL', '10');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('27', 'Apollo 17', 'Apollo 17 fu l\'undicesima e ultima missione con equipaggio umano del programma spaziale americano Apollo da parte della NASA. Il vettore Saturn V decollò da Cape Canaveral il 7 dicembre 1972 alle 05:33:00 UTC con a bordo il Comandante Eugene Cernan, il pilota del Modulo di Comando Ronald Evans e il pilota del Modulo Lunare Apollo Harrison Schmitt si tratta del più recente volo umano oltre l\'orbita terrestre bassa e il primo lancio notturno di tutto il programma. Lo stesso Cernan rimane tuttora l\'ultimo uomo ad aver messo piede sul suolo lunare. L\'Apollo 17 fu anche la terza missione ti tipo J, caratterizzata da un\'intensa indagine scientifica della Luna sia dalla superficie sia dall\'orbita lunare. Nonostante la somiglianza alle precedenti missioni Apollo 15 e 16, gli obiettivi e gli esperimenti caratterizzano questa missione unica rispetto alle altre. Mentre Evans rimase in orbita lunare a bordo del Modulo di Comando, Cernan e Schmitt si fermarono poco più di tre giorni sulla superficie lunare nella valle di Taurus-Littrow, conducendo tre periodi di attività extraveicolare, occupati nella raccolta di campioni lunari e nell\'impiego di strumenti scientifici. Cernan, Evans e Schmitt rientrarono il 19 dicembre dopo una missione di circa 12 giorni. La decisione di allunare nella valle di Taurus-Littrow è stata considerata come uno degli obiettivi primari della missione: analizzare materiale lunare dell\'altopiano più vecchio dall\'impatto che ha formato il Mare Imbrium e valutando le possibilità di un\'attività vulcanica nelle vicinanze. La valle inoltre offriva una migliore copertura orbitale ed un efficiente utilizzo del rover lunare. La missione rompe anche vari record stabiliti dai voli precedenti, tra cui la più lunga permanenza sul suolo lunare, il tempo totale più alto di attività extraveicolare lunare, la più alta quantità di campioni lunari raccolti, e il più lungo soggiorno in orbita lunare.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Apollo_17', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:25:51', '2013-05-02 13:25:51', '11674', '1029', '11753', 'NULL', '1', 'NULL', '11');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('28', 'Sojuz TMA-02M', 'Sojuz TMA-02M è un volo astronautico verso la Stazione Spaziale Internazionale (ISS) e parte del programma Sojuz. La sua missione è di portare in orbita un equipaggio di 3 astronauti che faranno parte dell\'Expedition 28 e 29, con una permanenza totale sulla Stazione Spaziale Internazionale di circa 6 mesi. Il lancio è avvenuto il 7 giugno 2011 dal Cosmodromo di Baikonur. L\'aggancio del Soyuz TMA-02M con la ISS avverrà dopo un paio di giorni di volo autonomo necessari a raggiungere la Stazione Spaziale. I membri dell\'equipaggio, Sergej Volkov, Michael Fossum e Satoshi Furukawa rappresentano le agenzie spaziali russa, americana e giapponese.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Soyuz_TMA-02M', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:19', '2013-05-02 13:31:19', '11676', '1030', '11773', 'NULL', '1', 'NULL', '12');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('29', 'Expedition 12', 'L\'Expedition 12 è stato il dodicesimo equipaggio della Stazione Spaziale Internazionale.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Expedition_12', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:28:30', '2013-05-02 13:28:30', '11678', '1031', '11741', 'NULL', '1', 'NULL', '13');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('30', 'Sojuz TMA-01M', 'Sojuz TMA-01M è stata una missione del programma Sojuz diretta verso la Stazione Spaziale Internazionale (ISS). Il lancio è avvenuto il 7 Ottobre 2010 dal Cosmodromo di Baikonur. In seguito la navetta si è agganciata con la ISS ed i tre membri dell\'equipaggio sono entrati a far parte dell\'Expedition 25.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Soyuz_TMA-01M', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 11:02:11', '2013-05-02 11:02:11', '11680', '1032', '11750', 'NULL', '1', 'NULL', '14');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('31', 'Shenzhou 2', 'La Shenzhou 2 fu la seconda missione di un veicolo spaziale di tipo Shenzhou, facente parte del programma spaziale cinese. Come il primo lancio, anche questo fu sprovvisto di equipaggio. Al posto degli astronauti fu posto un coniglio, una scimmia e un cane per tester i sistemi di supporto vitale. A differenza del primo lancio questo fu molto più impegnativo. La navetta disponeva infatti di tutti i sottosistemi funzionanti e furono intrapresi numerosi test di funzionamento tra i quali anche il cambio di orbita. Inoltre erano posti a bordo ben 64 esperimenti scientifici. Tra i quali alcuni sulla cristallografia in microgravità, altri di tipo biologico e di astrofisica. Al termine della missione furono accesi i retrorazzi frenati per rallentare la navicella e rientrare quindi sulla terra. Non furono mai rilasciate delle fotografie della navetta dopo il rientro, alimentando le ipotesi che si fossero verificati dei problemi nella fase di atterraggio. Ciò fu sempre smentito dalla autorità cinesi.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Shenzhou_2', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:26:11', '2013-05-02 13:26:11', '11682', '1033', '11775', 'NULL', '1', 'NULL', '15');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('32', 'Apollo 7', 'Apollo 7 fu la prima missione con equipaggio nel programma Apollo ad essere lanciata dopo il tragico incidente dell\'Apollo 1. Fu una missione orbitale di undici giorni, il primo lancio con equipaggio del veicolo di lancio Saturn IB, e la prima missione spaziale americana con tre uomini.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Apollo_7', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:29:58', '2013-05-02 13:29:58', '11684', '1034', '11733', 'NULL', '1', 'NULL', '16');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('33', 'Sojuz T-2', 'Sojuz T-2 è la denominazione di una missione della navicella spaziale Sojuz T verso la stazione spaziale sovietica Saljut 6 (DOS 5). Si trattò del trentaseiesimo volo equipaggiato di questo velivolo spaziale (la prima missione equipaggiata di questo tipo di capsula), del cinquantottesimo volo nell’ambito del programma Sojuz sovietico nonché del tredicesimo volo equipaggiato verso la predetta stazione spaziale (l\'undicesimo equipaggiato - a causa degli insuccessi della Sojuz 25 e Sojuz 33 - che riuscì effettivamente a svolgere la manovra di aggancio).', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Soyuz_T-2', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:29:07', '2013-05-02 13:29:07', '11686', '1035', '11744', 'NULL', '1', 'NULL', '17');
