INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('50', 'Programma test Apollo-Sojuz', 'Il Programma test Apollo-Sojuz (ASTP) fu la prima collaborazione tra gli Stati Uniti d\'America e l\'Unione Sovietica nel settore dei voli nello spazio. Il 17 luglio 1975, una navicella spaziale del programma Apollo ed una capsula Sojuz si agganciarono nell\'orbita intorno alla Terra, consentendo ai due equipaggi di potersi trasferire da una navicella spaziale verso l\'altra. Tale missione significò un taglio netto con il passato, che era stato caratterizzato da una vera e propria gara verso lo spazio. In pratica la missione fu frutto della prima collaborazione tra i due programmi spaziali delle due superpotenze che fino a tale momento era meramente caratterizzato dalla concorrenza dell\'uno contro l\'altro. La tecnica missilistica era diventata una base fondamentale della corsa all\'armamento (anche di carattere atomico) e pertanto la collaborazione pacifica nello spazio fu un chiaro segnale politico della volontà di pace reciproca.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Apollo%E2%80%93Soyuz_Test_Project', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:23', '2013-05-02 13:31:23', '11724', '1052', '11762', 'NULL', '1', 'NULL', '34');
