INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('63', 'Elezioni presidenziali moldave del 2009 (novembre)', 'Il primo turno delle elezioni presidenziali indirette si è tenuto in Moldavia il 10 novembre 2009, a seguito delle elezioni parlamentari tenutesi nel mese di luglio. L\'elezione, che ha visto la presentazione di un solo candidato, Marian Lupu, non ha avuto esito, a causa del boicottaggio da parte del Partito dei Comunisti della Repubblica di Moldavia. Il secondo turno, che si deve tenere al massimo trenta giorni dopo il primo, si è tenuto il 7 dicembre 2009. Dato che anche questo secondo turno è stato senza esito positivo, cioè non si è raggiunta la maggioranza necessaria all\'elezione del Presidente, nel 2010 si dovranno tenere nuove elezioni parlamentari anticipate.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Moldovan_presidential_election,_November%E2%80%93December_2009', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:30:31', '2013-05-02 13:30:31', '11829', '1086', '11830', 'NULL', '1', 'NULL', '47');
