INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('72', 'Elezioni politiche italiane del 1946', 'Le elezioni politiche del 2 giugno 1946, furono le prime elezioni della storia italiana dopo il periodo di dittatura fascista, che aveva interessato il paese nel ventennio precedente. Ebbero diritto di voto tutti gli italiani, maschi e, per la prima volta, femmine, di almeno 21 anni d\'età. Gli aventi diritto al voto rappresentavano il 61,4% della popolazione. Si votò per la proclamazione di un\'Assemblea Costituente che avrebbe dato origine al nuovo corso istituzionale del Paese. Calendario delle elezioni in Italia 100px Politiche 1946 · 1948 · 1953 · 1958 · 1963 · 1968 · 1972 · 1976 · 1979 · 1983 · 1987 · 1992 · 1994 · 1996 · 2001 · 2006 · 2008 Europee 1979 · 1984 · 1989 · 1994 · 1999 · 2004 · 2009 Regionali Tornata generale 1970 · 1975 · 1980 · 1985 · 1990 · 1995 · 2000 · 2005 · 2010 Amministrative 1946 · 1947 · 1948 · 1949 · 1950 · 1993 · 1994 · 1995 · 1996 · 1997 · 1998 · 1999 · 2000 · 2001 · 2002 · 2003 · 2004 · 2005 · 2006 · 2007 · 2008 · 2009 · 2010 · 2011 · 2012 Referendum Referendum Istituzionale1946 Referendum Costituzionali2001 · 2006Referendum Abrogativi 1974 · 1978 · 1981 · 1985 · 1987 · 1990 · 1991 · 1993 · 1995 · 1997 · 1999 · 2000 · 2003 · 2005 · 2009 · 2011 Referendum Consultivo1989 Istituzionali Quirinale Presidente della Repubblica 1946 · 1947 · 1948 · 1955 · 1962 · 1964 · 1971 · 1978 · 1985 · 1992 · 1999 · 2006 Palazzo Madama Presidente del Senato 1948 · 1951 · 1952 · 1953 (1) · 1953 (2) · 1958 · 1963 · 1967 · 1968 · 1972 · 1973 · 1976 · 1979 · 1982 · 1983 (1) · 1983 (2) · 1985 · 1987 (1) · 1987 (2) · 1992 · 1994 · 1996 · 2001 · 2006 · 2008 Montecitorio Presidente della Camera 1946 · 1947 · 1948 · 1953 · 1955 · 1958 · 1963 (1) · 1963 (2) · 1968 · 1972 · 1976 · 1979 · 1983 · 1987 · 1992 (1) · 1992 (2) · 1994 · 1996 · 2001 · 2006 · 2008 Agli elettori furono consegnate insieme la scheda del referendum per la scelta fra Monarchia e Repubblica e quella per l\'elezione dei 556 deputati dell\'Assemblea Costituente, cui sarebbe stato affidato il compito di redigere la nuova carta costituzionale, come stabilito con il Decreto Legislativo Luogotenenziale n. 151 del 25 giugno 1944. Il meccanismo elettorale era proporzionale a liste concorrenti in 32 collegi elettorali plurinominali. La legge elettorale prevedeva l\'elezione di 573 deputati, ma le elezioni non si poterono svolgere in Alto Adige (sotto amministrazione alleata), in Venezia Giulia (sotto amministrazione alleata e jugoslava) non sotto la piena sovranità italiana, ma si svolsero nei comuni di Briga Marittima e di Tenda.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Italian_general_election,_1946', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:09', '2013-05-02 13:31:09', '11843', 'NULL', 'NULL', 'NULL', '1', 'NULL', '56');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('73', 'Elezioni presidenziali statunitensi del 1960', 'Le elezioni presidenziali statunitensi del 1960 si svolsero l\'8 novembre 1960. La sfida oppose il vicepresidente repubblicano uscente Richard Milhous Nixon e il senatore democratico John Fitzgerald Kennedy. Fu il primo anno in cui presero parte alle elezioni l\'Alaska e le Hawaii, e l\'ultimo in cui non vi partecipò Washington D.C. Kennedy vinse con uno dei margini di voti più stretti della storia delle elezioni statunitensi. Sarebbe restato in carica fino al 22 novembre 1963, giorno del suo assassinio a Dallas.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/United_States_presidential_election,_1960', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:27', '2013-05-02 13:32:27', '11844', 'NULL', 'NULL', 'NULL', '1', 'NULL', '57');
