INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('79', 'Festival di Cannes 2009', 'La 62ª edizione del Festival di Cannes si è svolta a Cannes dal 13 al 24 maggio 2009. Il festival si è aperto con la proiezione in anteprima mondiale del film d\'animazione 3D Up e si è chiuso con quella di Coco Chanel & Igor Stravinsky di Jan Kounen. La giuria presieduta dall\'attrice francese Isabelle Huppert, due volte vincitrice del premio come miglior attrice a Cannes, nel 1978 per Violette Nozière e nel 2001 per La pianista, ha assegnato la Palma d\'oro per il miglior film a Il nastro bianco di Michael Haneke. Per alcuni commentatori si è trattata di un\'edizione tra le più importanti degli ultimi anni, in particolare per i grandi nomi che ne componevano la selezione, anche se \"qualitativamente\" non esaltante, con molte opere considerate di \"passaggio\".', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/2009_Cannes_Film_Festival', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:26:30', '2013-05-02 13:26:30', '11851', '1092', '11852', 'NULL', '1', 'NULL', '63');
