INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('84', 'Elezioni politiche italiane del 2001', 'Le elezioni politiche italiane del 2001 si tennero il 13 maggio. Le due coalizioni tra loro contrapposte erano: la Casa delle Libertà, guidata da Silvio Berlusconi, era costituita da Forza Italia, Alleanza Nazionale, Centro Cristiano Democratico-Cristiani Democratici Uniti, Lega Nord, Nuovo Partito Socialista Italiano; l\'Ulivo, guidato da Francesco Rutelli, era formato da Democratici di Sinistra, La Margherita, Federazione dei Verdi, Socialisti Democratici Italiani, Partito dei Comunisti Italiani. Rifondazione Comunista giunse ad un accordo elettorale con l\'Ulivo (patto di non belligeranza), in base al quale RC non si sarebbe presentata nella quota maggioriaria della Camera; l\'Italia dei Valori, invece, decise di correre in autonomia. Fuori dai due schieramenti principali si presentarono poi Democrazia Europea e la Lista Bonino. La vittoria della Casa della libertà è netta e il Presidente della Repubblica, Carlo Azeglio Ciampi conferisce a Berlusconi l\'incarico di formare il nuovo governo. Nasce così il governo Berlusconi II (dopo il primo governo costituitosi nel 1994) che rimarrà in carica fino al 2005, battendo in tal modo il record di durata fino ad allora detenuto dal governo Craxi I.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Italian_general_election,_2001', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:27:43', '2013-05-02 13:27:43', '11859', 'NULL', 'NULL', 'NULL', '1', 'NULL', '68');
