INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('107', 'Elezioni presidenziali tunisine del 2009', 'Le elezioni per la carica di Presidente della Repubblica Tunisina si sono svolte il 25 ottobre 2009. Sono candidati alla presidenza Zine El-Abidine Ben Ali, Mohamed Bouchiha, Ahmed Inoubli ed Ahmed Brahim. Risulta eletto per la quinta volta Zine El-Abidine Ben Ali con l\'89,62% dei voti.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Tunisian_general_election,_2009', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:30:30', '2013-05-02 13:30:30', '11889', '1102', '11890', 'NULL', '1', 'NULL', '91');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('108', 'Elezioni politiche italiane del 1972', 'Le elezioni politiche del 1972 si tennero il 7 maggio. Furono le prime elezioni anticipate della storia repubblicana, poiché per la prima volta il Presidente della Repubblica aveva sciolto le camere prima della naturale scadenza del quinquennio di legislatura. Il Partito Socialista Italiano di Unità Proletaria, nato otto anni prima da una scissione interna al Partito Socialista Italiano e comprendente i militanti più vicini all\'area di sinistra che non accettavano l\'alleanza con la DC, registrò un crollo totale scendendo al 2%, un risultato del tutto inferiore alle aspettative che precluse la conquista di qualsiasi deputato, e deliberò il proprio scioglimento per assorbimento nel PCI. A sinistra si presentarono inoltre molte formazioni nuove, che non infastidirono comunque il PCI, alla cui segreteria nazionale era da poco stato eletto Enrico Berlinguer e che mantenne sostanzialmente i suoi voti, a differenza del PSI e del PSIUP. Il MSI, alla cui guida era ritornato il fondatore Giorgio Almirante, lanciò la formula della Destra Nazionale volta a far presentare il partito come il raccoglitore unico della destra italiana: il risultato fu un grande successo, dato che la formazione neofascista non solo incamerò totalmente il voto dei monarchici che si erano da poco confluiti nelle fila missine, ma raggiunse quasi il 9% sottraendo una parte consistente dei voti del PLI, conseguentemente in forte calo, ma pescando al Sud anche nell\'elettorato conservatore democristiano. Le elezioni furono precedute da contestazioni da parte del Partito Radicale, che sosteneva che le camere fossero state sciolte in anticipo per sfruttare ad arte la norma che impediva di tenere referendum nello stesso anno in cui si tenessero elezioni politiche, al fine perciò di evitare il referendum sulla cosiddetta \"legge Fortuna\" in materia di divorzio.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Italian_general_election,_1972', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:01', '2013-05-02 13:32:01', '11891', 'NULL', 'NULL', 'NULL', '1', 'NULL', '92');
