INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('125', 'Elezioni presidenziali statunitensi del 1992', 'Le elezioni presidenziali statunitensi del 1992 si svolsero il 3 novembre 1992. La sfida oppose il presidente repubblicano uscente George Herbert Walker Bush e il candidato democratico William Jefferson (Bill) Clinton. Dopo la conclusione vittoriosa della prima guerra del Golfo, a molti politologi parve che Bush godesse d\'un consenso difficilmente scalfibile: secondo alcuni fu questa la ragione che spinse uno dei più popolari esponenti democratici, Mario Cuomo, a rinunciare alla candidatura alle primarie dell\'Asinello. Invece in termini di grandi elettori Clinton batté nettamente il presidente uscente, grazie soprattutto all\'affermazione d\'un terzo incomodo, il miliardario Ross Perot. Questi si aggiudicò il 19% dei suffragi, realizzando il miglior risultato per un candidato indipendente da più di ottant\'anni, e intercettando moltissimi voti repubblicani potenziali.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/United_States_presidential_election,_1992', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:26:06', '2013-05-02 13:26:06', '11915', 'NULL', 'NULL', 'NULL', '1', 'NULL', '109');
