INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('146', 'Elezioni parlamentari della Germania Est del 1990', 'Le Elezioni parlamentari del 1990 si tennero nella Repubblica Democratica Tedesca il 18 marzo 1990 per il rinnovo totale della Volkskammer, ossia il parlamento monocamerale della Repubblica. Esse furono le prime ed uniche libere elezioni parlamentari nella Germania Est, essendo state quelle precedenti caraterizzate dal sistema di voto monopolizzato dal Fronte nazionale guidato dalla SED. In quell\'area della Germania, sono state, dopo le elezioni federali del 1933, le uniche elezioni libere insieme a quelle per i parlamenti dei Länder svoltesi nel 1946. Furono eletti un totale di 400 deputati alla Volkskammer, e la maggioranza relativa andò alla coalizione dei partiti di centro-destra favorevoli all\'unificazione, l\'Alleanza per la Germania. La partecipazione degli elettori al voto fu del 93% circa.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/East_German_general_election,_1990', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:30:36', '2013-05-02 13:30:36', '11941', 'NULL', 'NULL', 'NULL', '1', 'NULL', '130');
