INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('153', 'Elezioni presidenziali croate del 2000', 'Le Elezioni presidenziali croate del 2000 si sono tenute in due turni, il 24 gennaio e il 7 febbraio. Esse sono risultate con la vittoria di Stjepan Mesi?, candidato del Partito Popolare Croato.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Croatian_presidential_election,_2000', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:28:42', '2013-05-02 13:28:42', '11949', 'NULL', 'NULL', 'NULL', '1', 'NULL', '137');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('154', 'Elezioni politiche italiane del 2006', 'Le elezioni politiche del 2006 per il rinnovo dei due rami del Parlamento della Repubblica Italiana - Camera dei deputati e Senato della Repubblica - si sono tenute il 9 e il 10 aprile. La vittoria è andata alla coalizione di centro-sinistra, che aveva come candidato alla presidenza del consiglio Romano Prodi, con un\'esigua maggioranza (circa 24.000 voti su 38 milioni) alla Camera e una consistente minoranza di circa 500.000 voti in meno al Senato, compensata dai 3 seggi conquistati in più nelle sezioni all\'estero. L\'esito della tornata elettorale è stato incerto fino alla fine dello scrutinio delle schede, attirando l\'attenzione della stampa internazionale. La coalizione sconfitta di centrodestra, ed altre parti politiche e giornalistiche hanno messo in dubbio la correttezza delle operazioni di voto e di scrutinio, portando ad una revisione parziale delle schede per l\'elezione del Senato.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Italian_general_election,_2006', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:27:35', '2013-05-02 13:27:35', '11950', '1116', '11951', 'NULL', '1', 'NULL', '138');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('155', 'Elezioni politiche italiane del 1987', 'Le elezioni politiche del 1987 si tennero il 14 giugno. Il Partito Socialista Italiano guidato da Bettino Craxi (che tra il 1983 e il 1987 aveva guidato due governi di Pentapartito) ottenne il miglior risultato dal 1958. La Democrazia Cristiana recuperò consensi rispetto al 1983; fu un proprio esponente, Giovanni Goria, il presidente del Consiglio nominato dopo questa consultazione. Il Partito Comunista Italiano, alle prime elezioni dopo la scomparsa di Enrico Berlinguer (avvenuta tre anni prima), perse diversi voti e questa fu l\'ultima consultazione per il rinnovo di Camera e Senato a cui il PCI partecipò. La \"novità\" di queste consultazioni furono le Liste Verdi, che ottennero alla Camera quasi un milione di voti. Iniziava inoltre la sua storia parlamentare anche la Lega Lombarda, che ottenne un seggio in entrambi i rami del Parlamento.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Italian_general_election,_1987', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:27:27', '2013-05-02 13:27:27', '11952', 'NULL', 'NULL', 'NULL', '1', 'NULL', '139');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('156', 'Elezioni presidenziali francesi del 1981', 'Le elezioni presidenziali francesi del 1981 si tennero il 24 aprile; non essendoci stato un vincitore con maggioranza assoluta al primo turno, si ricorse al ballottaggio il 10 maggio tra il Presidente uscente Valéry Giscard d\'Estaing, dell\'Unione per la Democrazia Francese, e François Mitterrand, del Partito Socialista. Quest\'ultimo vinse le elezioni con il 51,76%, diventando il primo presidente socialista della Repubblica francese.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/French_presidential_election,_1981', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:34', '2013-05-02 13:32:34', '11953', 'NULL', 'NULL', 'NULL', '1', 'NULL', '140');
