INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('158', 'Elezioni regionali in Sicilia del 2008', 'Le elezioni regionali in Sicilia del 2008 si sono tenute il 13 e 14 aprile 2008, contestualmente alle elezioni politiche. Esse hanno visto la vittoria di Raffaele Lombardo, sostenuto dal centro-destra, che ha sconfitto Anna Finocchiaro, sostenuta dal centro-sinistra. La consultazione elettorale si è svolta con tre anni di anticipo rispetto alla scadenza naturale della legislatura per le dimissioni del presidente Salvatore Cuffaro, in seguito alla condanna in primo grado a 5 anni e all\'interdizione perpetua dai pubblici uffici per i reati di favoreggiamento e rivelazione di segreto d\'ufficio. Le funzioni di Presidente della Regione sono state svolte dal vice presidente Nicola Leanza.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Sicilian_regional_election,_2008', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:27:38', '2013-05-02 13:27:38', '11955', '1117', '11956', 'NULL', '1', 'NULL', '142');
