INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('162', 'Elezioni generali di Sark del 2008', '\"Le elezioni generali di Sark del 2008 tenutesi il 10 dicembre, sono state le prime lezioni dell\'isola sotto una nuova costituzione. Sark è l\'ultimo territorio europeo che ha abolito il feudalesimo nel 2008. Ci sono stati 57 candidati alle elezioni (10% della popolazione) per 28 seggi. Il candidato con maggiori voti è stato 	David Thomas Cocksedge con 336. I candidati erano suddivisi tra i sostenitori del Seigneur e del vecchio sistema feudale e i sostenitori della democrazia, appoggiati dai miliardari fratelli Barclay. La vittoria è andata decisamente ai sostenitori del Seigneur che hanno ottenuto 26 seggi su 28. È divenuta ormai celebre la frase pronunciata dalla moglie del Seigneur a seguito delle negative reazioni dei Barclay al risultato elettorale: \"\"This is Democracy!\"\",come a significare \"\"l\'avete voluta? adesso vi dovete adeguare. \"\" i Barclay tuttavia non sono stati così diplomatici. Per approfondimenti vedi la sezione politica di Sark.\"', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Sark_general_election,_2008', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:25:21', '2013-05-02 13:25:21', '11961', '1119', '11962', 'NULL', '1', 'NULL', '146');
