INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('165', 'Elezioni presidenziali ucraine del 1994', 'Le elezioni presidenziali ucraine del 1994 si sono svolte in Ucraina il 26 giugno 1994, mentre il secondo turno si è tenuto il 10 luglio 1994. In seguito alle elezioni, il Presidente uscente Leonid Krav?uk dovette cedere la carica presidenziale all\'ex Primo Ministro Leonid Ku?ma. Le elezioni presidenziali si tennero in seguito a un compromesso politico tra il Presidente e il Parlamento. Nello stesso anno si tennero le elezioni parlamentari. A seguito della formale dissoluzione dell\'Unione Sovietica nel dicembre 1991, questa fu la prima elezione presidenziale nella Comunità degli Stati Indipendenti (formata dagli stati post-sovietici) in cui il Capo di Stato uscente, le cui radici affondavano nella nomenklatura sovietica, perse la leadership e accettò pacificamente l\'esito della consultazione elettorale democratica.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Ukrainian_presidential_election,_1994', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:15', '2013-05-02 13:31:15', '11967', 'NULL', 'NULL', 'NULL', '1', 'NULL', '149');
