INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('179', 'Elezioni presidenziali cilene del 1999', 'Le elezioni presidenziali cilene 1999 per il periodo 2000-2006 si sono svolte in due tornate elettorali: il primo turno domenica 12 dicembre 1999 ed il ballottaggio domenica 16 gennaio 2000. Per la prima volta dal ritorno alla democrazia nel paese avvenuta 11 anni prima si svolse un ballottaggio. Il candidato della coalizione di centrosinistra Concertación de Partidos por la Democracia Ricardo Lagos Escobar del Partito Socialista Cileno è arrivato primo al primo turno con il 47,95% ed al ballottaggio ha sconfitto il leader della Destra Joaquín Lavín Infante con il 51,31% al secondo turno. L\'affluenza alle urne è stata molto elevata e vicina al 90% e le schede annullate sono state molto basse, circa il 3%. Rispetto alle elezioni parlamentari dove si è verificato un aumento delle schede annullate a causa della delusione dell\'elettorato nei confronti del governo in carica che poi è riuscito a recuperare il consenso perduto. Questa elezione è stata considerata importante perché si consolida il governo di centrosinistra.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Chilean_presidential_election,_1999%E2%80%932000', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:27:56', '2013-05-02 13:27:56', '11986', 'NULL', 'NULL', 'NULL', '1', 'NULL', '163');
