INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('185', 'Elezioni europee del 2004', 'Le elezioni per il Parlamento europeo si sono tenute dal 10 giugno al 13 giugno 2004 nei 25 stati membri dell\'Unione europea, utilizzando varie scadenze elettorali secondo le tradizioni locali di ogni nazione. I voti vennero conteggiati alla chiusura delle urne ma i risultati non furono annunciati fino al 13 e 14 giugno per evitare di influenzare i votanti nelle altre nazioni in cui non si era ancora votato. Ciononostante, i Paesi Bassi, che avevano votato giovedì 10, annunciarono i risultati provvisori molto attendibili subito dopo il conteggio, la sera delle elezioni: questo fatto fu aspramente criticato dalla Commissione europea. Avevano diritto di voto 342 milioni di cittadini europei, il secondo elettorato democratico al mondo dopo l\'India. Furono le maggiori elezioni dirette transnazionali della storia, e i 10 nuovi stati membri elessero i loro membri del Parlamento europeo per la prima volta. Il nuovo parlamento vide così i suoi membri salire a 732. I risultati videro una sconfitta generale dei partiti al governo e un incremento della rappresentanza dei partiti euroscettici. Non fu raggiunta alcuna maggioranza: il bilanciamento dei poteri nel Parlamento rimase lo stesso nonostante i nuovi 10 stati membri. Le elezione europee del 2004 hanno registrato il più basso tasso di partecipazione. Nonostante l\'entrata in Europa di 10 nuovi Paesi, solo la metà degli elettori esercitò realmente il proprio diritto di voto (45%). La Polonia e la Slovacchia furono i paesi in cui si registrò il più alto tasso di astensionismo .', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/European_Parliament_election,_2004', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:26:49', '2013-05-02 13:26:49', '11994', 'NULL', 'NULL', 'NULL', '1', 'NULL', '169');
