INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('188', 'Elezioni parlamentari estoni del 1932', 'Le Elezioni parlamentari estoni del 1932 si svolsero tra il 21 e il 23 Maggio 1932. Prima di queste elezioni ci furono grandi cambiamenti nel panorama politico. Il Partito dei Contadini (principalmente costituito da anziani contadini ed agricoltori notoriamente più conservativo ed appartenente all\'ala destra) e il Partito dei Coloni (agricoltori patrioti di centro o sinistra) unirono le forze in un unico partito chiamato Partito dei Contadini Uniti (nome non ufficiale). Le forze centriste formarono anch\'essi una grossa colalizione ed un nuovo partito chiamato Partito Nazionale di Centro.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Estonian_parliamentary_election,_1932', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:25:20', '2013-05-02 13:25:20', '11999', 'NULL', 'NULL', 'NULL', '1', 'NULL', '172');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('189', 'Elezioni parlamentari australiane del 2010', 'Le elezioni parlamentari australiane del 2010 si sono tenute sabato 21 agosto 2010. Si tratta delle prime elezioni anticipate convocate dopo quelle del 1998. Il primo ministro in carica, la laburista Julia Gillard, dovette affrontare il leader dell\'opposizione liberale Tony Abbott. Le elezioni furono le prime dal 1940 a produrre un hung parliament dove nessun partito possedeva i 76 seggi necessari alla Camera dei Rappresentanti per poter governare da solo. Le urne videro, però, un grande aumento dei verdi nel campo politico australiano.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Australian_federal_election,_2010', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:05', '2013-05-02 13:32:05', '12000', '1131', '12001', 'NULL', '1', 'NULL', '173');
