INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('200', 'Elezioni presidenziali statunitensi del 1964', 'Le elezioni presidenziali statunitensi del 1964 si svolsero il 3 novembre 1964. La sfida oppose il candidato repubblicano Barry Morris Goldwater e il presidente uscente democratico Lyndon Baines Johnson, che infine ottenne la riconferma. Johnson aveva vinto le presidenziali del 1960 come candidato vicepresidente, ma era subentrato alla presidenza in seguito all\'assassinio di Kennedy il 22 novembre 1963.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/United_States_presidential_election,_1964', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:29:41', '2013-05-02 13:29:41', '12014', 'NULL', 'NULL', 'NULL', '1', 'NULL', '184');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('201', 'Elezioni presidenziali ucraine del 2004', 'Le elezioni presidenziali tenutesi nel novembre e dicembre 2004 in Ucraina sono state una battaglia politica tra l\'allora Primo Ministro Viktor Janukovy? e l\'ex Primo Ministro e capo dell\'opposizione Viktor Juš?enko. L\'elezione si svolse in un\'atmosfera particolarmente nervosa, con sospetti di intimidazioni e anche dell\'avvelenamento di Juš?enko, che fu poi confermato essere il risultato di avvelenamento per diossina. Secondo i risultati ufficiali, annunciati il 23 novembre, l\'elezione era stata vinta da Janukovy?, ma Juš?enko e i suoi sostenitori, come anche molti osservatori internazionali, denunciarono le elezioni come truccate. Ciò portò a una grave crisi politica e ad atti di disobbedienza civile, noti col nome di \"rivoluzione arancione\", che portarono infine la Corte Suprema dell\'Ucraina ad annullare i risultati e a ripetere il secondo turno elettorale. Il secondo svolgimento del secondo turno avvenne il 26 dicembre. Gli osservatori affermarono che il voto era stato maggiormente libero, e Viktor Juš?enko ottenne questa volta il 52% dei voti, contro il 44% di Janukovy?. Juš?enko fu quindi dichiarato vincitore il 10 gennaio 2005, dopo il fallimento di un\'azione legale intentata da Janukovy?.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Ukrainian_presidential_election,_2004', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:28:43', '2013-05-02 13:28:43', '12015', 'NULL', 'NULL', 'NULL', '1', 'NULL', '185');
