INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('210', 'Elezioni presidenziali argentine del 2007', 'Le elezioni presidenziali argentine del 2007 si sono svolte domenica 28 ottobre del 2007 per decidere il nuovo Presidente dell\'Argentina oltre il rinnovamento di 127 dei 257 seggi del Parlamento Nazionale. Assieme a queste elezioni sono stati eletti diversi governatori di alcune province e alcuni sindaci di alcune città. Per poter essere eletti alla massima magistratura al primo turno occorre ottenere almeno il 45% dei voti oppure ottenere almeno il 40% purché la distanza rispetto al secondo candidato sia superiore al 10%, in caso contrario si procede ad un ballottaggio. La candidata del partito Frente para la Victoria, di tendenza progressista, Cristina Fernandez de Kirchner è stata eletta al primo turno con il 45,3% dei voti.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Argentine_general_election,_2007', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:28:35', '2013-05-02 13:28:35', '12027', '1137', '12028', 'NULL', '1', 'NULL', '194');
