INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('213', 'Elezioni politiche italiane del 1948', 'Le elezioni politiche del 1948 si tennero il 18 aprile. Costituirono la seconda consultazione elettorale a suffragio universale, dopo quella del 1946. La Democrazia Cristiana si aggiudicò la maggioranza relativa dei voti e quella assoluta dei seggi, caso unico nella storia della Repubblica. Il partito guidato da Alcide De Gasperi ottenne oltre 4,6 milioni di voti in più e un balzo del 13% rispetto alle elezioni della Costituente, diventando il punto di riferimento per l\'elettorato anticomunista. Rilevante la sconfitta del Fronte Democratico Popolare, lista che comprendeva sia il PCI che il Partito Socialista Italiano. Con il 31% dei voti, i due partiti di sinistra ottennero insieme meno voti di quanti ne conquistarono separatamente nel 1946. Le elezioni del 1948 furono notevolmente influenzate dalle questioni internazionali. La Guerra Fredda e la divisione del mondo in sfere d\'influenza avevano una grossa ripercussione sull\'Italia. Un\'eventuale vittoria delle sinistre avrebbe con tutta probabilità favorito l\'adesione della giovane Repubblica al Patto di Varsavia anziché al blocco occidentale. Le elezioni furono importanti perché fissarono per lungo tempo alcuni capisaldi della Repubblica italiana: il pluralismo polarizzato che prevedeva una DC sempre vincente; l\'esclusione dei comunisti da ogni governo; l\'adesione dell\'Italia al blocco occidentale; la forte appartenenza ideologica; la presenza di forti partiti di massa; l\'adesione a due concezioni della società oltre che a dei meri partiti politici; la bassa mobilità elettorale; il sistema elettorale proporzionale puro; una mappa geopolitica che vedeva le sinistre forti nel centro-nord, la DC nel Triveneto e le destre al Sud; la contrapposizione comunismo-anticomunismo; la trasformazione dell\'avversario politico in nemico da delegittimare; l\'influenza più o meno marcata delle gerarchie ecclesiastiche nella politica. Per vastità della mobilitazione, numero di votanti, importanza della posta in gioco, le elezioni del 1948 segnano un unicum nella storia delle consultazioni elettorali italiane.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Italian_general_election,_1948', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:13', '2013-05-02 13:31:13', '12031', 'NULL', 'NULL', 'NULL', '1', 'NULL', '197');
