INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('216', 'Elezioni europee del 2009', 'Le elezioni europee del 2009 si sono tenute tra il 4 e il 7 giugno nei 27 stati dell\'Unione europea; ogni stato ha scelto la data delle elezioni a seconda delle consuetudini proprie della nazione o secondo quanto stabilito dai singoli governi — ad esempio, in Italia il 6 e 7 giugno, di sabato e domenica, come nel 2004, ma diversamente da quanto accaduto nelle più recenti elezioni, mentre nel Regno Unito il 4 giugno, di giovedì, come avviene solitamente. 500 milioni di europei sono rappresentati, a seguito delle elezioni, da 736 membri del Parlamento europeo con il sistema proporzionale, superando le elezioni del 2004 che furono le più grandi elezioni trans-nazionali della storia.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/European_Parliament_election,_2009', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:18', '2013-05-02 13:32:18', '12034', '1138', '12035', 'NULL', '1', 'NULL', '200');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('217', 'Comiket', ', conosciuto anche come Comic Market o CM, è la più grande manifestazione dedicata ai fumetti al mondo. Viene tenuta due volte all\'anno a Tokyo, in Giappone. Il primo Comiket fu organizzato nel dicembre 1975, e vi parteciparono solamente circa 30 circoli e 700 persone. Da allora il pubblico è aumentato esponenzialmente, fino ad arrivare alle quasi 550.000 persone che mediamente vi partecipano al giorno d\'oggi. La manifestazione dura due o tre giorni, ed è un\'occasione per molti disegnatori in erba per pubblicizzare i propri lavori, soprattutto d?jinshi. Poiché gli oggetti venduti ad un Comiket sono considerati rari ed estremamente preziosi (in quanto un d?jinshi è raramente ristampato), alcuni possono essere trovati nei negozi con prezzi fino a 10 volte quelli originali. Ogni Comiket viene organizzato da un comitato speciale, chiamato Comitato per la Preparazione del Comic Market (???????????, Komikku Maketto Shunbi-kai)', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Comiket', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:28:48', '2013-05-02 13:28:48', '12036', 'NULL', 'NULL', 'NULL', '1', 'NULL', '201');
