INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('220', 'Elezioni presidenziali polacche del 1995', 'Le elezioni presidenziali polacche del 1995 si sono tenute il 5 e 19 novembre. Esse hanno visto la vittoria di Aleksander Kwa?niewski, sostenuto dall\'Alleanza della Sinistra Democratica, che ha sconfitto il presidente uscente Lech Wa??sa, appoggiato da Solidarnosc.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Polish_presidential_election,_1995', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:04', '2013-05-02 13:32:04', '12040', 'NULL', 'NULL', 'NULL', '1', 'NULL', '204');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('221', 'Elezioni parlamentari ucraine del 1994', 'Le prime elezioni parlamentari nell\'Ucraina indipendente si sono tenute nel 1994. Le elezioni sono state il risultato di un compromesso politico tra il Presidente e il Parlamento, raggiunto il 24 settembre 1993. Il quel giorno, il Parlamento ha adottato un decreto atto a organizzare le elezioni parlamentari il 24 marzo 1994, e l\'elezione presidenziale il 26 giugno 1994. Le elezioni si sono svolte secondo un sistema elettorale maggioritario in 450 regioni elettorali. Per essere eletto in ogni regione, ogni candidato doveva ottenere più del 50% dei voti e per la validità dell\'elezione doveva votare almeno il 50% degli aventi diritto. Questa elezione fu organizzata in due scaglioni: se nessun candidato otteneva più del 50% dei voti nel primo round, i due candidati che avevano ottenuto il maggior numero di voti partecipavano al ballottaggio al secondo turno. Il primo turno ebbe luogo il 24 marzo 1994, mentre il secondo turno fu il 10 aprile 1994. In totale, nei due turni furono eletti 338 su 450 deputati. Nelle regioni elettorali in cui non era stato eletto alcun deputato, si tennero nuove elezioni nei mesi di settembre e ottobre del 1994, a seguito delle quali il Parlamento contava 405 membri. Ci furono ancora ulteriori elezioni nei distretti che non avevano ancora eletto un deputato, e principalmente l\'invalidità dell\'elezione fu dovuta alla bassa partecipazione dei votanti.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Ukrainian_parliamentary_election,_1994', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:30:26', '2013-05-02 13:30:26', '12041', 'NULL', 'NULL', 'NULL', '1', 'NULL', '205');
