INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('230', 'Elezioni politiche italiane del 1996', 'Le elezioni politiche del 1996 si sono tenute il 21 aprile. Rispetto alle precedenti elezioni politiche 1994, quelle del 1996 segnarono più compiutamente il passaggio ad un sistema bipolare. I partiti \"centristi\", nel 1994, si erano presentati nel Patto per l\'Italia ma, essendo stati fortemente penalizzati dal sistema elettorale maggioritario, furono indotti a trovare una collocazione nell\'ambito di due schieramenti tra loro contrapposti. Il Partito Popolare Italiano promosse un\'alleanza di centro-sinistra, mentre alcuni settori si dissociarono e fondarono i Cristiani Democratici Uniti, nello schieramento di centro-destra. Il Patto Segni si presentò invece all\'interno di Rinnovamento Italiano. Le coalizioni che si affrontarono furono: L\'Ulivo, guidato da Romano Prodi, era costituito da Partito Democratico della Sinistra, Partito Popolare Italiano, Comitati per l\'Italia che vogliamo, Rinnovamento Italiano e Federazione dei Verdi, e che giunse ad un accordo elettorale di desistenza con Rifondazione Comunista; il Polo per le Libertà, guidato dal Silvio Berlusconi, era costituito da Forza Italia, Alleanza Nazionale e Centro Cristiano Democratico - Cristiani Democratici Uniti, con alcuni accordi minimali con la Lista Pannella. Si presentava invece in modo autonomo la Lega Nord.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Italian_general_election,_1996', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:24', '2013-05-02 13:32:24', '12053', 'NULL', 'NULL', 'NULL', '1', 'NULL', '214');
