INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('236', 'Elezioni presidenziali cilene del 2009', 'Le elezioni presidenziali cilene 2009 per il periodo 2010-2014 si sono svolte secondo la Costituzione del Cile il giorno 13 dicembre 2009 assieme alle elezioni per il rinnovamento della Camera dei deputati e del Senato della Repubblica. Poiché nessun candidato ha ottenuto la maggioranza dei voti si è ricorso al ballottaggio il 17 gennaio 2010 tra i due candidati più votati ossia il leader della coalizione di centro-destra Sebastián Piñera (44,05%) e quello del centro-sinistra Eduardo Frei Ruiz-Tagle (29,60%). Al ballottaggio prevale il candidato Piñera che ha conseguito il 51,6% contro il 48,4% di Frei che ha posto fine ai 20 anni di governo consecutivi della coalizione di centrosinistra formata da democristiani e socialdemocratici. La presidente Michelle Bachelet non può ricandidarsi dato che la legge non consente ad un presidente uscente di ripresentarsi alle elezioni successive. Secondo la Costituzione cilena possono esercitare il diritto di voto i cittadini che hanno compiuto i 18 anni di età e quelli che non hanno ricevuto una condanna superiore ai 3 anni. Per votare occorre l\'iscrizione nei registri elettorali e l\'esibizione della Carta d\'identità. Possono votare i cittadini stranieri che risiedono in Cile da almeno 5 anni. Il diritto di voto è sospeso per interdizione, per chi è accusato di omicidio o per chi è stato condannato per terrorismo e per sanzione del Tribunale Superiore Elettorale. Il voto è volontario ma qualora un elettore si iscrivesse nei registri elettorali e non si recasse alle urne può essere condannato a pagare una multa. Il 27 marzo 2009 la presidente Michelle Bachelet ha modificato la legge elettorale in vigore introducendo la cosiddetta iscrizione volontaria ai registri elettorali che permette gli elettori di scegliere o meno di andare a votare.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Chilean_presidential_election,_2009%E2%80%932010', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:27:05', '2013-05-02 13:27:05', '12061', '1145', '12062', 'NULL', '1', 'NULL', '220');
