INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('257', 'Elezioni parlamentari lituane del 2004', 'Le elezioni parlamentari lituane del 2004 si svono svolte il 10 ottobre (primo turno) e il 28 ottobre (secondo turno). Esse hanno visto la vittoria della coalizione formata da Partito Laburista, Partito Socialdemocratico di Lituania e Nuova Unione. Primo ministro è stato riconfermato il socialdemocratico Algirdas Brazauskas, sostituito, nel 2006, da Gediminas Kirkilas.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Lithuanian_parliamentary_election,_2004', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:28:55', '2013-05-02 13:28:55', '12089', 'NULL', 'NULL', 'NULL', '1', 'NULL', '241');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('258', 'Elezioni presidenziali moldave del 2009 (maggio)', 'Le elezioni presidenziali indirette si sono tenute in Moldavia a seguito delle elezioni parlamentari, tenutesi nel mese di aprile 2009. Il Presidente in carica Vladimir Voronin non può essere rieletto, avendo già ricoperto due mandati; inoltre, egli è stato eletto Presidente del Parlamento della Moldavia all\'inizio del mese di maggio. Il Partito dei Comunisti della Repubblica di Moldavia (PCRM), partito unico al governo, ha nominato Zinaida Greceanîi quale sua candidata. Dato che il PCRM deteneva solamente 60 su 101 seggi, ma ne erano necessari 61 (i tre quinti) per eleggere un Presidente, era necessario almeno un voto dissenziente dell\'opposizione. Quest\'ultima aveva però già annunciato che avrebbe boicottato le elezioni, obbligando pertanto a elezioni parlamentari ancitipate, dato che la Costituzione moldava prevede che in caso il Parlamento non riesca per due volte consecutive ad eleggere un Presidente, esso debba essere sciolto e si debbano svolgere nuove elezioni. Al primo turno, svoltosi il 20 maggio 2009, l\'opposizione boicottò con successo la procedura elettorale; fu quindi istituito un secondo turno di votazione per il 28 maggio 2009. In quella data, però, si decise di posticipare l\'elezione al 3 giugno 2009; il PCRM sostenne che la motivazione era la festività dell\'Ascensione, che cadeva proprio in quel giorno, mentre l\'opposizione criticò i tentativi del PCRM di allungare i tempi. Il 2 giugno 2009, l\'ex Presidente del Parlamento Marian Lupu (che era un possibile candidato alla carica di Primo Ministro, nel gioco di poltrone tra Voronin, Greceanîi e Lupu stesso) abbandonò il PCRM per l\'opposizione, affermando di essersi reso conto che il PCRM non era democratico e non poteva essere riformato dall\'interno. Come atteso, il secondo turno delle elezioni presidenziali fu senza successo, e portò quindi alle elezioni anticipate svoltesi il 29 luglio 2009. In entrambi i turni, i candidati erano stati nominati dal PCRM: Stanislav Groppa, un dottore, al primo turno, e Andrei Neguta, l\'ambasciatore moldavo in Russia, al secondo turno.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Moldovan_presidential_election,_May%E2%80%93June_2009', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:27:49', '2013-05-02 13:27:49', '12090', '1152', '12091', 'NULL', '1', 'NULL', '242');
