INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('261', 'Elezioni presidenziali colombiane del 2006', 'Le elezioni presidenziali della Colombia 2006 si sono svolte domenica 28 maggio 2006 per eleggere il nuovo Presidente della Colombia ed il nuovo Vicepresidente della Repubblica. Álvaro Uribe Vélez è stato rieletto Presidente della Repubblica e potrà governare per un altro mandato quadriennale, a partire dal 7 agosto 2006. Uribe ha ottenuto il 62,20% dei voti, sorpassando abbondantemente la soglia del 50% necessaria per essere eletto direttamente al primo turno, senza bisogno del ballottaggio. Un emendamento costituzionale proposto dal governo ha permesso ad Álvaro Uribe di essere il primo presidente in oltre 100 anni a potersi ripresentare alle presidenziali per un secondo mandato consecutivo.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Colombian_presidential_election,_2006', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:17', '2013-05-02 13:32:17', '12094', '1153', '12095', 'NULL', '1', 'NULL', '245');
