INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('269', 'Elezioni legislative portoghesi del 1980', 'Le elezioni legislative portoghesi del 1980 si sono tenute il 5 ottobre. Esse hanno visto la vittoria dell\'Alleanza Democratica di Francisco Sá Carneiro, che è stato confermato Primo Ministro. Sá Carneiro morì inaspettatamente nella notte del 4 dicembre 1980 quando il piccolo aereo che lo trasportava si è schiantato alla periferia di Lisbona. Questo incidente non è mai stato molto chiaro chi stava conducendo le teorie di un attacco. È stato sostituito da Diogo Freitas do Amaral fino all\'elezione di Francisco Pinto Balsemão come leader dell\'Alleanza nel gennaio 1981.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Portuguese_legislative_election,_1980', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:30:04', '2013-05-02 13:30:04', '12105', 'NULL', 'NULL', 'NULL', '1', 'NULL', '253');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('270', 'Elezioni europee del 1984 (Italia)', 'Le seconde elezioni per il Parlamento europeo si svolsero in Italia il 17 giugno 1984. Ebbero una discreta eco politica in quanto furono le elezioni cosiddette del \"sorpasso\"; il PCI, per la prima ed unica volta in un\'elezione su base nazionale, si affermò come primo partito, conquistando più voti e seggi della Democrazia Cristiana, probabilmente sulla scia della recentissima morte di Enrico Berlinguer, Segretario del PCI.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/European_Parliament_election,_1984_(Italy)', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:26:02', '2013-05-02 13:26:02', '12106', 'NULL', 'NULL', 'NULL', '1', 'NULL', '254');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('271', 'Elezioni europee del 2004 (Italia)', 'Le elezioni europee del 2004 in Italia si sono tenute il 12 e il 13 giugno. L\'alta frammentazione del panorama politico italiano rende difficile identificare una tendenza complessiva, ma il risultato fu generalmente visto come una sconfitta per il Presidente del Consiglio Silvio Berlusconi e una vittoria per la coalizione di opposizione di centrosinistra identificata con Romano Prodi, che era Presidente della Commissione europea uscente ed era ampiamente atteso come rientrante nella politica interna italiana per le successive elezioni politiche.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/European_Parliament_election,_2004_(Italy)', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:30:38', '2013-05-02 13:30:38', '12107', 'NULL', 'NULL', 'NULL', '1', 'NULL', '255');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('272', 'Elezioni parlamentari romene del 2008', 'Le elezioni parlamentari romene del 2008 si sono tenute il 30 novembre e hanno visto la vittoria del Partito Democratico Liberale che ha ottenuto più seggi malgrado il maggior numero di voti raggiunto Partito Social Democratico sia alla Camera che al Senato. In seguito all\'esito elettorale, Primo ministro è divenuto il liberal-democratico Emil Boc.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Romanian_legislative_election,_2008', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:12', '2013-05-02 13:31:12', '12108', '1156', '12109', 'NULL', '1', 'NULL', '256');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('273', 'Elezioni parlamentari ceche del 2006', 'Le elezioni parlamentari ceche del 2006 si sono tenute il 2 e 3 giugno. Esse hanno visto la vittoria del Partito Democratico Civico di Mirek Topolánek, che è divenuto Primo ministro. Dopo la caduta del suo governo, nel marzo 2009, è stato sostituito dall\'indipendente Jan Fischer.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Czech_legislative_election,_2006', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:14', '2013-05-02 13:31:14', '12110', '1157', '12111', 'NULL', '1', 'NULL', '257');
