INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('275', 'Elezioni politiche italiane del 1979', 'Le elezioni politiche del 1979 si tennero il 3 giugno, una settimana prima delle prime elezioni europee. Furono le terze elezioni anticipate negli anni Settanta, le prime in assoluto nella storia repubblicana a svolgersi a soli tre anni dalla precedente tornata. Per la prima volta nella storia elettorale repubblicana il Partito Comunista accusò un calo dei voti; ciò gli impedì di effettuare l\'agognato \"sorpasso\" (il raggiungimento, cioè della maggioranza relativa) ai danni di una Democrazia Cristiana complessivamente stabile (-0,41% dei voti e lo stesso numero di deputati eletti rispetto alle consultazioni del 1976). Gli effetti elettorali della strategia della tensione furono un prosciugamento delle estreme a favore di una più moderata contestazione antidemocristiana, riversata all\'interno degli alleati minori di governo che ne ottennero tutti benefici più o meno marcati. A destra, perse qualcosa il Movimento Sociale Italiano, che aveva subìto la scissione di Democrazia Nazionale. I liberali sfiorarono il 2%, mentre il Partito Radicale ottenne più del triplo dei voti rispetto a tre anni prima.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Italian_general_election,_1979', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:21', '2013-05-02 13:32:21', '12113', 'NULL', 'NULL', 'NULL', '1', 'NULL', '259');
