INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('285', 'Elezioni presidenziali statunitensi del 2004', 'Le elezioni presidenziali statunitensi del 2004 si svolsero il 2 novembre 2004, contestualmente alle elezioni del Congresso. La sfida presidenziale oppose il presidente repubblicano uscente George W. Bush e il senatore democratico John Kerry. Il tema dominante della campagna elettorale fu la politica estera, in particolare la guerra al terrorismo e la guerra d\'Iraq. Come nelle elezioni del 2000, ci furono controversie e dubbi sulla regolarità del voto emersi durante e dopo la votazione. Il vincitore fu proclamato il giorno seguente, quando Kerry decise di non contestare la vittoria di stretto margine di Bush in Ohio, dato che difficilmente una differenza di 100.000 voti (pari al 2%) avrebbe potuto essere colmata. I grandi elettori di questo stato furono decisivi nel determinare la vittoria. Grazie all\'affluenza record Bush ricevette 62 milioni di voti, il maggior numero raggiunto da un candidato alla presidenza sino ad allora, mentre i voti per Kerry (59 milioni) erano il secondo maggior risultato.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/United_States_presidential_election,_2004', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:29:25', '2013-05-02 13:29:25', '12126', 'NULL', 'NULL', 'NULL', '1', 'NULL', '269');
