INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('287', 'Elezioni parlamentari ucraine del 2007', 'In Ucraina il 30 settembre 2007 si sono tenute le elezioni parlamentari anticipate, a seguito di un accordo tra il Presidente Viktor Juš?enko, il Primo Ministro Viktor Janukovi? e il Presidente della Verchovna Rada (il Parlamento ucraino) Oleksandr Moroz avvenuto il 27 maggio 2007, per tentare di risolvere la crisi politica scatenata il 2 aprile 2007 dal decreto presidenziale di scioglimento del Parlamento. Secondo l\'attuale sistema elettorale ucraino, i 450 seggi sono divisi tra i partiti che raggiungono un minimo del 3% dei voti totali. Il numero dei seggi assegnati ad ogni partito che abbia superato tale soglia, è calcolato utilizzando il metodo di Hamilton. L\'alleanza dei due blocchi elettorali associati alla Rivoluzione Arancione ha ottenuto la vittoria in debole misura.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Ukrainian_parliamentary_election,_2007', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:30:38', '2013-05-02 13:30:38', '12129', '1162', '12130', 'NULL', '1', 'NULL', '271');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('288', 'Elezioni federali tedesche del 1980', 'Le Elezioni federali in Germania Ovest del 1980, le none dal dopoguerra, si tennero il 5 ottobre, per eleggere i membri del 9º Bundestag.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/West_German_federal_election,_1980', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:54', '2013-05-02 13:31:54', '12131', 'NULL', 'NULL', 'NULL', '1', 'NULL', '272');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('289', 'Elezioni parlamentari macedoni del 2008', 'Le elezioni parlamentari macedoni del 2008 si sono tenute il 1º giugno. Esse hanno visto la vittoria del Partito Democratico per l\'Unità Nazionale Macedone di Nikola Gruevski, che è stato confermato Primo ministro.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Macedonian_parliamentary_election,_2008', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:25:26', '2013-05-02 13:25:26', '12132', '1163', '12133', 'NULL', '1', 'NULL', '273');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('290', 'Elezioni presidenziali lituane del 2002', 'Le elezioni presidenziali lituane del 2002 si sono tenute il 2 dicembre (primo turno) e il 5 gennaio 2003 (secondo turno). Esse hanno visto la vittoria di Rolandas Paksas, sostenuto dal Partito Democratico Liberale, che ha sconfitto il presidente uscente Valdas Adamkus, indipendente. Paksas è quindi divenuto Presidente.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Lithuanian_presidential_election,_2002%E2%80%932003', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:29:17', '2013-05-02 13:29:17', '12134', 'NULL', 'NULL', 'NULL', '1', 'NULL', '274');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('291', 'Elezioni parlamentari danesi del 1998', 'Le elezioni parlamentari danesi del 1998 si sono tenute l\'11 marzo. Esse hanno visto la vittoria dei Socialdemocratici di Poul Nyrup Rasmussen, che è stato confermato Primo ministro.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Danish_parliamentary_election,_1998', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:26:45', '2013-05-02 13:26:45', '12135', 'NULL', 'NULL', 'NULL', '1', 'NULL', '275');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('292', 'Elezioni presidenziali polacche del 2005', 'Le elezioni presidenziali polacche del 2005 si sono tenute il 9 e il 23 ottobre. Esse hanno visto la vittoria al secondo turno di Lech Kaczy?ski, leader di Diritto e Giustizia, che ha sconfitto lo sfidante Donald Tusk, leader di Piattaforma Civica. Sebbene entrambi i candidati fossero di centro-destra e i loro due partiti fossero uniti nella coalizione di governo uscita dalle elezioni parlamentari del 2005, sussistevano differenze significative tra i due esponenti: Tusk è considerato maggiormente liberale in economia ed europeista, Kaczy?ski più conservatore ed euroscettico. L\'allora Presidente della Polonia Aleksander Kwa?niewski, rimasto in carica per due mandati, non ha potuto correre per un terzo. L\'Alleanza della Sinistra Democratica, dopo aver varato la candidatura dell\'ex primo ministro W?odzimierz Cimoszewicz, ha appoggato Marek Borowski, che si è aggiudicato solo il quarto posto dietro Andrzej Lepper, appoggiato dall\'Autodifesa della Repubblica di Polonia. L\'affluenza alle urne del primo turno è stata piuttosto bassa, con solo il 49,6% di voti espressi dagli aventi diritto.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Polish_presidential_election,_2005', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:27:59', '2013-05-02 13:27:59', '12136', 'NULL', 'NULL', 'NULL', '1', 'NULL', '276');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('293', 'Elezioni legislative francesi del 2002', 'Le elezioni legislative francesi del 2002 si sono tenute il 9 giugno (primo turno) e il 16 giugno (secondo turno). Esse hanno visto la vittoria dell\'Unione per un Movimento Popolare, nell\'ambito della coalizione di centro-destra.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/French_legislative_election,_2002', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:47', '2013-05-02 13:31:47', '12137', 'NULL', 'NULL', 'NULL', '1', 'NULL', '277');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('294', 'Elezioni presidenziali statunitensi del 2000', 'Le elezioni presidenziali statunitensi del 2000 si svolsero il 7 novembre 2000. La sfida oppose il candidato repubblicano George W. Bush e il vicepresidente democratico uscente Al Gore. In termini di voto popolare prevalse quest\'ultimo, ma i voti elettorali, 271 contro 266, furono favorevoli a Bush e ne determinarono l\'elezione. La proclamazione del vincitore venne rinviata per molti giorni, poiché nello Stato determinante della Florida fu necessario ricontare i voti, addirittura a mano. Un fattore determinante per la sconfitta di Gore fu la candidatura dell\'indipendente Ralph Nader, che strappò al candidato democratico quasi 3 milioni di voti, e risultò decisivo proprio in Florida e nel New Hampshire. Bush ottenne la maggioranza in Florida con un distacco di appena 500 voti circa.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/United_States_presidential_election,_2000', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:27:02', '2013-05-02 13:27:02', '12138', 'NULL', 'NULL', 'NULL', '1', 'NULL', '278');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('295', 'Elezioni parlamentari australiane del 2007', 'Le elezioni parlamentari australiane del 2007 si tennero sabato 24 novembre 2007 e chiamarono alle urne più di 13 milioni di australiani. Il Partito Laburista Australiano guidato da Kevin Rudd riuscì a sconfiggere con una storica vittoria il Partito Liberale dell\'Australia, al governo del 1996. Il primo ministro in carica John Howard, sostenuto da una coalizione liberal-nazionale, fu sconfitto dopo quasi 11 anni di governo e ben 4 elezioni di seguito che lo videro sempre vincitore, e perse anche il suo seggio di parlamentare in favore della giornalista ABC Maxine McKew.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Australian_federal_election,_2007', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:27:57', '2013-05-02 13:27:57', '12139', '1164', '12140', 'NULL', '1', 'NULL', '279');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('296', 'Elezioni parlamentari slovacche del 2010', 'Le elezioni parlamentari slovacche del 2010 si sono tenute il 12 giugno. Esse hanno visto la vittoria di Direzione - Socialdemocrazia di Robert Fico; a seguito dell\'esito elettorale, tuttavia, Primo ministro è divenuta Iveta Radi?ová, leader dell\'Unione Cristiano Democratica.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Slovak_parliamentary_election,_2010', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:04', '2013-05-02 13:31:04', '12141', '1165', '12142', 'NULL', '1', 'NULL', '280');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('297', 'Elezioni legislative svedesi del 2002', 'Le elezioni legislative svedesi del 2002 si sono tenute il 15 settembre. Esse hanno visto la vittoria del Partito Socialdemocratico Svedese di Göran Persson, che è stato confermato Primo Ministro.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Swedish_general_election,_2002', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:25:49', '2013-05-02 13:25:49', '12143', 'NULL', 'NULL', 'NULL', '1', 'NULL', '281');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('298', 'Elezioni politiche italiane del 1976', 'Le elezioni politiche del 1976 si tennero il 20 giugno. Furono le prime elezioni politiche con il voto ai diciottenni. La situazione politica aveva evidenziato la possibilità del cosiddetto \"sorpasso\" del Partito Comunista ai danni della Democrazia Cristiana: per questo, durante la campagna elettorale si diffusero sollecitazioni a votare per la DC in funzione di contrasto all\'avanzata del PCI, anche \"turandosi il naso\"; il risultato mostrò una tenuta dello Scudo Crociato ed un arretramento sia del PLI (che quasi scomparve), sia dell\'MSI rispetto al consenso precedentemente acquisito in quegli anni.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Italian_general_election,_1976', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:30:57', '2013-05-02 13:30:57', '12144', 'NULL', 'NULL', 'NULL', '1', 'NULL', '282');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('299', 'Elezioni parlamentari slovene del 2004', 'Le elezioni parlamentari slovene del 2004 si sono tenute il 3 ottobre. Sono stati eletti 90 membri dell\'Assemblea Nazionale, 2 dei quali rappresentanti delle comunità nazionali italiana e ungherese. Il leader del Partito Democratico Sloveno Janez Janša ha formato un governo assieme al Partito Popolare Sloveno, a Nuova Slovenia e al Partito Democratico dei Pensionati della Slovenia.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Slovenian_parliamentary_election,_2004', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:13', '2013-05-02 13:31:13', '12145', 'NULL', 'NULL', 'NULL', '1', 'NULL', '283');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('300', 'Elezioni parlamentari polacche del 2005', 'Le elezioni parlamentari per entrambe le camere del Parlamento della Polonia si sono tenute il 25 settembre 2005. Avevano diritto al voto trenta milioni di elettori, per eleggere i 260 membri della camera bassa, il Sejm (Sejm Rzeczypospolitej Polskiej), e i 100 membri della camera alta, il Senato della Polonia (Senat Rzeczypospolitej Polskiej). Le elezioni provocarono un\'ampia vittoria per due partiti di centro-destra, il conservatore Diritto e Giustizia (PiS) e i liberal-conservatori della Piattaforma Civica (PO). L\'allora governo di centro-sinistra dell\'Alleanza della Sinistra Democratica (SLD) fu sconfitto; i due partiti vincitori ottennero 288 sui 460 seggi, mentre l\'SLD ne conquistò solo 55. Il PiS ottenne 155 seggi, mentre PO 133. Il leader di Pis, Jaros?aw Kaczy?ski, rinunciò all\'opportunità di divenire Primo ministro della Polonia, per non pregiudicare la corsa alla Presidenza della Repubblica del fratello gemello, Lech Kaczy?ski. Il Primo Ministro uscente, Marek Belka, perse il proprio seggio. Al Senato, il PiS ottenne 49 seggi, mentre PO 34 (su 100), lasciando agli altri otto partiti i restanti 17 seggi. SLD non ottenne seggi al Senato.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Polish_parliamentary_election,_2005', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:25:54', '2013-05-02 13:25:54', '12146', 'NULL', 'NULL', 'NULL', '1', 'NULL', '284');
