INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('307', 'Elezioni presidenziali ghanesi del 2008', 'Il 7 e 28 dicembre 2008 si sono tenute in Ghana le elezioni presidenziali, per eleggere il 12esimo presidente del Ghana, successore dell\'attuale presidente John Agyekum Kufuor in carica dal 7 gennaio 2001. Vincitore delle elezioni e prossimo presidente ghanese dal 7 gennaio 2009 è il Professor John Evans Atta-Mills già vice presidente alla fine degli anni novanta e finalmente vincitore delle elezioni presidenziali dopo due sconfitte nel 2000 e 2004. I candidati alla presidenza del Ghana, accettati dalla Commissione Elettorale Nazionale, sono: Nana Addo Dankwa Akufo-Addo del New Patriotic Party (NPP), attualmente partito di governo. John Evans Atta-Mills del National Democratic Congress (NDC), principale partito d\'opposizione. Paa Kwesi Nduom del Convention People\'s Party (CPP). Edward Mahama del People\'s National Convention (PNC). Emmanuel Ansah-Antwi del Democratic Freedom Party (DFP). Thomas Ward-Brew del Democratic People\'s Party (DPP). Kwamena Adjei del Reformed Patriotic Democrats (RPD). Kwesi Amoafo-Yeboah, candidato indipendente.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Ghanaian_presidential_election,_2008', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:17', '2013-05-02 13:31:17', '12156', '1169', '12157', 'NULL', '1', 'NULL', '291');
