INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('309', 'Elezioni presidenziali polacche del 2010', 'Le elezioni presidenziali polacche del 2010 si sono tenute il 20 giugno (primo turno) e il 4 luglio (secondo turno). Queste consultazioni si svolgono dopo la morte del Presidente in carica Lech Kaczy?ski, avvenuta in un incidente aereo il 10 aprile. Le elezioni si sarebbero di regola svolte in autunno, ma la Costituzione prevede che la data delle elezioni sia fissata in un termine massimo di sessanta giorni dalla decadenza del mandato. I candidati che hanno avuto accesso al secondo turno sono stati Bronis?aw Komorowski, sostenuto da Piattaforma Civica, e Jaroslaw Kaczynski (fratello di Lech Kaczynski), appoggiato da Diritto e Giustizia.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Polish_presidential_election,_2010', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:26:18', '2013-05-02 13:26:18', '12159', '1170', '12160', 'NULL', '1', 'NULL', '293');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('310', 'Elezioni legislative francesi del 1997', 'Le elezioni legislative francesi del 1997 si sono tenute il 25 maggio (primo turno) e il 1 giugno (secondo turno). Esse hanno visto la vittoria del Partito Socialista, nell\'ambito della coalizione di centro-sinistra (Sinistra plurale). Per tutta la legislatura, si è assistito alla coabitazione con il Presidente della Repubblica, Jacques Chirac.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/French_legislative_election,_1997', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:26:55', '2013-05-02 13:26:55', '12161', 'NULL', 'NULL', 'NULL', '1', 'NULL', '294');
