INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('312', 'Elezioni europee del 1999', 'Le elezioni europee del 1999 si sono tenute per eleggere tutti e 626 i membri della V legislatura del Parlamento europeo, rappresentanti dei cittadini dei 15 stati dell\'Unione europea; si sono svolte tra il 10 e il 13 giugno 1999. L\'affluenza alle urne è stata generalmente bassa, eccetto che nel Belgio e nel Lussemburgo, dove il voto è obbligatorio e dove le elezioni nazionali si tenevano negli stessi giorni. Quelle del 1999 sono state le prime elezioni in cui Austria, Finlandia e Svezia hanno partecipato insieme agli altri stati membri, avendo acceduto all\'UE nel 1995 ed avendo quindi votato separatamente. Le elezioni successive si sono tenute nel 2004.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/European_Parliament_election,_1999', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:26:43', '2013-05-02 13:26:43', '12163', 'NULL', 'NULL', 'NULL', '1', 'NULL', '296');
