INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('314', 'Elezioni presidenziali afghane del 2009', 'Le elezioni presidenziali afghane del 2009 sono le seconde elezioni sotto la Costituzione dell\'Afghanistan e si sono svolte il 20 agosto 2009.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Afghan_presidential_election,_2009', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:25:43', '2013-05-02 13:25:43', '12165', '1171', '12166', 'NULL', '1', 'NULL', '298');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('315', 'Elezioni politiche italiane del 1958', 'Le elezioni politiche del 1958 si tennero il 25 maggio. Il Senato, che ancora aveva una legislatura della durata di sei anni, fu sciolto anticipatamente. In queste elezioni si applicò per l\'ultima volta quanto stabilito nella prima stesura della Costituzione italiana, che prevedeva un numero di seggi da assegnare in maniera variabile nel seguente modo: per la Camera dei deputati, in ragione di un deputato per ottantamila abitanti o per frazione superiore a quarantamila; per il Senato attribuito su base regionale un senatore ogni duecentomila abitanti o per frazione superiore a centomila, nessuna Regione può avere un numero di senatori inferiore a sei, la Valle d\'Aosta ne ha uno solo. Le successive elezioni si tennero invece con un numero di deputati e senatori fisso, secondo quanto previsto dalla legge costituzionale 9 febbraio 1963, n. 2. All\'incirca come già nel 1953, si confermò la supremazia democristiana e grosso modo inalterate rappresentanze dei partiti laici di centro. Il PCI si confermò principale partito di opposizione.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Italian_general_election,_1958', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:30:22', '2013-05-02 13:30:22', '12167', 'NULL', 'NULL', 'NULL', '1', 'NULL', '299');
