INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('334', 'Elezioni presidenziali statunitensi del 1940', 'Le elezioni presidenziali statunitensi del 1940 si svolsero il 5 novembre 1940. La sfida oppose il candidato repubblicano Wendell Lewis Willkie e il presidente democratico uscente Franklin Delano Roosevelt. Entrambi i candidati dei partiti principali provenivano dallo Stato di New York. Ciò era già accaduto alle elezioni del 1904, disputate dai nuovaiorchesi Parker (democratico) e Theodore Roosevelt (repubblicano). Anche nel 1920 i principali candidati provenivano dal medesimo Stato, ma si trattava dell\'Ohio.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/United_States_presidential_election,_1940', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:30:10', '2013-05-02 13:30:10', '12192', 'NULL', 'NULL', 'NULL', '1', 'NULL', '318');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('335', 'Elezioni parlamentari russe del 2007', 'Le elezioni parlamentari si sono tenute nella Federazione Russa il 2 dicembre 2007. Si è votato per l\'elezione dei 450 deputati alla Duma di Stato (Gosudarstvennaja Duma), la camera bassa dell\'Assemblea Federale della Federazione Russa. L\'elezione del 2007 si è svolta con un il sistema proporzionale adottato con una legge del 2005 su iniziativa del Presidente Vladimir Putin, che mira al rafforzamento del sistema politico russo ed alla riduzione dei partiti rappresentati. Nelle precedenti elezioni, metà dei seggi furono assegnati con il sistema proporzionale, la metà con il sistema maggioritario uninominale. Nel 2007, i 225 distretti a singolo membro sono stati aboliti. Nelle elezioni del 2003, 100 di questi seggi furono vinti da indipendenti o candidati di partiti minori. Tutti i seggi saranno assegnati con rappresentanza proporzionale. La soglia per l\'accesso al Parlamento è stata innalzata dal 5% al 7%; nel 2003, quattro partiti andarono oltre il 7% dei voti e conquistarono il 70,7% della Duma. Solo i partiti registrati ufficialmente, per legge, possono competere alle elezioni, e i partiti registrati non possono formare una coalizione per sommare i propri voti (e così aggirare la soglia del 7%); i partiti nella Duma devono rappresentare almeno il 60% dei cittadini partecipanti al voto.. I seggi alla Duma sono assegnati alle persone facenti parte delle liste a seconda della posizione nella lista stessa. Ogni membro che si dimette dal partito, rinuncia automaticamente al seggio. In Cecenia, nello stesso giorno, si è tenuto un referendum costituzionale.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Russian_legislative_election,_2007', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:30:07', '2013-05-02 13:30:07', '12193', '1178', '12194', 'NULL', '1', 'NULL', '319');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('336', 'Elezioni federali tedesche del 2005', 'Il 18 settembre 2005 si sono svolte in Germania le elezioni federali per eleggere i membri del 16° Bundestag tedesco, ossia il parlamento federale della Germania. La consultazione elettorale si è resa necessaria dopo una mozione di sfiducia contro il cancelliere Gerhard Schröder verificatasi il 1 luglio dello stesso anno. A seguito della sconfitta del Partito Social Democratico (SPD) in un\'elezione di uno stato, Schröder chiese ai suoi sostenitori di astenersi dal voto al Bundestag, in modo da far fallire la fiducia e rendere necessaria l\'elezione anticipata. L\'Unione Cristiano Democratica (CDU), insieme al suo partito gemello della Baviera, l\'Unione Cristiano Sociale (CSU), iniziarono la campagna elettorale con un vantaggio del 21% rispetto al SPD, secondo i sondaggi. Molti commentatori si aspettavano la chiara vittoria elettorale dei cristiano-democratici, e la nomina a cancelliere del leader della CDU, Angela Merkel, per formare un governo di coalizione con il Partito Liberale Democratico (FDP) e battere quindi la coalizione al governo formata da SPD e Verdi. La CDU, tuttavia, perse durante la campagna elettorale tutto il vantaggio, e si ridusse alla vittoria per l\'1%, con 4 seggi in più dei socialdemocratici. Gli exit poll mostrarono chiaramente che nessun gruppo aveva ottenuto la maggioranza dei seggi al Bundestag. Tutti i partiti persero seggi rispetto al 2002, mentre solo il Partito della Sinistra (parziale successore del Partito del Socialismo Democratico diretto da Gregor Gysi e dall\'ex presidente del SPD Oskar Lafontaine) ottenne un significativo incremento. Sia Schröder che la Merkel dichiararono vittoria, ma la formazione di un nuovo governo richiese molti negoziati. Il 10 ottobre 2005 le alte cariche del SPD e della CDU/CSU annunciarono la conclusione delle trattative, che avevano portato alla formazione di una grande coalizione con Angela Merkel come Cancelliere. 397 deputati della CDU/CSU e del SPD votarono per la Merkel alla riunione del 22 novembre 2005, che portò alla formazione del Governo Merkel.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/German_federal_election,_2005', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:28:51', '2013-05-02 13:28:51', '12195', 'NULL', 'NULL', 'NULL', '1', 'NULL', '320');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('337', 'Elezioni legislative portoghesi del 1991', 'Le elezioni legislative portoghesi del 1991 si sono tenute il 6 ottobre. Esse hanno visto la vittoria del Partito Social Democratico di Aníbal Cavaco Silva, che è stato confermato Primo Ministro.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Portuguese_legislative_election,_1991', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:25:56', '2013-05-02 13:25:56', '12196', 'NULL', 'NULL', 'NULL', '1', 'NULL', '321');
