INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('339', 'Elezioni presidenziali statunitensi del 1948', 'Le elezioni presidenziali statunitensi del 1948 si svolsero il 2 novembre 1948. La sfida oppose il candidato repubblicano Thomas Edmund Dewey e il presidente democratico uscente Harry S. Truman. Queste elezioni sono tuttora ricordate per uno dei più clamorosi errore di previsione dei sondaggisti, che, sopravvalutando due candidati democratici dissidenti, avevano attribuito un larghissimo vantaggio a Dewey, mentre risultò eletto Truman. Clamoroso fu il titolo dello Chicago Tribune che, il giorno seguente, annunciò la vittoria di Dewey, andando in stampa prim\'ancora che lo spoglio giungesse a una ragionevole soglia d\'attendibilità, tanto pareva certa la vittoria dei repubblicani. L\'inatteso fallimento sottrasse denaro e clienti alle agenzie sondaggistiche.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/United_States_presidential_election,_1948', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:25:15', '2013-05-02 13:25:15', '12198', 'NULL', 'NULL', 'NULL', '1', 'NULL', '323');
