INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('345', 'Elezioni regionali in Sicilia del 2006', '| partito1 = Unione dei Democratici Cristiani e di Centro | coalizione1 = con FI, MPA, AN,DCA, FT | voti1 = 1.374.706 | %1 = 53,09 | seggi1 = 53 | image2 = | color2 = FF0000 | colour2 = | leader2 = Rita Borsellino | partito2 = Indipendente | coalizione2 = con DS, DL, PRC, PdCI, IdV, FdV | voti2 = 1.078.179 | %2 = 41,64 | seggi2 = 27 | title = Salvatore Cuffaro }} Le elezioni regionali in Sicilia del 2006 si sono tenute il 28 maggio. Esse hanno visto la vittoria del presidente uscente Salvatore Cuffaro, sostenuto dal centro-destra, che ha sconfitto Rita Borsellino, sostenuta dal centro-sinistra. La coalizione di centro-sinistra scelse il proprio candidato tramite le elezioni primarie, tenutesi il 4 dicembre 2005. La consutlazione vide prevalere con il 66,9% delle preferenze l\'indipendente Rita Borsellino, che sconfisse il candidato presentato da La Margherita, Ferdinando Latteri. Rispetto alle precedenti consultazioni, la legge elettorale vide l\'innalzamento della soglia di sbarramento per accedere alle ripartizione dei seggi. Tale sbarramento fu portato dal 4% al 5% e tale modifica fu surrogata da un successivo referendum consultivo, tenutosi il 15 e 16 maggio 2005.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Sicilian_regional_election,_2006', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:41', '2013-05-02 13:31:41', '12205', '1180', '12206', 'NULL', '1', 'NULL', '329');
