INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('369', 'Elezioni presidenziali statunitensi del 2008', 'Le elezioni presidenziali statunitensi del 2008 si sono svolte il 4 novembre 2008 e, come di consueto, sono state anticipate da quasi due anni di campagna elettorale e dalle primarie per la scelta dei candidati. La sfida ha contrapposto il candidato repubblicano John McCain e quello democratico Barack Obama. Si è trattato della cinquantaseiesima elezione e Obama ha prevalso nella competizione. Il 20 gennaio 2009 Obama, primo afro-americano ad essere eletto alla guida del paese, ha giurato come quarantaquattresimo Presidente degli Stati Uniti e assunto l\'incarico. Le elezioni sono state a lungo considerate di esito incerto poiché entrambi i maggiori partiti avevano dovuto scegliere i loro candidati ex novo, non essendoci né un Presidente che si ripresentava per il secondo mandato né un Vice Presidente uscente in competizione per la nomination. Infatti il Presidente George W. Bush, dopo otto anni alla Casa Bianca, non era rieleggibile e il Vice Presidente Dick Cheney aveva comunicato di non volersi candidare sin dall\'inizio del suo mandato. Era dal 1928 che non si assisteva ad una elezione in cui nessun candidato godesse del vantaggio dell\'incumbency, cioè del fatto di essere Presidente o Vice Presidente uscente. Si è trattato di un fatto raro ed eccezionale che ha reso la corsa per la Casa Bianca molto aperta sin dalla fase delle primarie perché entrambi i partiti hanno dovuto scegliere il loro candidato in un broad field, cioè a campo aperto, senza che nessuno partisse da una posizione di vantaggio data dalla carica ricoperta al vertice del Paese. Le primarie dei due maggiori partiti si sono concluse con la vittoria di due outsider, John McCain e Barack Obama, che hanno battuto a sorpresa i due grandi favoriti della vigilia, rispettivamente Rudy Giuliani e Hillary Clinton. McCain e Obama si sono contesi la guida del Paese in una gara decisamente aperta, dato che molti erano gli swing states, Stati in bilico, rispetto al 2004. In particolare Obama è risultato molto competitivo in alcuni Stati con un\'alta percentuale di neri e ispanici, nonché nel Mid West. Il 4 novembre Obama ha vinto l\'elezione generale, ricevendo anche le congratulazioni del suo avversario John McCain, grazie alla conquista di diversi Stati che nel 2004 si erano schierati con Bush: Florida, Carolina del Nord, Virginia, Ohio, Indiana, Iowa, Colorado, Nuovo Messico e Nevada.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/United_States_presidential_election,_2008', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:29:50', '2013-05-02 13:29:50', '12237', '1188', '12238', 'NULL', '1', 'NULL', '353');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('370', 'Elezioni legislative francesi del 1988', 'Le elezioni legislative francesi del 1988 si sono tenute il 5 giugno (primo turno) e il 12 giugno (secondo turno). Esse hanno visto la vittoria del Partito Socialista, nell\'ambito della coalizione di centro-sinistra Maggioranza Presidenziale.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/French_legislative_election,_1988', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:28:08', '2013-05-02 13:28:08', '12239', 'NULL', 'NULL', 'NULL', '1', 'NULL', '354');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('371', 'Elezioni politiche italiane del 1983', 'Le elezioni politiche del 1983 si tennero il 26 giugno. Registrarono un incremento di voti del Partito Repubblicano dovuto al suo segretario Giovanni Spadolini che era stato il primo Presidente del Consiglio non democristiano della storia della Repubblica Italiana, ed una marcata flessione della Democrazia Cristiana che scese per la prima volta al di sotto del 35%: la differenza tra DC e PCI fu di solo un milione di voti alla Camera e mezzo milione al Senato, mai così bassa nella storia. Successivamente Bettino Craxi divenne capo del governo, il primo nella storia sotto la guida di un partito di sinistra.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Italian_general_election,_1983', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:30:10', '2013-05-02 13:30:10', '12240', 'NULL', 'NULL', 'NULL', '1', 'NULL', '355');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('372', 'Elezioni presidenziali francesi del 1958', 'Le elezioni presidenziali francesi del 1958 furono le prime elezioni presidenziali della Quinta Repubblica anche se non furono a suffragio universale diretto. Si tennero il 21 dicembre 1958. Secondo la nuova costituzione il Presidente veniva eletto da un collegio elettorale di circa ottantamila persone composto da parlamentari, da consiglieri generali e da rappresentanti dei consigli comunali; solamente dopo il referendum del 1962 le modalità di elezione del Presidente della Repubblica furono modificate. Verrà eletto a larga maggioranza Charles de Gaulle.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/French_presidential_election,_1958', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:22', '2013-05-02 13:32:22', '12241', 'NULL', 'NULL', 'NULL', '1', 'NULL', '356');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('373', 'Elezioni politiche italiane del 1963', 'Le elezioni politiche del 1963 si tennero il 28 aprile. In questa elezione entrò in vigore la legge di revisione costituzionale n°2 del 9 febbraio 1963 con cui si modificò il numero di seggi da assegnare alle Camere, eliminando peraltro il rapporto con il numero di abitanti previsto nel 1948. Si registrarono una crescita del PCI ed una stasi del PSI, accompagnate da una lieve crescita del PSDI ed un insuccesso del PRI, insieme ad un\'avanzata del PLI dovuta all\'afflusso di voti dai monarchici, lacerati da un tribolato periodo di scissioni e ricomposizioni, senza dimenticare alcuni suffragi che giunsero dai contrari alla formula del centrosinistra.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Italian_general_election,_1963', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:26:39', '2013-05-02 13:26:39', '12242', 'NULL', 'NULL', 'NULL', '1', 'NULL', '357');
