INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('379', 'Elezioni parlamentari sudafricane del 2009', 'Le elezioni parlamentari sudafricane del 2009 si sono tenute il 22 aprile. Esse hanno visto la vittoria del Congresso Nazionale Africano di Jacob Zuma, che è divenuto Presidente della Repubblica.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/South_African_general_election,_2009', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:49', '2013-05-02 13:31:49', '12250', '1191', '12251', 'NULL', '1', 'NULL', '363');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('380', 'Elezioni politiche italiane del 1968', 'Le elezioni politiche del 1968 si tennero il 19 maggio, nel pieno della contestazione politica. L\'appuntamento cadde in un periodo di scomposizioni nello scenario dell\'area socialista. A queste elezioni debuttò il Partito Socialista Unificato, denominazione ufficiosa del partito \"PSI-PSDI Unificati\", nato dall\'unificazione tra i socialisti e i socialdemocratici. Il PSI/PSDI, comunque, riprese la denominazione storica di PSI subito dopo le elezioni. Si presentò alle elezioni anche il Partito Socialista Italiano di Unità Proletaria, nato da una scissione interna al PSI e comprendente quei militanti più vicini all\'area di sinistra che non accettavano l\'alleanza con la DC e che invece vedevano di buon occhio un\'eventuale più profonda collaborazione con il PCI. Le elezioni videro l\'avanzata di DC, PCI e PRI, perdettero voti PLI, MSI, monarchici e complessivamente i gruppi socialisti che complessivamente perdettero 29 seggi alla camera . Le convulsioni del PSI condizionarono in maniera decisiva la legislatura. Le elezioni dimostrarono che la secessione del PSIUP non era stata un\'operazione di palazzo bensì un\'esigenza politica condivisa dalla sua base, tanto che i parlamentari massimalisti eletti furono in numero praticamente uguale alla consistenza dei gruppi parlamentari uscenti. La dirigenza del PSI iniziò dunque ad implementare una strategia volta a riassorbire i consensi dei massimalisti, strategia che fu individuata in un progressivo ritorno a sinistra, che passò prima dal divorzio col PSDI, poi dalla costituzione di giunte socialcomuniste in Emilia, Toscana ed Umbria dopo le elezioni regionali del 1970, ed infine dall\'uscita dall\'esperienza del centrosinistra nel 1972. Il tentativo di Giulio Andreotti di far risorgere a quel punto la politica del centrismo non trovò i numeri in parlamento, aprendo così la via per le prime elezioni anticipate nella storia repubblicana.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Italian_general_election,_1968', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:26:32', '2013-05-02 13:26:32', '12252', 'NULL', 'NULL', 'NULL', '1', 'NULL', '364');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('381', 'Elezioni parlamentari maltesi del 1981', 'Le elezioni parlamentari maltesi del 1981 si sono tenute il 12 dicembre. Esse hanno visto la vittoria del Partito Laburista. Queste elezioni furono oggetto di controversie poiché nonostante il Partito Nazionalista avesse ottenuto la maggioranza dei voti, il sistema elettorale vigente allora assegnò la maggioranza dei seggi al Partito Laburista che governo l\'isola fino alle elezioni dell\'1987. Il fatto causò una crisi costituzionale che sfociò nel boicottaggio del parlamento da parte del Partito Nazionalista. Per risolvere la questione venne trovato un compromesso tra le parti varando un muovo sistema elettorale in cui, se dovesse ripetersi uno scenario come quello dell\'1981, il partito che ha ottenuto il più alto numero di voti si vedrà assegnato un numero supplementare di seggi in parlamento, in modo da assicurare una maggioranza parlamentare.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Maltese_general_election,_1981', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:28:53', '2013-05-02 13:28:53', '12253', 'NULL', 'NULL', 'NULL', '1', 'NULL', '365');
