INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('395', 'Elezioni federali tedesche del 1933', 'Le elezioni federali tedesche del 1933 furono le none e ultime consultazioni politiche nazionali della repubblica di Weimar e si tennero il 5 marzo. Quando si conclusero, partirono i preparativi per l\'inizio dell\'ottava legislatura del Reichstag. Queste furono le ultime consultazioni multipartitiche che si svolsero in Germania fino alla conclusione del secondo conflitto mondiale. Il successo arrise nettamente al Partito Nazista e ai suoi alleati: il primo ministro uscente Adolf Hitler non ebbe difficoltà a far approvare le sue leggi speciali (tra cui il \"Decreto dei pieni poteri\") che gli consentirono di diventare non più cancelliere della Germania ma Fuhrer del Terzo Reich.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/German_federal_election,_March_1933', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:01', '2013-05-02 13:32:01', '12270', 'NULL', 'NULL', 'NULL', '1', 'NULL', '379');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('396', 'Elezioni europee del 2004 (Portogallo)', 'Le elezioni europee del 2009 in Portogallo si sono svolte il 13 giugno.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/European_Parliament_election,_2004_(Portugal)', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:27:46', '2013-05-02 13:27:46', '12271', 'NULL', 'NULL', 'NULL', '1', 'NULL', '380');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('397', 'Elezioni parlamentari ucraine del 2006', 'Le elezioni parlamentari in Ucraina si svolsero il 26 marzo 2006; la campagna elettorale ufficiale iniziò il 7 luglio 2005, e tra il 26 novembre e il 31 dicembre 2005 furono costituite le liste dei candidati. Queste elezioni per il parlamento ucraino, la Verchovna Rada, si tennero con il sistema proporzionale in cui i voti, in ogni circoscrizione, venivano assegnati ai partiti politici o ai blocchi elettorali, anziché ai candidati individuali. Alle precedenti elezioni, metà dei rappresentanti parlamentari (deputati) erano stati eletti su base proporzionale, mentre l\'altra metà fu eletta in circoscrizioni con mandato al singolo. La costituzione fu modificata nel 2005 a seguito di negoziati e accordi per le elezioni presidenziali del 2004, abolendo le circoscrizioni a singolo membro e sostituendole con una accresciuta rappresentanza proporzionale a molti membri. La costituzione modificata, in vigore dal 1º gennaio 2006, trasferì anche alcuni poteri dal Presidente al Parlamento, rendendo l\'Ucraina una democrazia parlamentare-presidenziale. Secondo la legge elettorale ed il sistema adottato, i partiti politici o i blocchi elettorali dovevano raggiungere almeno il 3% del voto popolare per poter ottenere seggi in Parlamento.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Ukrainian_parliamentary_election,_2006', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:26:57', '2013-05-02 13:26:57', '12272', '1195', '12273', 'NULL', '1', 'NULL', '381');
