INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('413', 'Elezioni presidenziali cilene del 2005', 'Le elezioni presidenziali del Cile 2005 per il periodo 2006-2010 si sono svolte domenica 11 dicembre 2005 assieme alle elezioni parlamentari per il rinnovamento della Camera dei deputati e di metà dei seggi del Senato. Nessuno dei quattro candidati che parteciparono a queste elezioni ottenne la maggioranza assoluta. Michelle Bachelet Jeria (45,95% dei voti) e Sebastián Piñera Echenique (25,41% dei voti) furono i candidati che parteciparono al ballottaggio del 15 gennaio del 2006. Con il 53,5% dei voti Michelle Bachelet è stata eletta Presidente della Repubblica. Secondo la Costituzione cilena possono esercitare il diritto di voto i cittadini che hanno compiuto i 18 anni di età e quelli che non hanno ricevuto una condanna superiore ai 3 anni. Per votare occorre l\'iscrizione nei registri elettorali e l\'esibizione della Carta d\'identità. Possono votare i cittadini stranieri che risiedono in Cile da almeno 5 anni. Il diritto di voto è sospeso per interdizione, per chi è accusato di omicidio o per chi è stato condannato per terrorismo oppure per sanzione del Tribunale Superiore Elettorale. Il voto è volontario ma qualora un elettore si iscrivesse nei registri elettorali e non si recasse alle urne può essere condannato a pagare una multa salvo se la residenza dell\'elettore è distante 300 km dal seggio elettorale o per motivi di salute, come previsto dalla Costituzione nazionale cilena, lasciando una dichiarazione presso la stazione di carabinieri vicina. Gli elettori chiamati in questa tornata elettorale furono 8.220.897.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Chilean_presidential_election,_2005%E2%80%932006', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:25:56', '2013-05-02 13:25:56', '12292', 'NULL', 'NULL', 'NULL', '1', 'NULL', '397');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('414', 'Elezioni presidenziali statunitensi del 1936', 'Le elezioni presidenziali statunitensi del 1936 si svolsero il 3 novembre 1936. La sfida oppose il candidato repubblicano Alfred Mossman Landon e il presidente democratico uscente Franklin Delano Roosevelt. Le elezioni del 1936 furono caratterizzate da un evento centrale nella storia della statistica e dei sondaggi. La rivista Literary Digest, che aveva puntualmente previsto i risultati delle quattro elezioni presidenziali precedenti, condusse un sondaggio elettorale reclutando un campione di dieci milioni di cittadini dalle liste del registro automobilistico e dell\'elenco telefonico. Solo 2,3 milioni di persone parteciparono all\'indagine. Secondo il Digest, le elezioni sarebbero state certamente vinte da Landon. Contemporaneamente, lo statistico George Gallup predisse invece la vittoria di Roosevelt utilizzando un campione molto più ristretto (50.000 persone). Non solo, ma con un esiguo sottoinsieme delle persone incluse nella lista del \'Digest\' (3.000) Gallup replicò i risultati ottenuti dalla rivista. Le elezioni furono vinte da Roosevelt. Literary Digest chiuse i battenti dopo due anni. La lezione di Gallup fu fondamentale negli anni a venire, dimostrando la scarsa importanza della dimensione del campione statistico rispetto alla sua composizione, che dev\'essere necessariamente casuale e probabilistica. Servendosi degli elenchi del telefono, il Digest aveva finito per intervistare troppi repubblicani (mediamente più ricchi e più facilmente in possesso di un\'utenza telefonica) e di conseguenza aveva sottostimato l\'elettorato democratico. Dalle elezioni successive, la tecnica di campionamento utilizzata dai sondaggisti fu quella per quote.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/United_States_presidential_election,_1936', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:27:36', '2013-05-02 13:27:36', '12293', 'NULL', 'NULL', 'NULL', '1', 'NULL', '398');
