INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('417', 'Elezioni europee del 2009 (Italia)', 'Le elezioni per la VII legislatura del Parlamento europeo si sono tenute in Italia il 6 e il 7 giugno 2009, un sabato e una domenica, come già avvenne nel giugno 2004. Nei consolati italiani dell\'Unione europea, le elezioni si sono tenute, invece, il 5 e il 6 giugno. In contemporanea ad esse si è svolta anche la tornata ordinaria delle elezioni amministrative provinciali e comunali. Il 20 febbraio, il Parlamento italiano ha modificato la vigente legge elettorale nel senso dell\'introduzione di una soglia di sbarramento al sistema proporzionale. Parteciperanno alla ripartizione dei seggi solo le liste che abbiano conseguito sul piano nazionale almeno il 4 per cento dei voti validi espressi; inoltre, per tutte le Circoscrizioni, ogni elettore può esprimere non più di tre preferenze. In base al dettame del trattato di Nizza, la delegazione italiana al Parlamento europeo è diminuita da 78 a 72 deputati, onde far spazio ai rappresentanti dei nuovi membri e non superare il tetto di 736 deputati complessivi. Il numero dei deputati spettanti all\'Italia secondo il trattato di Lisbona avrebbe dovuto invece essere di 73 e sarà in vigore dal 1º dicembre 2009.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/European_Parliament_election,_2009_(Italy)', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:17', '2013-05-02 13:32:17', '12298', '1201', '12299', 'NULL', '1', 'NULL', '401');
