INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('432', 'Elezioni presidenziali statunitensi del 1944', 'Le elezioni presidenziali statunitensi del 1944 si svolsero il 7 novembre 1944. La sfida oppose il candidato repubblicano Thomas Edmund Dewey e il presidente democratico uscente Franklin Delano Roosevelt. Per la terza volta nella storia degli Stati Uniti, e per la seconda consecutiva, entrambi i candidati dei partiti principali provenivano dallo Stato di New York: era già accaduto, oltre che quattro anni prima, anche nel 1904. Anche nel 1920 i principali candidati provenivano dal medesimo Stato, ma si trattava dell\'Ohio.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/United_States_presidential_election,_1944', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:51', '2013-05-02 13:31:51', '12316', 'NULL', 'NULL', 'NULL', '1', 'NULL', '416');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('433', 'Elezioni presidenziali statunitensi del 1968', 'Le elezioni presidenziali statunitensi del 1968 si svolsero il 5 novembre 1968. La sfida oppose l\'ex vicepresidente repubblicano Richard Milhous Nixon, già in corsa alle presidenziali del 1960, e il candidato democratico Hubert Horatio Humphrey. In campagna elettorale, il senatore Robert F. Kennedy (probabile candidato alla presidenza per i democratici) era stato assassinato a Los Angeles. Ciò privò Nixon d\'un avversario temibile. Il presidente uscente Lyndon Johnson rifiutò di proporsi per un secondo mandato a causa della situazione disastrosa della guerra del Vietnam. La vittoria di Nixon, in termini di voto popolare, risultò una delle più strette di sempre.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/United_States_presidential_election,_1968', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:27:47', '2013-05-02 13:27:47', '12317', 'NULL', 'NULL', 'NULL', '1', 'NULL', '417');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('434', 'Elezioni europee del 1984', 'Le elezioni europee del 1984 si svolsero tra il 14 e il 17 giugno per eleggere il 2° Parlamento europeo. Furono le seconde elezioni europee della storia. Rispetto alle precedenti consultazioni, in questa tornata erano chiamati alle urne anche i greci, dopo l\'ingresso del paese nell\'Unione Europea. Alla Grecia vennero assegnati 24 seggi, portando così il numero degli europarlamentari da 410 a 434.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/European_Parliament_election,_1984', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:29:39', '2013-05-02 13:29:39', '12318', 'NULL', 'NULL', 'NULL', '1', 'NULL', '418');
