INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('437', 'Elezioni parlamentari russe del 2003', 'Il 7 dicembre 2003 si sono tenute nella Federazione Russa le elezioni parlamentari, per l\'assegnazione dei 450 seggi alla Duma di Stato (Gosudarstvennaya Duma), la camera bassa dell\'Assemblea Federale, il Parlamento russo. Come secondo le aspettative, il partito Russia Unita, a favore di Vladimir Putin, ha conquistato il più alto numero di voti e seggi, riducendo gli altri partiti a una piccola porzione del Parlamento. Anche il calcolo formale di 223 seggi per Russia Unita è in realtà una stima per difetto, in quanto molti dei partiti minori e dei membri \"indipendenti\" sono sostenitori del Presidente Putin. Le elezioni hanno formito quindi a Putin il completo controllo del Parlamento. Tra gli altri partiti, il Partito Comunista è ancora il maggiore, anche se è stato molto ridimensionato. Il Partito Liberal Democrativo ha migliorato la propria posizione di qualche deputato. Il partito liberale Jabloko e i conservatori-liberali del SPS hanno perso molti dei seggi. L\'unico altro partito socialista di rilievo è Rodina.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Russian_legislative_election,_2003', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:31', '2013-05-02 13:32:31', '12321', 'NULL', 'NULL', 'NULL', '1', 'NULL', '421');
