INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('446', 'Elezioni parlamentari montenegrine del 2006', 'Le prime elezioni legislative del nuovo Montenegro indipendente hanno avuto luogo il 10 settembre 2006 ed hanno visto il primo ministro Milo Djukanovi? conquistare la maggioranza assoluta per la sua coalizione di centro-sinistra e filo-europea, Coalizione per un Montenegro Europeo, comprendente il Partito Democratico dei Socialisti del Montenegro (DPS) e il Partito Socialdemocratico del Montenegro (SDP). Lo schieramento governativo ha ottenuto infatti 39 seggi sugli 76 del Parlamento del Montenegro. Sono stati smentiti, quindi, alcuni sondaggi che prevedevano per lo schieramento di governo solo una maggioranza relativa. I temi delle elezioni messi in luce dai principali schieramenti sono stati l’integrazione del paese, da poco indipendente, con l’Europa e i rapporti con l’ex paese dominante, la Serbia. Il blocco dell’opposizione filo-serba, presentatosi diviso in due schieramenti, uno di tendenze nazionaliste più radicali e uno moderato dominato dal Partito Popolare Socialista del Montenegro è complessivamente arretrato, ottenendo in tutto 23 seggi (12 per i nazionalisti radicali e 11 per gli anti-indipendentisti moderati). Da parte dello schieramento emergente dell’opposizione Movimento per i Cambiamenti, anch’esso a favore dell\'Unione Europea, sono stati invece messi in luce i problemi della corruzione, della crescita dell’economia e dell’influenza dei gruppi d\'interesse, che fino ad ora erano stati messi in secondo piano dal tema dell’indipendenza. Questo nuovo movimento ha ottenuto 11 seggi. Accertata la vittoria, il primo ministro ha dichiarato che: « Queste elezioni mostrano che il Montenegro è stabile e fermo nella sua strada verso l’Europa »</div> Le elezioni parlamentari in Montenegro si sono tenute in linea con le raccomandazioni dell’OSCE e con gli standard democratici del Consiglio d\'Europa. Comunque sono rimaste alcune questioni da sistemare secondo le conclusioni della Missione degli Osservatori Elettorali Internazionale, composta da 200 osservatori provenienti da 41 paesi.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Montenegrin_parliamentary_election,_2006', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:10', '2013-05-02 13:32:10', '12332', '1206', '12333', 'NULL', '1', 'NULL', '430');
