INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('453', 'Elezioni parlamentari polacche del 1989', 'Le elezioni parlamentari in Polonia del 1989 sono state il risultato di un accordo tra il Partito Comunista e Solidarno??; l\'accordo finale è stato firmato il 5 aprile 1989, e di conseguenza il reale potere politico fu assegnato al nuovo Parlamento bicamerale ed al Presidente della Polonia, che sarebbe stato il capo esecutivo. Solidarno?? divenne un partito legittimo e legalmente riconosciuto. Queste elezioni sono anche state definite Sejm del Contratto, per sottolineare appunto l\'accordo tra i due partiti a formare una nuova legislatura. Forse la più importante decisione raggiunta durante le trattative fu quella di permettere elezioni parzialmente libere in Polonia. Tutti i seggi del ricreato Senato della Polonia furono assegnati democraticamente, come anche fu assegnato democraticamente il 35% dei seggi del Sejm. Il restante 65% dei seggi fu riservato al Partito Comunista e ai suoi satelliti; inoltre, tutti i 35 seggi delle liste nazionali furono riservati a candidati che avevano raggiunto una certa quota di sostegno. Fu deciso questo per assicurare che fossero eletti i più importanti leader di partito. L\'esito delle elezioni era imprevedibile. Dopo tutto, la Polonia non aveva avuto una vera e propria elezione libera dagli anni venti, pertanto non vi erano precedenti da tenere in considerazione. Era chiaro che i comunisti non erano popolari, ma non vi erano numeri che potessero prevedere di quanto il loro consenso fosse crollato. Il governo comunista deteneva ancora il controllo sulla maggior parte dei media e sulle personalità più influenti. Alcuni membri dell\'opposizione erano preoccupati che queste tattiche avrebbero apportato voti ai comunisti dalle classi meno istruite, per dare ai comunisti la legittimità che si erano costruiti da soli. Le elezioni del 4 giugno 1989 (e il secondo turno del 18 giugno) segnarono la vittoria schiacciante di Solidarno??: il 99% dei seggi del Senato e il 35% dei seggi possibili al Sejm. Sui possibili 100 seggi al Senato, 99 furono ottenuti da Solidarno?? e 1 da un senatore non di parte. Sui 35 seggi al Sejm attribuiti alle liste nazionali, solo uno fu conquistato dal candidato del Partito, e uno da un partito satellite, mentre i rimanenti furono assegnati a Solidarno?? al secondo turno. Sui 161 senatori eleggibili, Solidarno?? ne ottenne in complesso 160. La partecipazione al voto fu sorprendentemente bassa: solo il 62,7% degli aventi diritto votò al primo turno e il 25% al secondo. Bisogna notare che il risultato fu una grande sorpresa sia per il Partito che per Solidarno??. Solo pochi giorni prima del 4 giugno il Comitato Centrale del Partito stava discutendo di una possibile reazione del mondo occidentale se Solidarno?? non avesse ottenuto nemmeno un voto. Nello stesso tempo, i leader di Solidarno?? cercavano di preparare una serie di regole per i membri del parlamento non comunisti nel Sejm dominato dal comunismo, dato che si aspettavano che Solidarno?? non potesse conquistare più di 20 seggi. Anche se le elezioni non furono interamente democratiche, spianarono la strada alla creazione del governo di Tadeusz Mazowiecki e alla transizione pacifica alla democrazia, che fu confermata con le elezioni del 1991.', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Polish_legislative_election,_1989', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:27:05', '2013-05-02 13:27:05', '12344', 'NULL', 'NULL', 'NULL', '1', 'NULL', '437');
