INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('460', 'Elezioni politiche italiane del 1953', 'Le elezioni politiche del 1953 si tennero il 7 giugno. Il Senato, che ancora aveva una legislatura della durata di sei anni, fu sciolto anticipatamente. Con queste elezioni entrò in vigore una nuova legge elettorale, che prevedeva un sistema proporzionale con premio di maggioranza per la coalizione di partiti che avesse ottenuto la maggioranza assoluta (50% +1) dei voti. La legge era stata varata dai partiti della precedente coalizione di governo che - infatti - si presentarono uniti, ma non riuscirono, per pochi voti, a raggiungere il quorum richiesto per il premio: a queste elezioni, infatti, aumentarono i loro voti le sinistre e le destre. Da questo momento sarà il PCI ad egemonizzare l\'area elettorale operaia a discapito del PSI che, dopo la Rivolta d\'Ungheria, inizierà la sua marcia verso il centro, pur restando per il momento legato al PCI nelle amministrazioni locali. La nuova legge viene definita dalle opposizioni come \"legge truffa\"; la DC, presentatasi alle consultazioni con Alcide De Gasperi presidente del Consiglio uscente, perde più dell\'8% dei consensi rispetto alle elezioni del \'48. \"Le elezioni politiche generali del 7 giugno 1953 si svolsero per il Senato con la legge del 6 febbraio 1948, n. 29, e per la Camera con la nuova normativa (legge 31 marzo 1953, n. 148). Le forze politiche della coalizione ottennero solamente il 49,85% non usufruendo così del premio di maggioranza ed annullando gli effetti della legge che più tardi venne abrogata con la legge 31 luglio 1954, n. 615, ripristinando in ogni sua parte le norme del testo unico del 1948.\"', 'GENERAL', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Italian_general_election,_1953', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:58', '2013-05-02 13:31:58', '12351', 'NULL', 'NULL', 'NULL', '1', 'NULL', '444');
