INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('476', 'Sojuz TMA-19', 'Sojuz TMA-19 è stata una missione del programma Sojuz diretta verso la Stazione Spaziale Internazionale. La navetta ha trasportato tre membri della Expedition 24 che abiteranno nella stazione spaziale. TMA-19 è il 106º volo con equipaggio della navetta Sojuz dal primo volo avvenuto nel 1967. L\'aggancio con la stazione spaziale è avvenuto il 17 giugno alle ore 22:25 UTC. La navetta rimarrà agganciata alla stazione per tutta la durata della Expedition 24 per essere utilizzata in caso di emergenza per abbandonare la stazione. La missione è terminata con successo il 26 novembre 2010 con il rientro e l\'atterraggio della navetta.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Soyuz_TMA-19', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 11:02:38', '2013-05-02 11:02:38', '12376', '1221', '12377', 'NULL', '1', 'NULL', '460');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('477', 'Sojuz TMA-21', 'Sojuz TMA-21 è un volo astronautico verso la Stazione Spaziale Internazionale (ISS) e parte del programma Sojuz. La sua missione è di portare in orbita un equipaggio di 3 astronauti che faranno parte dell\'Expedition 27 e 28, con una permanenza totale sulla Stazione Spaziale Internazionale di circa 6 mesi. Il lancio è avvenuto il 4 aprile 2011 dal Cosmodromo di Baikonur. L\'aggancio del Soyuz TMA-21 con la ISS avverrà dopo un paio di giorni di volo autonomo necessari a raggiungere la Stazione Spaziale. I membri dell\'equipaggio, Aleksandr Samokutyayev, Andrei Borisenko e Ronald J. Garan rappresentano le agenzie spaziali russa ed americana. La missione è stata soprannominata Gagarin in onore del cinquantesimo anniversario della prima missione umana nello spazio, che avvenne il 12 aprile 1961 quando, a bordo della Vostok 1, Jurij Gagarin divenne il primo essere umano ad esplorare lo spazio.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Soyuz_TMA-21', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 11:02:39', '2013-05-02 11:02:39', '12378', '1222', '12379', 'NULL', '1', 'NULL', '461');
