INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('481', 'Voskhod 1', 'Voskhod 1 fu una missione sovietica nello spazio composta da un equipaggio di tre cosmonauti. Per la prima volta nella storia dell’esplorazione umana dello spazio venne portata nell’orbita terrestre una navicella spaziale equipaggiata da più piloti e per la prima volta venne portato in orbita uno scienziato-cosmonauta.', 'SPACE_MISSION', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Voskhod_1', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 11:02:48', '2013-05-02 11:02:48', '12386', '1226', '12387', 'NULL', '1', 'NULL', '465');
