INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('483', 'Miracolo di Córdoba', 'Miracolo di Córdoba è il soprannome dato all\'incontro di calcio tra le Nazionali di Germania Ovest e Austria, giocato a Córdoba il 21 giugno 1978, durante il Mondiale argentino. In Austria questa partita è nota come Wunder von Córdoba (appunto, Il Miracolo di Córdoba) o solo Córdoba, ed è entrata profondamente nella cultura contemporanea, venendo rievocata fragorosamente tutte le volte che la Nazionale austriaca sfida quella tedesca. In Germania, dove al contrario la partita venne vissuta come un\'autentica beffa, essa è nota come Schmach von Córdoba (La vergogna di Cordoba).', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Miracle_of_Cordoba', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:57', '2013-05-02 13:31:57', '12390', '1228', 'NULL', 'NULL', '1', 'NULL', '467');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('484', 'Supercoppa UEFA 2006', 'La Supercoppa UEFA 2006 è stata la trentunesima edizione della Supercoppa UEFA. Si è svolta il 25 agosto 2006 allo Stadio Louis II di Monaco, dove si sono affrontate la squadra vincitrice della Champions League 2005-2006, ovvero gli spagnoli del Barcellona, e la squadra vincitrice della Coppa UEFA 2005-2006, ossia i connazionali del Siviglia. A conquistare il titolo è stato il Siviglia che ha battuto per 3-0 il Barcellona con i gol di Renato, Kanouté e Maresca.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/2006_UEFA_Super_Cup', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:28:57', '2013-05-02 13:28:57', '12391', '1229', 'NULL', 'NULL', '1', 'NULL', '468');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('485', 'FA Charity Shield 1974', 'Lo FA Charity Shield 1974, noto in italiano anche come Supercoppa d\'Inghilterra 1974, è stata la 52ª edizione della Supercoppa d\'Inghilterra. Si è svolto il 10 agosto 1974 al Wembley Stadium di Londra, scelto da quell\'anno come sede fissa della manifestazione, tra il Leeds, vincitore della First Division 1973-1974, e il Liverpool, vincitore della FA Cup 1973-1974. A conquistare il titolo è stato il Liverpool che ha vinto per 6-5 ai rigori dopo l\'1-1 dei tempi regolamentari. È stata la prima edizione decisa ai rigori: in precedenza (e anche nelle edizioni successive fino al 1993), infatti, in caso di pareggio nei tempi regolamentari, il trofeo veniva condiviso tra le due squadre.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/1974_FA_Charity_Shield', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:26:19', '2013-05-02 13:26:19', '12392', '1230', 'NULL', 'NULL', '1', 'NULL', '469');
