INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('522', 'Supercoppa italiana 1989', 'La Supercoppa italiana 1989 fu una partita giocata tra i campioni d\'Italia 1988-1989 dell\'Inter e i dententori della Coppa Italia 1988-1989 della Sampdoria. Venne giocata il 29 settembre 1989 allo Stadio Giuseppe Meazza di Milano, e fu la seconda edizione del trofeo. L\'Inter vinse la partita per 2-0.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/1989_Supercoppa_Italiana', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:29:20', '2013-05-02 13:29:20', '12429', '1267', 'NULL', 'NULL', '1', 'NULL', '506');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('523', 'Supercoppa di Francia 2010', 'La Supercoppa di Francia 2010 (ufficialmente Trophée des champions 2010) è stata la trentaquattresima edizione della Supercoppa di Francia, la quindicesima organizzata dalla Ligue de Football Professionnel. La partita è stata disputata tra i vincitori della Ligue 1 della stagione precedente, l\'Olympique de Marseille, e i vincitori della Coppa di Francia della stagione precedente, il Paris Saint-Germain. La partita è stata giocata per la seconda volta consecutiva fuori dalla Francia allo Stade 7 novembre di Tunisi. Come l\'anno precedente l\'idea era quella di promuovere il calcio francese all\'estero, specialmente in Africa e nel mondo arabo. La partita è stata trasmessa in diretta televisiva su M6. La partita è stata la settantaquattresima sfida tra l\'OM e il PSG e la seconda, dopo la finale della Coppa di Francia 2005-2006, a non svolgersi né al Vélodrome né al Parc des Princes. Il 22 luglio 2010 la Ligue de Football Professionnel e la Fédération Tunisienne de Football hanno confermato che l\'arbitro della partita sarebbe stato Aouaz Trabelsi, assistito da Béchir Hassani e Yamen Malloulchi con Herzi Riadh nel ruolo di quarto uomo. La Supercoppa è stata vinta dal Marsiglia battendo il PSG ai rigori per 5-4 dopo che i tempi regolamentari si erano conclusi sullo 0-0. Per il Marsiglia questo è il secondo trionfo nella Supercoppa di Francia.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/2010_Troph%C3%A9e_des_Champions', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:12', '2013-05-02 13:32:12', '12430', '1268', 'NULL', 'NULL', '1', 'NULL', '507');
