INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('530', 'FA Charity Shield 1990', 'Lo FA Charity Shield 1990, noto in italiano anche come Supercoppa d\'Inghilterra 1990, è stata la 68ª edizione della Supercoppa d\'Inghilterra. Si è svolto il 18 agosto 1990 al Wembley Stadium di Londra tra il Liverpool, vincitore della First Division 1989-1990, e il Manchester United, vincitore della FA Cup 1989-1990. Il titolo, per la decima volta nella sua storia, è stato condiviso tra le due squadre, che hanno pareggiato la gara per 1-1 con reti di Clayton Blackmore nel primo tempo per i Red Devils e nel secondo tempo di John Barnes su rigore per i Reds.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/1990_FA_Charity_Shield', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:32:26', '2013-05-02 13:32:26', '12437', '1275', 'NULL', 'NULL', '1', 'NULL', '514');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('531', 'Finale del campionato mondiale di calcio 2002', 'La finale del campionato mondiale di calcio 2002 si è disputata il 30 giugno 2002 al Nissan Stadium di Yokohama, che determinò il vincitore del Campionato mondiale di calcio 2002. La vittoria fu ottenuta dal Brasile, che conquistò il quinto titolo mondiale, battendo la Germania con il risultato di 2-0. La squadra tedesca, con questa sconfitta raggiunse quota 4 nella classifica delle finali mondiali perse. In questa finale, il capitano del Brasile Cafù, raggiunse il record di 3 finali mondiali disputate in carriera. In collegamento con lo stadio, per trasmettere la partita, c\'erano 200 nazioni differenti e oltre 63 milioni di telespettatori.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/2002_FIFA_World_Cup_Final', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:27', '2013-05-02 13:31:27', '12438', '1276', 'NULL', 'NULL', '1', 'NULL', '515');
