INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('538', 'Finale del campionato mondiale di calcio 2010', 'La finale del campionato mondiale di calcio 2010 è stata una partita di calcio disputata l\'11 luglio 2010 all\'FNB Stadium di Johannesburg, in Sudafrica. Essa determinò la vittoria della Spagna sull\'Olanda al Campionato mondiale di calcio 2010 con il risultato di 1-0 ottenuto ai tempi supplementari grazie ad una rete di Andrés Iniesta. Questa è stata una finale fino ad allora inedita, infatti la Spagna e l\'Olanda non si erano mai confrontate prima di allora ai mondiali di calcio, ed inoltre nessuna delle due aveva mai vinto un titolo mondiale. L\'Olanda non perdeva una partita dal settembre 2008, mentre la Spagna aveva perso per 1-0 la prima partita dei mondiali 2010 contro la Svizzera.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/2010_FIFA_World_Cup_Final', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:29:45', '2013-05-02 13:29:45', '12445', '1283', 'NULL', 'NULL', '1', 'NULL', '522');
