INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('568', 'One team in Tallinn', 'One team in Tallinn (in italiano Una squadra a Tallinn) si riferisce a una partita di calcio prevista il 9 ottobre 1996 valida per le qualificazioni di Coppa del Mondo 1998 tra le nazionali di Estonia e Scozia, che divenne nota per le insolite circostanze dato che la partita finì dopo soli 3 secondi, con la compagine estone assente al Kadrioru Stadium di Tallinn.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/One_team_in_Tallinn', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:29:22', '2013-05-02 13:29:22', '12475', '1313', 'NULL', 'NULL', '1', 'NULL', '552');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('569', 'Supercoppa UEFA 2007', 'La Supercoppa UEFA 2007 è stata la trentaduesima edizione della Supercoppa UEFA. Si è svolta il 31 agosto 2007 allo Stadio Louis II di Monaco, dove si sono affrontate la squadra vincitrice della Champions League 2006-2007, ovvero gli italiani del Milan, e la squadra vincitrice della Coppa UEFA 2006-2007, ossia gli spagnoli del Siviglia. Prima dell\'inizio della gara è stato osservato un minuto di raccoglimento in memoria di Antonio Puerta, difensore del Sivigla scomparso tragicamente nei giorni precedenti. Per ricordarlo tutti i giocatori di entrambe le squadre hanno indossato una maglia che, sotto il proprio numero, riportava il suo nome e in tribuna vi erano numerosi striscioni dedicati al difensore. Inoltre, durante l\'intervallo, due ultras del Milan hanno portato sotto la curva del Siviglia uno striscione recante la scritta \"Onore a Puerta\", con i tifosi spagnoli che hanno ringraziato quelli rossoneri con il coro \"Milan, Milan\". A conquistare il titolo è stato il Milan che ha battuto per 3-1 il Siviglia con i gol di Inzaghi, Jankulovski e Kaká dopo il gol iniziale di Renato.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/2007_UEFA_Super_Cup', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:28:11', '2013-05-02 13:28:11', '12476', '1314', 'NULL', 'NULL', '1', 'NULL', '553');
