INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('603', 'Supercoppa di Francia 2011', 'La Supercoppa di Francia 2011 (ufficialmente Trophée des champions 2011) è stata la trentacinquesima edizione della Supercoppa di Francia, la seicesima organizzata dalla Ligue de Football Professionnel. Si è svolta il 27 luglio 2011 allo Stade Ibn Batouta di Tangeri tra il Lilla, vincitore della Ligue 1 2010-2011 e della Coppa di Francia 2010-2011, e l\'Olympique Marsiglia, secondo classificato nella Ligue 1 2010-2011. A conquistare il titolo è stato l\'Olympique Marsiglia che ha vinto per 5-4 grazie a un rigore nei minuti di recupero realizzato da André Ayew, autore di una tripletta e nominato miglior giocatore della partita.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/2011_Troph%C3%A9e_des_Champions', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:29:47', '2013-05-02 13:29:47', '12510', '1348', 'NULL', 'NULL', '1', 'NULL', '587');
