INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('614', 'Finale del campionato mondiale di calcio 2006', 'La finale del campionato mondiale di calcio 2006 è stata una partita di calcio disputata il 9 luglio 2006 all\'Olympiastadion di Berlino, che determinò il vincitore del Campionato mondiale di calcio 2006. La vittoria fu ottenuta dall\'Italia, che conquistò il quarto titolo mondiale, battendo la Francia ai rigori poiché la partita era terminata 1-1. È stata quindi la quarta vittoria della nazionale italiana dopo 24 anni, e la prima ad essere decisa ai rigori; anche il Brasile, nel 1994, aveva vinto dopo 24 anni il quarto titolo e per la prima volta ai rigori.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/2006_FIFA_World_Cup_Final', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:29:14', '2013-05-02 13:29:14', '12521', '1359', 'NULL', 'NULL', '1', 'NULL', '598');
