INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('625', 'Supercoppa UEFA 1991', 'La Supercoppa UEFA 1991 è stata la sedicesima edizione della Supercoppa UEFA. Si è svolta il 19 novembre 1991 all\'Old Trafford di Manchester, dove si sono affrontate la squadra vincitrice della Coppa dei Campioni 1990-1991, ovvero gli jugoslavi della Stella Rossa, e la squadra vincitrice della Coppa delle Coppe 1990-1991, ossia gli inglesi del Manchester United. La UEFA ha deciso di far disputare una sola partita per via della situazione politica instabile di Belgrado a causa delle guerre jugoslave. A conquistare il titolo è stato il Manchester United che ha battuto la Stella Rossa per 1-0 con un gol di Brian McClair.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/1991_European_Super_Cup', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:30:35', '2013-05-02 13:30:35', '12532', '1370', 'NULL', 'NULL', '1', 'NULL', '609');
