INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('628', 'Coppa del Mondo di rugby 1995', 'La Coppa del Mondo di rugby 1995 (ingl. 1995 IRB Rugby World Cup) fu la III edizione di tale competizione, e si tenne in Sudafrica dal 25 maggio al 24 giugno 1995. Essa fu la prima competizione rugbistica ufficiale cui il Sudafrica prese parte dopo il termine del regime di apartheid lì vigente fino ai primi anni novanta. La vittoria finale arrise proprio alla Nazionale di casa, che in finale sconfisse la Nuova Zelanda; terza si classificò la Francia, che nella finale di assegnazione per il 3º posto batté l\'Inghilterra.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/1995_Rugby_World_Cup', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:29:49', '2013-05-02 13:29:49', '12535', '1373', 'NULL', 'NULL', '1', 'NULL', '612');
