INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('635', 'Austria-Svizzera 7-5', 'Con la locuzione L\'infuocata battaglia di Losanna ci si riferisce all\'accesissimo e rocambolesco quarto di finale del Campionato mondiale di calcio 1954 giocato tra Austria e Svizzera e conclusosi 7 a 5 (risultato primo tempo 5-4), il 26 giugno 1954 a Losanna, presso lo Stade Olympique de la Pontaise, con inizio alle ore 17.00 e all\'attenzione di circa 35.000 spettatori. A tuttora, la partita è la più ricca di gol (ben 12) nella storia delle fasi finali di un Campionato mondiale di calcio.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/Austria_v_Switzerland_(1954)', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:25:30', '2013-05-02 13:25:30', '12542', '1380', 'NULL', 'NULL', '1', 'NULL', '619');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('636', 'Campionato di calcio tedesco occidentale 1947-1948', 'L\'edizione 1947-48 della Westzonenmeisterschaft vide la vittoria finale del Norimberga, in quanto il vincitore della zona di occupazione sovietica, l\'SG Planitz, non venne autorizzato dalle autorità dell\'Unione Sovietica, a prendere parte agli incontri contro le altre squadre, e così facendo, non venne attribuito il titolo di Campione di Germania. A seguito della spartizione della Germania da parte degli Alleati, inoltre, si determinarono quattro singoli campioni, uno per ogni zona di occupazione: zona di occupazione americana: Norimberga 20px zona di occupazione francese: Kaiserslautern 20px zona di occupazione britannica: Amburgo 20px zona di occupazione sovietica: SG Planitz oltre che di Berlino: Union Oberschöneweide', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/1948_German_football_championship', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:31:45', '2013-05-02 13:31:45', '12543', '1381', 'NULL', 'NULL', '1', 'NULL', '620');
