INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('640', 'Supercoppa italiana 2010', 'La Supercoppa italiana 2010 si è disputata il 21 agosto allo stadio Giuseppe Meazza di Milano; la sfida ha visto contrapposte l\'Inter campione d\'Italia in carica e detentrice dell\'ultima Coppa Italia e la Roma finalista di quest\'ultima. A conquistare il titolo furono i nerazzurri, che sconfissero in rimonta 3-1 i giallorossi. Da segnalare il clamoroso errore difensivo di Riise, in precedenza autore del gol romanista, che consentì alla fine del primo tempo a Pandev di pareggiare i conti; nella ripresa una doppietta di Eto\'o consentì a Rafael Benitez di vincere il suo primo trofeo in Italia.', 'SPORT_EVENT', 'IMAGE', 'STORY', 'dbpedia', 'http://dbpedia.org/resource/2010_Supercoppa_Italiana', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', '2013-05-02 13:25:47', '2013-05-02 13:25:47', '12547', '1385', 'NULL', 'NULL', '1', 'NULL', '624');
