INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2608', 'Spanish Bombs', 'Spanish Bombs è una delle canzoni della band inglese The Clash, contenuta nell\'album del 1979 London Calling. La canzone appare anche nelle raccolte The Story of the Clash, Volume 1 e Clash on Broadway.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Spanish_Bombs', 'https://www.youtube.com/v/ertt3o1x65c?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Clash', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11144', 'NULL', 'NULL', 'NULL', '1', 'Punk rock', '4');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2609', 'R.A.M.O.N.E.S.', 'R.A.M.O.N.E.S. è un singolo tributo ai Ramones, pubblicato dai Motörhead, amici di lunga data della band punk, nell\'album 1916. La canzone fu scritta prima che Phil Taylor e Würzel lasciassero i Motörhead ed è suonata ancora oggi nelle esibizioni live della band. Anche i Ramones spesso l\'hanno suonata durante i loro innumerevoli concerti negli anni novanta. È stata inserita nella raccolta Hey Ho! Let\'s Go: The Anthology, nell\'album ¡Adios Amigos! come bonus track nella versione giapponese e nell\'album Greatest Hits Live, ma, in quest\'ultimo, in una versione cantata da Joey Ramone. Joey disse a proposito di questa canzone: « È stato l\'onore più grande, come se John Lennon scrivesse una canzone per te.  »</div> Venne cantata all\'ultimo concerto dei Ramones, al \"Billboard Live at Palace\" a Los Angeles in California il 6 agosto del 1996, con la partecipazione di Lemmy Kilmister. Recentemente è stata inserita come bonus track in alcune edizioni dell\'album Kiss of Death del 2006 dei Motörhead ed anche nell\'album Fang Bang sempre del 2006 dei Wednesday 13.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/R.A.M.O.N.E.S.', 'https://www.youtube.com/v/5rCZR1QpbRg?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11145', 'NULL', 'NULL', 'NULL', '1', 'Punk_rock', '5');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2610', 'Theme from New York, New York', 'Theme from New York, New York – conosciuto anche semplicemente come New York, New York – è un brano musicale lanciato da Liza Minnelli. La musica è stata scritta da John Kander mentre il testo è di Fred Ebb, conosciuti soprattutto per questa canzone appositamente scritta per il film musicale del 1977 New York, New York (film) diretto da Martin Scorsese e interpretato dalla stessa Minnelli e da Robert De Niro. Nei primi anni ottanta Frank Sinatra ne ha dato una personale – e molto apprezzata – versione, divenuta uno dei suoi cavalli di battaglia e con la quale spesso chiudeva i propri concerti. Il 7 febbraio 1985 la canzone è diventata l\'inno ufficiale della città di New York. Divenuto un vero e proprio standard musicale, questo brano non va confuso con l\'omonima canzone New York, New York contenuta nel musical di Leonard Bernstein On the town (Un giorno a New York, le cui musiche sono state composte nel 1944 e che è stato successivamente trasposto per il cinema nel 1949 in un film diretto da Gene Kelly ed interpretato da Frank Sinatra.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Theme_from_New_York,_New_York', 'https://www.youtube.com/v/xMfz1jlyQrw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Liza Minnelli', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11146', 'NULL', 'NULL', 'NULL', '1', 'Traditional pop music', '6');
