INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2612', 'Skyline Pigeon', 'Skyline Pigeon fu una delle prime canzoni di Elton John e Bernie Taupin a diventare famosa e, come essi dichiararono in seguito, il loro primo vero grande brano. È la traccia di spicco dell\'album Empty Sky, distribuito in Gran Bretagna nel 1969. Ne esistono due versioni: una mostra Elton alle prese con il clavicembalo e l\'altra, registrata successivamente, mette in evidenza il pianoforte.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Skyline_Pigeon', 'https://www.youtube.com/v/nPzlGklVNb0?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11148', 'NULL', 'NULL', 'NULL', '1', 'Folk_music', '8');
