INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2617', 'Everyday (Buddy Holly)', 'Everyday è una canzone scritta per Laura Elizabeth Coxon da Charles Hardin e Norman Petty, registrata come singolo da Buddy Holly and the Crickets il 2 maggio del 1957 e pubblicata il 29 settembre. Holly suona la chitarra acustica; alla batteria c\'è Jerry Allison che allo stesso tempo utilizza le sue mani per lo slapping sulle percussioni; Joe B. Mauldin suona il basso acustico e la moglie del produttore Norman Petty, Vi, suona la celesta (uno strumento a tastiera con un tono simile al glockenspiel, utilizzato in alcuni pezzi classici come Dance of the Sugarplum Fairy dei Nutcracker). La durata del brano è di un economico 2 minuti e 5 secondi. Il pezzo raggiunse la posizione 236 della classifica delle 500 più grandi canzoni di tutti i tempi della rivista Rolling Stone . Una cover del brano venne registrata da James Taylor e pubblicata nel 1985, riscuotendo un ottimo risultato nelle classifiche pop e country. Anche Don McLean rifece la canzone così come gli Erasure nel loro album del 2002 Other People\'s Songs. Anche John Denver e i Trashmen ne hanno fatto una loro versione, come anche la band indie rock dei Rogue Wave. I Pearl Jam l\'hanno suonata in una performance live nella città di nascita dell\'autore, Lubbock. È stata inoltre suonata live dai Deep Purple e inserita nel loro album Nobody\'s Perfect nel brano \"Woman from Tokyo\". L\'ennesima versione è stata composta dagli hellogoodbye e pubblicata nell\'album del 2008 Ukulele recordings. Phil Ochs ha utilizzato parte della canzone nel suo \'Buddy Holly Medley\' nel suo LP del 1975 dal titolo Gunfight at Carnegie Hall. È stata inoltre utilizzata nella colonna sonora del film del 2003 Big Fish, nel film del 2009 Mr. Nobody, nel film cult del 1997 Gummo, in un episodio della quarta stagione della serie Lost, \"Cabin Fever\", e nel film Stand By Me. La cover dei Rogue Wave è stata inserita nel trailer del film del 2008, con Anne Hathaway, Rachel Getting Married. Il gruppo Fiction Family ha eseguito una cover del brano nel loro tour originale.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Everyday_(Buddy_Holly_song)', 'https://www.youtube.com/v/kLBWkM0jzK0?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Buddy Holly', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11153', 'NULL', 'NULL', 'NULL', '1', 'Rock and roll', '13');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2618', 'Speak Now (singolo)', 'Speak Now è una canzone della cantante statunitense country pop Taylor Swift, pubblicata il 5 ottobre 2010 come primo singolo promozionale dal suo terzo album Speak Now. Taylor Swift ha preso l\'ispirazione per la canzone da un\'amica, il cui ex fidanzato avrebbe dovuto sposarsi presto con qualcun\'altra. La canzone, che ha come base musicale una chitarra acustica, è narrata dalla parte di una persona che vuole rovinare il matrimonio di un suo precedente amore con l\'intenzione di riconquistarlo. La canzone ha ricevuto buona accoglienza dalla critica in particolar modo per il testo, ritenuto dettagliato. Speak Now ha inoltre avuto un ottimo successo commerciale negli Stati Uniti e in Canada, debuttando all\'ottava posizione delle classifiche di entrambi i Paesi. L\'entrata del singolo nella Billboard Hot 100 è il sesto debutto nella top ten per Taylor Swift, che fa di lei l\'artista con più debutti nelle prime dieci posizioni della classifica in tutta la sua storia. Speak Now è stata inoltre inviata alle stazioni radiofoniche, il che le ha permesso di debuttare nella classifica Hot Country Songs.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Speak_Now_(song)', 'https://www.youtube.com/v/iC-_lVzdiFE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Taylor Swift', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11154', 'NULL', 'NULL', 'NULL', '1', 'Country pop', '14');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2619', 'Not Fade Away', 'Not Fade Away è una canzone scritta da Buddy Holly e Norman Petty. Fu registrata da Holly con i Crickets il 27 maggio 1957 a Clovis nel Nuovo Messico e pubblicato il 27 ottobre 1957 per la Brunswick Records come lato B di Oh, Boy!. È stata inserita in seguito nell\'album The \"Chirping\" Crickets nel 1958. Ritmicamente la canzone è un classico esempio di Bo Diddley beat, ritmo di ispirazione afro-americana. La canzone è stata inserita al 107° nelle 500 migliori canzoni di sempre dal mensile Rolling Stone.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Not_Fade_Away_(song)', 'https://www.youtube.com/v/8w_uqflpCcU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Crickets', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11155', 'NULL', 'NULL', 'NULL', '1', 'Rock and roll', '15');
