INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2622', 'Sister Ray', 'Sister Ray è una canzone del gruppo rock Velvet Underground del 1968, appare nell\'album White Light, White Heat. Lester Bangs la paragonò a opere come Free Jazz di Ornette Coleman o The Black Saint and the Sinner Lady di Charles Mingus. La canzone si distingue per la lunga durata (più di 17 minuti) e per il missaggio confuso ma potente. Gli strumenti sono quasi fusi in un\'unica massa rovente di suoni e stridii. La canzone si regge su 3 accordi di base per tutta la sua durata, sulla quale vengono effettuate improvvisazioni, rallentamenti e accelerazioni.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Sister_Ray', 'https://www.youtube.com/v/gDtqbS7DK2s?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Velvet Underground', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11158', 'NULL', 'NULL', 'NULL', '1', 'Protopunk', '18');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2623', 'Moby Dick (Led Zeppelin)', 'Moby Dick è un brano strumentale della rock band Led Zeppelin, tratto dal loro secondo album Led Zeppelin II. Il titolo della canzone si ispira all\'omonimo romanzo di Herman Melville. La canzone è stata citata, durante vari momenti della carriera della band, anche con i titoli Pat\'s Delight e Over the Top (con la parte iniziale e quella finale che riprendono Out on the Tiles).', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Moby_Dick_(instrumental)', 'https://www.youtube.com/v/r9-42mu1D9Y?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Led Zeppelin', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11159', 'NULL', 'NULL', 'NULL', '1', 'Hard rock', '19');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2624', 'A Night in Tunisia', 'A Night in Tunisia è uno standard jazz composto da Dizzy Gillespie e Frank Paparelli nel 1942 durante la permanenza di Gillespie nella jazz band di Earl Hines. Il brano è anche conosciuto come Interlude, e sotto questo titolo è stato inciso (in una versione vocale dotata di testo) da Sarah Vaughan e Anita O\'Day. Gillespie stesso chiamava la canzone \"Night in Tunisia\". Anche se molto spesso la composizione viene indicata come \"A Night in Tunisia\", il titolo corretto vero e proprio sarebbe Night in Tunisia. Il brano, divenuto un classico, è appearso come title track di almeno 30 CD ed è incluso in circa 500 album in svariate versioni. Nel gennaio 2004, Il brano, nella versione incisa da Dizzy Gillespie & His Sextet nel 1946 per la Victor, è stato introdotto nella Grammy Hall of Fame.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/A_Night_in_Tunisia', 'https://www.youtube.com/v/BQYXn1DP38s?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Dizzy Gillespie', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11160', 'NULL', 'NULL', 'NULL', '1', 'Jazz', '20');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2625', 'A Day in the Life of a Tree', 'A Day in the Life of a Tree (\"Un giorno nella vita di un albero\") è un brano musicale composto da Brian Wilson (musica) e Jack Rieley (testo) per il gruppo pop-rock statunitense The Beach Boys. La traccia venne inclusa nel loro album del 1971 intitolato Surf\'s Up. La parte vocale solista venne inaspettatamente affidata a Rieley, ai tempi manager del gruppo, cantante non professionista, che infatti offrì una prova vocale alquanto incerta.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/A_Day_in_the_Life_of_a_Tree', 'https://www.youtube.com/v/OcorwiADBeM?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beach Boys', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11161', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '21');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2626', 'Frosty the Snowman', 'Frosty the Snowman è un\'allegra canzone natalizia, scritta da Steve Nelson e da Jack Rollins ed incisa nel 1950 da Gene Autry e The Cass County Boys. La canzone, che, parla di un pupazzo di neve, ha ispirato anche un film d\'animazione, uscito negli Stati Uniti nel 1954 ed intitolato sempre Frosty the Snowman ed un cartone animato dal titolo omonimo.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Frosty_the_Snowman', 'https://www.youtube.com/v/pmuJDmjq-xQ?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11162', 'NULL', 'NULL', 'NULL', '1', 'Christmas_music', '22');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2627', 'Sorrow (Pink Floyd)', 'Sorrow è un brano musicale del gruppo progressive rock inglese Pink Floyd, contenuto nell\'album A Momentary Lapse of Reason e scritto da David Gilmour. È il decimo ed ultimo brano del disco.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Sorrow_(Pink_Floyd_song)', 'https://www.youtube.com/v/AdKNlGfkyhc?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11163', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '23');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2628', 'Vegetables', 'Vegetables (o Vega-Tables) è un brano musicale composto da Brian Wilson e Van Dyke Parks per il gruppo musicale statunitense The Beach Boys. La canzone venne pubblicata sul loro album del 1967 intitolato Smiley Smile con Al Jardine e Brian Wilson alla voce solista. Successivamente una nuova registrazione della canzone (basata sulla versione originale inedita) venne pubblicata nel 2004 sul disco Brian Wilson Presents Smile, la versione personale di Brian Wilson del famoso album perduto dei Beach Boys. Infine nel 2011 Vega-Tables è stata inserita all\'interno del cofanetto The Smile Sessions nella versione originale della canzone ideata per SMiLE (nonché in molte altre versioni alternative e demo), e pubblicata come secondo singolo estratto dall\'album.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Vegetables_(song)', 'https://www.youtube.com/v/d0fk15GI7IA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beach Boys', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11164', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '24');
