INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2631', 'I Don\'t Care (Elton John)', 'I Don\'t Care è un brano composto ed interpretato dall\'artista britannico Elton John; il testo è di Gary Osborne.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I_Don\'t_Care_(Elton_John_song)', 'https://www.youtube.com/v/2P_ZPPuezlk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Elton John', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11167', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '27');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2632', 'Fly Me to the Moon', 'Fly Me to the Moon è un brano musicale scritto da Bart Howard nel 1954 con il titolo In Other Words . La canzone divenne popolarmente chiamata \"Fly Me to the Moon\" dalla sua prima riga, ma ci sono voluti alcuni anni affinché gli editori cambiassero il titolo ufficialmente.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Fly_Me_to_the_Moon', 'https://www.youtube.com/v/qtFBRJFN3p8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Frank Sinatra', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11168', 'NULL', 'NULL', 'NULL', '1', 'Traditional pop music', '28');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2633', 'Echoes (Pink Floyd)', 'Echoes è la sesta ed ultima canzone dell\'album Meddle dei Pink Floyd. È una delle più grandiose e famose canzoni della band. La lunga suite (di 23 minuti e 31 secondi) occupa tutto il lato B dell\'album e inizia con una nota di pianoforte acuta (Si) e ripetuta varie volte (l\'effetto è la nota d\'eco di un sonar, ottenuto mediante il passaggio del segnale dello Steinway di Rick Wright in un Leslie). In tutta la composizione predomina un\'atmosfera eterea e onirica, seppur diversa da quella dei Pink Floyd strettamente psichedelici di The Piper at the Gates of Dawn e Ummagumma. La canzone è supportata dal testo di Roger Waters, che anticipa argomenti fulcro di The Dark Side of the Moon. La suite è un insieme di diverse parti composte dai quattro componenti della band in modo autonomo e poi assemblate. Originariamente doveva essere divisa in due parti: The Son of Nothing e Return of the Son of Nothing. Successivamente il titolo fu cambiato in Nothing parts 1-24 ed infine il definitivo Echoes. La canzone ha dato il nome all\'antologia Echoes: The Best of Pink Floyd del 2001, dove è contenuta come quinta traccia in una versione ridotta di 16:30 minuti.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Echoes_(Pink_Floyd_song)', 'https://www.youtube.com/v/PGwPSPIhohk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11169', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '29');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2634', 'Suicide Solution', 'Suicide Solution è un brano musicale interpretato da Ozzy Osbourne. È la quinta traccia del suo primo album da solista intitolato Blizzard of Ozz pubblicato nel 1980. Il chitarrista Randy Rhoads è l\'autore del possente riff metallico della canzone (lo aveva già utilizzato in precedenza per una canzone dei Quiet Riot, il suo ex gruppo, chiamata Force of Habit), e Bob Daisley è il co-autore del testo insieme a Ozzy. Ozzy Osbourne ha dichiarato che il brano è un omaggio a Bon Scott, il cantante degli AC/DC che era morto a causa dell\'abuso di alcol poco tempo prima che la canzone venissa pubblicata.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Suicide_Solution', 'https://www.youtube.com/v/HIgLA_J11dY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Ozzy Osbourne', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11170', 'NULL', 'NULL', 'NULL', '1', 'Heavy metal music', '30');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2635', 'Symptom of the Universe', 'Symptom of the Universe è un brano musicale heavy metal del gruppo inglese Black Sabbath. È la terza traccia del loro sesto album in studio, pubblicato nel 1975. La canzone è tra le più apprezzate dei Black Sabbath, ed è anche ritenuta tra le prime canzoni thrash metal della storia della musica. Symptom of the Universe è divisa in due parti: la prima parte più pesante e puramente heavy metal e la seconda parte più melodica ed acustica. Il testo della canzone è stato scritto dal bassista, Geezer Butler, ispirandosi ad un sogno che aveva fatto, con riferimenti e citazioni sulla cosmogonia, su Dio e sulle creature mitologiche. Questo brano è stato usato nella colonna sonora del videogioco Brütal Legend ed è stato anche reinterpretato dai Sepultura. Una parte del brano è stata inoltre suonata dai Candlemass nel loro Black Sabbath Medley, un medley tra varie canzoni dei Black Sabbath.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Symptom_of_the_Universe_(song)', 'https://www.youtube.com/v/pXgU2cGqlLM?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Black Sabbath', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11171', 'NULL', 'NULL', 'NULL', '1', 'Heavy metal music', '31');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2636', '21st Century Schizoid Man', '21st Century Schizoid Man è un brano della progressive rock band King Crimson dall\'album In the Court of the Crimson King. È una delle canzoni più rappresentative del panorama progressive. Il brano è caratterizzato da una chitarra molto distorta, dal sax e dalla voce urlata di Greg Lake, specie nella prima parte. La seconda parte della canzone è una parte strumentale di stile Jazz Rock per poi approdare alla terza parte della canzone simile alla prima. L\'assolo di chitarra, eseguito da Robert Fripp, è stato inserito all\'82ª posizione nella lista dei 100 migliori assoli di chitarra, pubblicata dalla rivista Guitar World.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/21st_Century_Schizoid_Man', 'https://www.youtube.com/v/ujIbpt-CCTY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'King Crimson', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11172', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '32');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2637', 'Wind Chimes', 'Wind Chimes è un brano musicale composto da Brian Wilson (musica) e Van Dyke Parks (testo). La traccia doveva originariamente essere inclusa nel celebre \"album perduto\" dei Beach Boys del 1966 intitolato SMiLE, come parte di una suite ispirata ai quattro elementi naturali: acqua, fuoco, terra, aria. Dopo la cancellazione di Smile, la band riregistrò completamente la canzone per l\'inclusione nell\'album Smiley Smile del 1967. Questa versione venne pubblicata come B-side del singolo Wild Honey, che raggiunse la posizione numero 31 della classifica statunitense Billboard Hot 100. Infine nel 2004, nuovamente rielaborata dai suoi autori, Wind Chimes venne inclusa nell\'album solista di Wilson intitolato Brian Wilson Presents Smile, sua personale versione dello SMiLE mai pubblicato. Anche quest\'ultima versione fu pubblicata su singolo come B-side, questa volta del brano Wonderful, e raggiunse la posizione numero 29 nella classifica britannica.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Wind_Chimes_(song)', 'https://www.youtube.com/v/uSqHrZgiwRM?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beach Boys', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11173', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '33');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2638', 'Only Mama Knows', 'Only Mama Knows è la quarta traccia dell\'album di Paul McCartney Memory Almost Full. Nel novembre del 2007, la canzone fu eseguita come ultima del programma di Starbucks Song of the Day. Fu nominata per il Grammy Award per Miglior Parte Vocale. McCartney la esegue spesso dal vivo, ed è infatti anche presente nell\'album live Good Evening New York City.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Only_Mama_Knows', 'https://www.youtube.com/v/2NNWDlviFGY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11174', 'NULL', 'NULL', 'NULL', '1', 'Progressive_rock', '34');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2639', 'Love of My Life', 'Love of My Life è il singolo uscito con l\'album Live Killers dei Queen del 1979. La versione non è l\'originale del disco A Night at the Opera del 1975, ma è la versione live cantata nel concerto svoltosi a Francoforte in Germania durante appunto il Live Killers Tour. Nella versione studio è usato prevalentemente il pianoforte suonato da Freddie Mercury propendendo per una voce particolarmente dolce e raffinata con l\'uso del falsetto, nella stessa versione May suona un\'arpa (dice \"quando tornai a casa dopo la registrazione avevo i calli alle dita per via del fatto che le corde erano durissime\"). Differente invece è la versione dei live dove Brian May suona una chitarra acustica spesso a 12 corde abbassando di circa 2 toni e mezzo la canzone cosicché Freddie Mercury possa non usare il falsetto. Love of My Life sarà uno dei capisaldi del gruppo nei concerti con ampia partecipazione del pubblico (spesso si fermavano musica e voce per lasciar spazio al solo canto del pubblico). Questa canzone è un cavallo di battaglia dei Queen durante le loro esibizioni, che durerà fino a Knebworth nel 1986, l\'anno cui la band smise di cantare dal vivo con Freddie Mercury. L\'esibizione più famosa è certamente quella durante il primo Tour nel Sud America 1981, da vari dvd si può notare che il pubblico Sud Americano cantò la canzone pronunciando le parole sempre con un perfetto inglese, cose che in ogni intervista di quegli anni il gruppo faceva presente, e il Rock In Rio del 1985 dove 325000 persone cantarono le parole del brano, con Freddie che si comportò da direttore d\'orchestra. La canzone è stata per un anno intero in testa alla classifica in Argentina.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Love_of_My_Life_(Queen_song)', 'https://www.youtube.com/v/PHbZ9SXHJwA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Queen (band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11175', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '35');
