INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2648', 'Magical Mystery Tour (brano musicale)', 'Magical Mystery Tour (\"la magica gita a sorpresa\") è una canzone dei Beatles che dà il titolo sia all\'album del gruppo che al film del 1967 ideato ed interpretato da loro stessi.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Magical_Mystery_Tour_(song)', 'https://www.youtube.com/v/O8fgJ08cc0M?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11184', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '44');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2649', 'It Ain\'t Me Babe', 'It Ain\'t Me, Babe è il titolo di un brano musicale del 1964 scritto ed interpretato da Bob Dylan, incluso per la prima volta nell\'album Another Side of Bob Dylan. La frase iniziale della canzone (Go away from my window... ) è una citazione di una composizione del cantante folk John Jacob Niles, Go \'Way From My Window. Niles è indicato da Dylan come una delle sue influenze primarie all\'inizio di carriera nella sua autobiografia Chronicles - Volume 1. Il giornalista musicale biografo di Dylan Clinton Heylin afferma che un giornalista del Times presente nel maggio 1964 al concerto di Dylan alla Royal Festival Hall che segnò il debutto sul palco della canzone, fraintese la frase del testo nel ritornello che recita: «no, no, no, it ain\'t me babe» come una parodia della She Loves You dei Beatles con i loro «yeah, yeah, yeah». Quando Bob Dylan eseguì i suoi primi concerti elettrici al Forest Hills Tennis Stadium, alla Carnegie Hall, all\'Hollywood Bowl, e a Monterey nel 1965, rifece It Ain\'t Me, Babe con un arrangiamento elettrico. Secondo alcune interpretazioni il soggetto della canzone sarebbe la rottura della relazione sentimentale di Dylan con Suze Rotolo (che rievocherà a suo modo anche nella lunga e velenosa Ballad In Plain D presente sempre sullo stesso album), alla quale il cantautore rivolgerebbe il suo caustico: «It Ain\'t Me Babe» (\"Quello non sono io, bambina\") indicandole con amarezza che non è lui l\'uomo della sua vita.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/It_Ain\'t_Me_Babe', 'https://www.youtube.com/v/-RPW-zV18mA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11185', 'NULL', 'NULL', 'NULL', '1', 'Folk music', '45');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2650', 'Suzanne (brano musicale)', 'Suzanne è il titolo di una celebre canzone di Leonard Cohen contenuta nel suo disco d\'esordio del 1967, il cui testo fu inizialmente pubblicato nel 1966 come poesia. La canzone è ispirata alle visite che il cantautore compiva presso Suzanne Verdal, ballerina, e suo marito, il noto scultore Armand Vaillancourt, con offerta di tè e fette d\'arancia. Alcune interpretazioni affermano che, in questa canzone, Cohen fa riferimento ad un suo rapporto sessuale con Suzanne. In una intervista del 1970 tuttavia Cohen affermò che mai aveva avuto relazioni con Suzanne e la canzone conteneva elementi della realtà mescolati con l\'immaginazione - affermazione confermata dalla stessa Suzanne in un\'intervista del 2006. Stando alla lettura di Riccardo Bertoncelli http://www. delrock. it/album/1967/songs_of_leonard_cohen. php, \"la canzone intreccia una visita a casa sua (della Verdal, n.d.r. ), vicino al fiume St. Lawrence, e le fantasie scatenate da una visita a una piccola chiesa dei marinai sempre a Montreal, la Chapelle de Bonsecours\". Incontrata a Montreal, Suzanne aveva peraltro già ispirato alcune poesie pubblicate in Parasites of Heaven (1966): tra queste era compreso anche il futuro testo per canzone (inserito all\'ultimo momento, per mancanza di materiale nuovo), con il titolo \"Suzanne takes you down\". Come poi farà in molte altre canzoni, Cohen usa metafore bibliche per raccontare il sognato rapporto. Il racconto sfuggente e intessuto di immagini sognanti, unito alla musica prevalentemente acustica e al pacato tono di voce del cantante, restituisce una sensazione di delicatezza che sembra quasi risolvere il rapporto tra vita spirituale e passione carnale - tematica tra le più tipiche del repertorio coheniano. Come sempre nelle sue canzoni, è una donna a rappresentare iconicamente tale rapporto, tramite l\'enigma della propria bellezza.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Suzanne_(Leonard_Cohen_song)', 'https://www.youtube.com/v/g3PhVVSNxos?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11186', 'NULL', 'NULL', 'NULL', '1', 'NULL', '46');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2651', 'Lollipop (Big Bang e 2NE1)', 'Lollipop è un brano musicale interpretato dai Big Bang e dalle 2NE1, realizzato per promuovere un telefono cellulare della LG Cyon. E\' stato realizzato utilizzando una interpolazione del brano del 1958 scritto day Julius Dixson e Beverly Ross. Il brano ha avuto un buon successo in patria, rimanendo per quattro settimane consecutive al vertice della classifica del portale musicale M. Net. Lollipop è inoltre stato utilizzato come singolo di debutto non ufficiale delle NE1, che debutteranno ufficialmente qualche settimana dopo con Fire.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Lollipop_(Big_Bang_and_2NE1_song)', 'https://www.youtube.com/v/zIRW_elc-rY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Big Bang (South Korean band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11187', 'NULL', 'NULL', 'NULL', '1', 'Dance-pop', '47');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2652', 'You\'re Not Sorry', 'You\'re Not Sorry è una canzone della cantante statunitense country pop Taylor Swift, pubblicata come singolo promozionale prima della pubblicazione del suo secondo album Fearless. Il singolo è stato pubblicato il 28 ottobre 2008 nel solo formato di download digitale dall\'etichetta discografica Big Machine Records. Per aver venduto più di mezzo milione di copie, il singolo è stato certificato disco d\'oro negli Stati Uniti. Dato che non è stato pubblicato come singolo, You\'re Not Sorry non ha ricevuto airplay, pertanto le posizioni raggiunte in classifica sono grazia alle vendite digitale. La canzone è entrata nella classifica dei singoli digitali più venduti alla seconda posizione e nella Billboard Hot 100 all\'undicesima. Entrando in classifica a questa posizione, You\'re Not Sorry è stato il debutto più alto della settimana. La settimana dopo la canzone è escesa alla trentacinquesima posizione, per poi scomparire totalmente dalla classifica. È rientrata in classifica alla sessantasettesima posizione in seguito alla pubblicazione del remix.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/You\'re_Not_Sorry', 'https://www.youtube.com/v/kBH8l1R-ajY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Taylor Swift', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11188', 'NULL', 'NULL', 'NULL', '1', 'Country pop', '48');
