INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2655', 'Without You (Badfinger)', 'Without You è una canzone pop scritta da Peter Ham e Tom Evans ed originariamente registrata nel 1970 dal gruppo Badfinger. Il brano ottenne popolarità soltanto due anni dopo, quando fu registrato e pubblicato su disco singolo da Harry Nilsson. In seguito furono registrate numerose cover del brano, ma probabilmente la più ricordata è quella del 1993 di Mariah Carey. Con il testo in italiano scritto da Daniele Pace ed il titolo Per chi è stata nel 1972 un successo dei Gens e di Johnny Dorelli.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Without_You_(Badfinger_song)', 'https://www.youtube.com/v/PyBS_1vGwpU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Badfinger', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11191', 'NULL', 'NULL', 'NULL', '1', 'Power pop', '51');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2656', 'The Show Must Go On (Pink Floyd)', 'The Show Must Go On è una canzone dei Pink Floyd, scritta interamente da Roger Waters, pubblicata nel 1979 all\'interno dell\'album The Wall. Questa canzone non è stata inclusa né nel film Pink Floyd The Wall né nel concerto di Waters del 1990 The Wall Live-in Berlin. Inoltre nella versione registrata nell\'album mancano quattro versi che, tuttavia, compaiono nel testo di copertina: \"Do I have to stand up Wild eyed in the spotlight What a nightmare Why! Don\'t I turn and run\" Dopo questi c\'è il verso che effettivamente apre la canzone nell\'album. La canzone completa è stata eseguita durante il concerto del tour del 1980-1981, in seguito pubblicato in un album, Is There Anybody Out There?: The Wall Live 1980-1981.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_Show_Must_Go_On_(Pink_Floyd_song)', 'https://www.youtube.com/v/UzTN3e_m37E?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11192', 'NULL', 'NULL', 'NULL', '1', 'Art rock', '52');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2657', 'Love in Vain', 'Love in Vain è una canzone blues del 1937 composta da Robert Johnson. Il brano è stato ripreso in seguito da parecchi musicisti, tra i quali i Rolling Stones nell\'album Let It Bleed del 1969, anche se sull\'etichetta del vinile il pezzo viene accreditato a un non meglio identificato Woody Payne invece che a Robert Johnson. I Rolling Stones eseguirono inoltre il brano in concerto nei loro tour del 1969 e del 1972 e lo ripubblicarono anche negli album dal vivo Get Yer Ya-Ya\'s Out! e Stripped nonché nel film del concerto Ladies and Gentlemen: The Rolling Stones. In tempi più recenti, il brano è stato eseguito anche da Eric Clapton e inserito nel suo album Me and Mr. Johnson insieme ad altri pezzi dello stesso autore. Clapton ha reso un ulteriore omaggio a questo brano inserendone una citazione nella canzone Layla scritta per Derek and the Dominos (... please don\'t say we\'ll never find a way, and tell me all my love\'s in vain). La canzone si distingue per la melodia e i testi malinconici, caratteristiche che risaltano in modo particolare nella versione originale eseguita da Robert Johnson. Johnson era un ammiratore del pianista e cantante blues Leroy Carr e in effetti Love in Vain riprende la struttura del brano di Carr In the Evenin\' When the Sun Goes Down, anch\'esso di carattere malinconico e che tratta la perdita di un amore. Nel film del 1992 The Search For Robert Johnson, l\'attore John P. Hammond fa suonare il disco nella sua versione originale per un\'anziana Willie Mae Powell, la donna per cui si suppone Johnson abbia composto il brano.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Love_in_Vain', 'https://www.youtube.com/v/-BkPm8JIJJQ?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Robert Johnson', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11193', 'NULL', 'NULL', 'NULL', '1', 'Blues', '53');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2658', 'In the Flesh?', 'In the Flesh? è una canzone della band inglese Pink Floyd, pubblicata nel 1979. È la prima canzone del doppio album The Wall. </br> Il titolo, traducibile in italiano in senso figurato con \"di persona?\", oppure \"in forma?\", è riferito al tour In the Flesh che la band fece nel 1977, durante il quale Roger Waters, in un attacco d\'ira, sputò ad un fan che cercava di scavalcare le transenne che separavano il pubblico dal palco (in alcune interviste Waters ha dichiarato che fu proprio quell\'episodio ad ispirare la creazione dell\'album The Wall)', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/In_the_Flesh%3F', 'https://www.youtube.com/v/53I2_DbVUqU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11194', 'NULL', 'NULL', 'NULL', '1', 'Progressive_rock', '54');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2659', 'Nothingman', 'Nothingman è una canzone del gruppo grunge/alternative rock statunitense Pearl Jam, pubblicata per la prima volta nel 1994 sul terzo album di studio della band Vitalogy e contenuta nella raccolta Rearviewmirror: Greatest Hits 1991-2003 del 2004. La parte strumentale venne registrata nel novembre del 1993 al Kingsway Studio di New Orleans, le voci vennero invece registrate nel febbraio del 1994 al Bad Animals Studio di Seattle. Il testo è stato scritto dal cantante Eddie Vedder, mentre la musica è stata composta dal bassista Jeff Ament.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Nothingman', 'https://www.youtube.com/v/CgSR4ltkDCg?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pearl Jam', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11195', 'NULL', 'NULL', 'NULL', '1', 'Alternative rock', '55');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2660', 'Marvins Room', 'Marvins Room è una brano musicale del cantante canadese Drake, estratto il 22 luglio 2011 come singolo promozionale dal suo secondo album, intitolato Take Care. Il pezzo è stato scritto da Aubrey Graham (lo stesso Drake), Noah Shebib, Adrian Eccleston e Jason Beck ed è stato prodotto da Shebib. Il singolo ha raggiunto la ventunesima posizione della classifica statunitense e si è aggiundicato il disco d\'oro per aver venduto oltre 500.000 copie. Della canzone è stato anche realizzato un video musicale, che è stato caricato sull\'account dell\'etichetta discografica Cash Money Records il 28 giugno 2011. Mentre la canzone in sé ha una durata di quasi sei minuti, la versione presentata nel video dura circa la metà.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Marvins_Room', 'https://www.youtube.com/v/nwyjxsOYnys?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11196', 'NULL', 'NULL', 'NULL', '1', 'Contemporary_R&B', '56');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2661', 'Apple scruffs', 'Le Apple scruffs sono state un gruppo non organizzato di ammiratrici dei Beatles. Il loro nome deriva dal fatto che stazionavano e a volte dormivano all\'esterno dell\'edificio della Apple Corps e alle porte degli Abbey Road Studios di Londra, durante gli ultimi giorni della Beatlemania e anche successivamente, nella speranza di vedere i membri della band e interagire con loro. Un altro posto che le Apple scruffs sorvegliavano era il 7 di Cavendish Avenue a Londra, residenza di Paul McCartney. I Beatles hanno avuto un rapporto ambivalente ma spesso amichevole con queste fan: due Apple scruffs, Lizzie Bravo e Gayleen Pease, furono addirittura chiamate a cantare durante la registrazione di Across the Universe. Anche se nessuna versione comprendente le loro voci è stata inclusa in un disco dei Beatles, possono essere ascoltate nel mix della canzone utilizzato per l\'album di beneficenza per il World Wildlife Fund No One\'s Gonna Change Our World e successivamente pubblicato nella compilation Past Masters, Volume Two. La canzone dei Beatles She Came In Through the Bathroom Window si riferisce al giorno in cui alcune Apple scruffs entrarono in casa di Paul McCartney attraverso una finestra del bagno al piano superiore, frugarono nel suo guardaroba provandosi un suo paio di pantaloni e rubarono una fotografia incorniciata, poi restituita su richiesta dello stesso McCartney. Dopo lo scioglimento dei Beatles, George Harrison scrisse una canzone a loro intitolata: Apple Scruffs, inclusa nel suo album solista All Things Must Pass (1970). Nel 1985, una delle Apple scruffs, Carol Bedford, ha pubblicato un libro di memorie della sua esperienza come fan, Waiting for the Beatles: la storia di un\'Apple Scruff.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Apple_scruffs', 'https://www.youtube.com/v/MrPTgEWYxk4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'George Harrison', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11197', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '57');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2662', 'Manic Depression', 'Manic Depression è una canzone del primo album di Jimi Hendrix del 1967 Are You Experienced; La canzone è dedicata alla psicosi maniaco-depressiva, una malattia che porta a passare da momenti di esaltazione a di depressione in poco tempo. La canzone si apre con una scala cromatica con una piccola pausa, per poi proseguire con un inusuale tempo in 9/8.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Manic_Depression_(song)', 'https://www.youtube.com/v/gEv1Lh_gJeo?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Jimi Hendrix Experience', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11198', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '58');
