INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2664', 'I Don\'t Think So', 'I Don\'t Think So è un brano musicale della cantante R&B statunitense Kelis, pubblicato come quarto ed ultimo singolo estratto dall\'album Kelis Was Here del 2006. Il brano ha ottenuto una certa popolarità in Australia, in quanto utilizzato per pubblicizzare l\'ottava edizione dell\'edizione locale del Grande fratello e negli Stati Uniti per American Gladiators.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I_Don\'t_Think_So', 'https://www.youtube.com/v/kS9SUmAyKWM?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Kelis', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11200', 'NULL', 'NULL', 'NULL', '1', 'Synthpop', '60');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2665', 'Terminal Frost', 'Terminal Frost è un brano musicale del gruppo progressive rock inglese Pink Floyd, contenuto nell\'album A Momentary Lapse of Reason; è un pezzo strumentale ed è l\'ottava traccia del disco. Il brano è stato scritto da David Gilmour.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Terminal_Frost', 'https://www.youtube.com/v/ef7_H4VGuIw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11201', 'NULL', 'NULL', 'NULL', '1', 'Instrumental rock', '61');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2666', 'Breathe (Taylor Swift)', 'Breathe è una canzone della cantante statunitense country pop Taylor Swift, pubblicata come singolo promozionale prima della pubblicazione del suo secondo album Fearless. Il singolo è stato pubblicato il 21 ottobre 2008 dall\'etichetta discografica Big Machine Records, ed è un duetto con la cantante Colbie Caillat. Nella settimana del 29 novembre 2008 Breathe è entrata all\'ottantasettesima posizione della classifica americana, la Billboard Hot 100. Con altre sei canzoni, Taylor Swift è, assieme a Miley Cyrus, la cantante donna ad avere più canzoni in quella classifica nella stessa settimana. Il singolo ha trascorso solo una settimana in classifica.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Breathe_(Taylor_Swift_song)', 'https://www.youtube.com/v/uLw3NYydHNU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Taylor Swift', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11202', 'NULL', 'NULL', 'NULL', '1', 'Country pop', '62');
