INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2674', 'Masterpiece (Madonna)', 'Masterpiece è un brano della cantante statunitense Madonna pubblicato il 31 gennaio 2012 nella colonna sonora del film W.E. - Edoardo e Wallis, intitolata W.E. - Music from the Motion Picture. Il brano è stato premiato alla 69 edizione dei Golden Globe nella categoria \"migliore canzone originale\". La canzone è stata inclusa nella tracklist del dodicesimo album in studio di Madonna, MDNA, ed è stato pubblicato come terzo singolo solo nel Regno Unito il 2 aprile 2012. Il singolo, andato in rotazione radiofonica in UK, non è stato pubblicato su disco fisico, ma è solo scaricabile tramite i vari siti di downlaod.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Masterpiece_(Madonna_song)', 'https://www.youtube.com/v/txj3eRoDT5o?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Madonna (entertainer)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11210', 'NULL', 'NULL', 'NULL', '1', 'Pop music', '70');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2675', 'Madness (Elton John)', 'Madness è un brano composto ed interpretato dall\'artista britannico Elton John; il testo è di Gary Osborne.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Madness_(Elton_John_song)', 'https://www.youtube.com/v/Zx4HYH9Y35Y?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Elton John', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11211', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '71');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2676', 'I Wanna Be Your Boyfriend', 'I Wanna Be Your Boyfriend è un singolo discografico della band punk Ramones. È stato pubblicato nell\'album Ramones del 1976. Si tratta di una canzone d\'amore ed è la prima canzone pop punk della band. « Sweet little girl, I wanna be your boyfriend.  »</div> Secondo Dee Dee i Ramones potevano guadagnare un milione di dollari grazie a questa canzone: « Potevamo farci un milione di dollari perché i Bay City Rollers la volevano fare al nostro posto.  »</div> Per All Music Guide la canzone \"funziona\" all\'interno dell\'album Ramones, perché dona alla band un senso d\'immaturità che ben si conciliava con l\'immagine del gruppo a quel tempo.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I_Wanna_Be_Your_Boyfriend', 'https://www.youtube.com/v/iS8oYNK73Ek?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11212', 'NULL', 'NULL', 'NULL', '1', 'Punk_rock', '72');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2677', 'Hellraiser (Motörhead)', 'Hellraiser è una canzone di Ozzy Osbourne e dei Motörhead. È stata scritta da Ozzy e Lemmy Kilmister, cantante e bassista dei Motörhead. Ozzy la registrò per il suo fortunato album No More Tears, del 1991; mentre i Motörhead la registrarono come parte della colonna sonora del film Hellraiser 3: Inferno sulla Terra e in seguito la rilasciarono come singolo, nel 1992 per poi apparire su March ör Die dello stesso anno. Fanno parte di questo singolo anche Name in Vain, apparsa anch\'essa nell\'album March ör Die, e Dead Man\'s Hand. La title-track è inoltre apparsa nell\'EP \'92 Tour EP. Hellraiser è stata registrata nuovamente per il videogioco Grand Theft Auto: San Andreas, per comparire tra le canzoni della stazione radio \"Radio: X\". Questa versione è quella originale e infatti è cantata da Ozzy Osbourne e caratterizzata da una maggiore qualità audio rispetto alla registrazione originale. Questa è stata la prima canzone che Mikkey Dee ha registrato per i Motörhead, seguita da Hell in Earth. La canzone è stata registrata nelle stesse sessioni di Born to Raise Hell e nel suo videoclip appare anche il famoso Portaspilli, che in questo caso gioca a carte contro Lemmy ma, perdendo alla fine, la partita.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Hellraiser_(song)', 'https://www.youtube.com/v/ibaZsVlkuQg?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Ozzy Osbourne', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11213', 'NULL', 'NULL', 'NULL', '1', 'Heavy metal music', '73');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2678', 'If 6 Was 9', 'If 6 Was 9 è un brano della band rock The Jimi Hendrix Experience, inserito nell\'album Axis: Bold as Love. È stato pubblicato su 45 giri insieme a Stone Free. È stato usato nella colonna sonora di Easy Rider ed in quella di Point Break - Punto di rottura.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/If_6_Was_9', 'https://www.youtube.com/v/n_fp5kaVYhk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Jimi Hendrix Experience', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11214', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '74');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2679', 'Dig It (brano musicale)', 'Dig It è un brano dei Beatles, pubblicato sul loro ultimo album in studio, Let It Be. È uno dei pochi brani accreditati a tutti i componenti del gruppo (gli altri sono Flying, Suzy Parker, 12-bar Original, Los Paranoias e la versione dei Beatles di Free As a Bird). Il brano, come anche Maggie Mae, è presente nell\'album Let It Be, ma non in Let It Be... Naked.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Dig_It_(song)', 'https://www.youtube.com/v/Mq9zhpBweDk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11215', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '75');
