INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2683', 'When the Levee Breaks', 'When the Levee Breaks è una reinterpretazione blues rock/hard rock dei Led Zeppelin, tratta dall\'album Led Zeppelin IV. La canzone, che è l\'ottava traccia dell\'album e lo completa, è lunga 7 minuti e 8 secondi ed è caratterizzata dall\'uso dell\'armonica durante tutto il brano.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/When_the_Levee_Breaks', 'https://www.youtube.com/v/WbrjRKB586s?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Led Zeppelin', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11219', 'NULL', 'NULL', 'NULL', '1', 'Blues rock', '79');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2684', 'For No One', 'For No One è una canzone dei Beatles scritta da Paul McCartney (ma accreditata come da consuetudine al duo Lennon/McCartney) e contenuta nel settimo album della band, Revolver. Si tratta di un delicato brano di pop barocco che racconta la fine di una relazione. La canzone è ritenuta una delle composizioni migliori e più mature di McCartney. Perlopiù eseguita solo dal suo compositore, la traccia si distingue anche per un celebre assolo di corno francese, suonato dal musicista classico Alan Civil. A proposito del brano di McCartney, John Lennon disse: «Una delle sue canzoni che preferisco; un lavoro veramente ben fatto. »', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/For_No_One', 'https://www.youtube.com/v/Z4HxhzBG0ag?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11220', 'NULL', 'NULL', 'NULL', '1', 'Baroque pop', '80');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2685', 'Nobody Home', 'Nobody Home è una canzone dei Pink Floyd contenuta nell\'album The Wall, pubblicato nel 1979. Gran parte della canzone descrive lo stato mentale di Syd Barrett nel 1967 e, nell\'intervista \"Behind The Wall\", David Gilmour ha detto che il brano descrive ciò che la maggior parte delle rockstar vivono durante i loro tour. In particolare i versi « I got nicotine stains on my fingers. I got a silver spoon on a chain. Got a grand piano to prop up my mortal remains »</div> si riferiscono a Richard Wright, che, in quegli anni, assumeva cocaina e ne stava diventando dipendente.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Nobody_Home', 'https://www.youtube.com/v/NGFSNE18Ywc?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11221', 'NULL', 'NULL', 'NULL', '1', 'Art rock', '81');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2686', 'Yet Another Movie', 'Yet Another Movie è un brano musicale della progressive rock band inglese Pink Floyd, contenuto nell\'album A Momentary Lapse of Reason e scritto da David Gilmour e Patrick Leonard. Nell\'album, nella stessa traccia del brano, si trova anche lo strumentale Round and Around Il brano è presente anche nell\'album dal vivo Delicate Sound Of Thunder, nel quale, però, è separato da Round and Around, situata in una traccia a sè. Il verso the vision of an empty bed suggerì a Storm Thorgerson l\'idea per la copertina dell\'album, che rappresenta una lunga fila di letti da ospedale situati su una spiaggia.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Yet_Another_Movie', 'https://www.youtube.com/v/Sbcwue-5T7I?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11222', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '82');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2687', 'The Wizard and I', '“The Wizard and I” (il mago ed io) è una canzone del musical Wicked di Stephen Schwartz. Fu interpretata originariamente a Broadway da Idina Menzel (nel ruolo di Elphaba) e da Carole Shelley nell’incisione del cast originale. The Wizard and I Artista Stephen Schwartz Autore/i Stephen Schwartz (musiche) Winnie Holzman (testi) Genere Musical Stile pop Edito da Decca Records Tempo Riferimento Esecuzioni notevoli Pubblicazione Incisione Wicked Data 2003 Data seconda pubblicazione Etichetta Durata 5min : 12 sec Note Campione audio Wicked – tracce Precedente Successiva Dear Old Shilz What is this Feeling?', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_Wizard_and_I', 'https://www.youtube.com/v/3KONtFiRG9s?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Idina Menzel', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11223', 'NULL', 'NULL', 'NULL', '1', 'Showtunes', '83');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2688', 'Roman Reloaded', 'Roman Reloaded è una canzone della rapper statunitense Nicki Minaj, interpretata in duetto col rapper suo connazionale Lil Wayne ed estratto come secondo singolo dall\'album Pink Friday: Roman Reloaded. Il brano è stato fatto ascoltare in anteprima sulla stazione radiofonica Hot 97 il 23 febbraio 2012 per poi essere pubblicato sulle piattaforme digitali il giorno successivo. Esso è stato inoltre inviato alle radio statunitensi il 6 marzo 2012. Il brano ha ricevuto critiche generalmente positive, in particolare da MTV e Billboard, che hanno apprezzato il ritorno della Minaj all\'hardcore hip hop.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Roman_Reloaded_(song)', 'https://www.youtube.com/v/_osQCbDb_xw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Nicki Minaj', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11224', 'NULL', 'NULL', 'NULL', '1', 'Hip hop music', '84');
