INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2692', 'Toinen', 'Toinen è un brano musicale della cantante finlandese Jenni Vartiainen, estratto come terzo singolo dal suo album di debutto Ihmisten edessä. Toinen è stato pubblicato il 3 dicembre 2007 su iTunes. Il singolo è entrato in classifica alla diciottesima posizione e ha raggiunto la tredicesima, il suo attuale picco, nella sua quarta settimana in classifica. Ha mantenuto la posizione per un\'altra settimana, ed è rimasto in classifica per sette settimane in totale.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Toinen', 'https://www.youtube.com/v/eZIlRCNWZfc?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Jenni Vartiainen', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11228', 'NULL', 'NULL', 'NULL', '1', 'Pop music', '88');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2693', 'We\'ll Meet Again', 'We\'ll Meet Again è un brano musicale portato al successo dalla cantante inglese Vera Lynn nel 1939. La musica è di Ross Parker e le parole sono di Hughie Charles. È una delle canzoni più famose degli anni della Seconda guerra mondiale, e si riferisce ai soldati che andavano a combattere e alle loro famiglie e alle loro innamorate. L\'affermazione che \"ci incontreremo ancora\" è ottimistica, dato che molti soldati non sopravvissero e non tornarono a rivedere i loro amati. Tuttavia questo luogo indefinito dove reincontrare i propri cari che non erano ritornati potrebbe essere interpretato come il paradiso. La canzone dette il titolo ad un musical del 1943, nel quale la stessa Vera Lynn interpretava il ruolo principale. Fa anche parte anche della colonna sonora del film di Stanley Kubrick, Il dottor Stranamore, ovvero: come imparai a non preoccuparmi e ad amare la bomba. Durante la guerra fredda, la canzone fu inserita nella programmazione di musica che 20 stazioni radio sotterranee della BBC avrebbero trasmesso per cento giorni dopo un attacco nucleare. I Pink Floyd citano la canzone e la sua interprete nella canzone Vera dall\'album The Wall: \"Does anybody here remember Vera Lynn?/Remember how she said that we would meet again some sunny day?\".', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/We\'ll_Meet_Again', 'https://www.youtube.com/v/cHcunREYzNY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11229', 'NULL', 'NULL', 'NULL', '1', 'NULL', '89');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2694', 'Angel in Disguise (Brandy)', 'Angel in Disguise è un brano R&B della cantante statunitense Brandy, prodotto da Darkchild e scritto da quest\'ultimo insieme a LaShawn Daniels, Fred Jerkins III, Isaac Philips, Nycolia Turman, Traci Hale per il secondo album della cantante, Never Say Never. Il brano è stato pubblicato come vinile singolo destinato esclusivamente alla programmazione radiofonica, e nonostante questo è entrato nella Billboard Hot 100, diventando il primo brano di Brandy ad entrare in classifica senza l\'aiuto di un cd singolo e di un video.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Angel_in_Disguise_(Brandy_Norwood_song)', 'https://www.youtube.com/v/NNLc4RZR_z4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Brandy Norwood', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11230', 'NULL', 'NULL', 'NULL', '1', 'Rhythm and blues', '90');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2695', 'Crippled Inside', 'Crippled Inside è un brano musicale scritto ed interpretato da John Lennon. La canzone è inserita nell\'album Imagine ed è uscita nel 1971.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Crippled_Inside', 'https://www.youtube.com/v/XBuMC25npYk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'John Lennon', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11231', 'NULL', 'NULL', 'NULL', '1', 'Country rock', '91');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2696', 'Eruption (brano musicale)', 'Eruption è il titolo di una canzone scritta nel 1978 da Eddie Van Halen, chitarrista della band americana Van Halen. Fu pubblicata nel primo album del gruppo: Van Halen, pubblicato per l\'etichetta discografica Warner Bros. Records. Inizialmente non venne concepita come traccia per un album, ma come assolo per i concerti, suonata da Eddie Van Halen solamente nelle prime serate nei locali americani. Solo successivamente, dopo averla suonata al Whisky a Go Go con grande successo, decise assieme agli altri membri del gruppo di inserirla come seconda traccia nel primo album da loro registrato. Il successo di questa canzone è testimoniato anche da due fatti: ad oggi risulta essere al secondo posto nella classifica dei 100 Migliori Assoli per Chitarra stilata da Guitar World. fa da sfondo sonoro nel gioco Guitar Hero: Van Halen, risultando essere la canzone più difficile del gioco.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Eruption_(instrumental)', 'https://www.youtube.com/v/kvDMlk3kSYg?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Van Halen', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11232', 'NULL', 'NULL', 'NULL', '1', 'Instrumental rock', '92');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2697', 'Cygnus X-1 (brano musicale)', 'Cygnus X-1 è una suite del gruppo rock canadese dei Rush. È divisa in due sezioni maggiori (in totale sarebbero nove) : la prima Cygnus X-1 Book I : The Voyage è l\'ultima traccia di A Farewell to Kings ed è lunga circa dieci minuti; la seconda Cygnus X-1 Book II : Hemispheres è la prima del successivo Hemispheres ed ha durata ben più lunga : circa diciotto minuti.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Cygnus_X-1_duology', 'PROBLEMA', 'NULL', 'Rush (band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11233', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '93');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2698', 'Cuz I Can	', 'Cuz I Can è un brano musicale della cantante americana P!nk, prodotto da Max Martin e Dr. Luke ed estratto come settimo singolo dal suo quarto album, I\'m Not Dead, pubblicato nel 2006. È stata una delle cinque tracce dell\'album ad essere divulgate in rete prima della sua pubblicazione ufficiale. Il singolo è stato trasmesso per la prima volta radiofonicamente in Australia il 4 ottobre 2007 ed ha esordito alla posizione 33 nella classifica digitale australiana, salendo fino alla posizione 14. In Nuova Zelanda, il brano è entrato nella classifica nazionale alla posizione 39 e, nel dicembre 2007, è salito alla posizione 29. In Australia era prevista una pubblicazione in formato fisico del singolo, ma essa è stata cancellata in quanto \'Cuz I Can non è riuscito ad entrare nella top 10 della classifica australiana. Per il brano, inoltre, non è stato girato alcun videoclip ma ne è stato divulgato uno promozionale, composto da spezzoni con le performance di P!nk dell\'I\'m Not Dead Tour.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/\'Cuz_I_Can', 'https://www.youtube.com/v/QreX9EscLBU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink (singer)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11234', 'NULL', 'NULL', 'NULL', '1', 'Dance-rock', '94');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2699', 'Al otro lado del río', '\"Al otro lado del Río\" è una canzone scritta e interpretata dall\'uruguayano Jorge Drexler per il film I diari della motocicletta. Il brano, oltre ad essere inserito nella colonna sonora originale del film, si può trovare anche nell\'album Eco², una seconda versione dell\'album Eco di Drexler, pubblicato nel 2004.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Al_otro_lado_del_r%C3%ADo', 'https://www.youtube.com/v/5Cw7HtSHQgE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Jorge Drexler', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11235', 'NULL', 'NULL', 'NULL', '1', 'Latin pop', '95');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2700', 'Bob Dylan\'s Dream', 'Bob Dylan\'s Dream - traducibile letteralmente in lingua italiana Sogno di Bob Dylan - è il titolo di una canzone in forma di ballata scritta da Bob Dylan nel 1962. Il brano fa parte del secondo album registrato in studio da Dylan (e il primo con composizioni proprie), The Freewheelin\' Bob Dylan, pubblicato nel 1963. La melodia e alcuni passaggi testuali sono basati sulla ballata tradizionale Lady Franklin\'s Lament. Il titolo della canzone è citato sulla copertina dell\'album dei Rolling Stones Beggar\'s Banquet.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Bob_Dylan\'s_Dream', 'https://www.youtube.com/v/ABePCWgh_oA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11236', 'NULL', 'NULL', 'NULL', '1', 'Folk music', '96');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2701', 'Lista delle canzoni Polka di \"Weird Al\" Yankovic', 'I Polka Medleys sono una serie di canzoni del cantante americano \"Weird Al\" Yankovic, in cui l\'artista mescola versi e ritornelli di canzoni di altri artisti reinterpretandole in versione polka. Questo particolare tipo di composizioni è diventato un marchio di fabbrica del cantante statunitense, tanto che i Polka Medleys appaiono in nove dei suoi dodici album. Solo due polka sono state rilasciate come singolo: \"Hooked on Polkas\" e \"Polka Power!\". Yankovic ha sempre chiesto l\'autorizzazione per utilizzare i pezzi di altri artisti nei medley, specialmente per via dei diritti d\'autore.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/List_of_%22Weird_Al%22_Yankovic_polka_medleys', 'PROBLEMA', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11237', 'NULL', 'NULL', 'NULL', '1', 'Comedy', '97');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2702', 'Defying Gravity (Wicked)', 'Defying Gravity (Sfidando la gravità) è una canzone del musical di Stephen Schwartz Wicked, incisa originariamente da Idina Menzel e Kristin Chenoweth nel cast originale di Broadway. La canzone è il grande assolo di Elphaba che conclude il primo atto; nella canzone ci sono anche due duetti con Glinda, miglior amica di Elphaba, all’inizio e verso la metà del brano, e di un intervento del coro dei cittadini di Oz sul finale. La canzone è la più famosa del musical, ed è stata trasmessa dalla BBC nel programma I’d Do Anything; il brano è al sessantesimo posto delle maggiori hit-parade del Regno Unito.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Defying_Gravity_(song)', 'https://www.youtube.com/v/FlMBcTGJ4YM?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Idina Menzel', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11238', 'NULL', 'NULL', 'NULL', '1', 'Show tune', '98');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2703', 'Most Likely You Go Your Way (And I\'ll Go Mine)', 'Most Likely You Go Your Way (And I\'ll Go Mine) è una canzone di Bob Dylan, la quinta traccia del secondo disco del suo doppio album del 1966 Blonde on Blonde. Dylan fece uscire la canzone come singolo per due volte durante la sua carriera, la prima volta nel 1974, raggiungendo la posizione numero 66 in classifica negli Stati Uniti e la seconda volta nel 2007, in una versione remixata, che raggiunse la posizione numero 51 in classifica in Gran Bretagna.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Most_Likely_You_Go_Your_Way_(And_I\'ll_Go_Mine)', 'https://www.youtube.com/v/YtMtW1wVowU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11239', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '99');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2704', 'My Back Pages', 'My Back Pages è il titolo di una delle canzoni più conosciute di Bob Dylan. Incisa nel 1964, fa parte dell\'album Another Side of Bob Dylan. Raramente Dylan l\'ha cantata durante i suoi concerti', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/My_Back_Pages', 'https://www.youtube.com/v/h80l4XIPJC4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11240', 'NULL', 'NULL', 'NULL', '1', 'Folk music', '100');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2705', 'Radioactive (Marina and the Diamonds)', 'Radioactive è un brano di Marina and the Diamonds, estratto come primo singolo dal suo secondo album Electra Heart. La cantante afferma di aver scritto questa canzone a New York, durante una giornata estiva afosa. Radioactive descrive l\'euforia e la gioia della cantante nel vivere le notti fresche d\'estate a New York, tra le mille luci colorate. La scrittura di questa canzone segna per la cantante un grande cambiamento nel modo di pensare e di scrivere le canzoni.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Radioactive_(Marina_and_the_Diamonds_song)', 'https://www.youtube.com/v/dU7GoCKSQfg?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Marina and the Diamonds', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11241', 'NULL', 'NULL', 'NULL', '1', 'Synthpop', '101');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2706', 'Surf\'s Up (brano musicale)', 'Surf\'s Up è un brano musicale dei Beach Boys composto da Brian Wilson per la musica e da Van Dyke Parks per il testo. La canzone era stata concepita per essere inserita nell\'abortito album SMiLE, iniziato nel 1966 ma lasciato incompiuto nel 1967. In seguito il brano venne rielaborato ed utilizzato come title track per l\'omonimo album Surf\'s Up dei Beach Boys pubblicato nel 1971, dal quale fu estratto come singolo. La canzone, una malinconica ballata tra le più celebri fra quelle di Wilson e del gruppo, apparve anche come decima traccia del disco Brian Wilson Presents Smile del 2004, e in altre diverse versioni nel cofanetto The Smile Sessions del 2011.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Surf\'s_Up_(song)', 'https://www.youtube.com/v/C6cww1-laf8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beach Boys', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11242', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '102');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2707', 'Another Brick in the Wall', 'Another Brick in the Wall è un brano musicale, suddiviso in part I, part II e part III, contenuto nell\'album The Wall, pubblicato nel 1979 dai Pink Floyd. Le tre parti della canzone, scritte dal bassista e voce del gruppo Roger Waters, hanno simile, se non uguale, tema musicale e struttura lirica, ed ognuna ha toni più forti e rabbiosi di quella che la precede, dalla tristezza della prima parte, al messaggio di protesta della seconda, fino alla rabbia ed alla disperazione della terza.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Another_Brick_in_the_Wall', 'https://www.youtube.com/v/YR5ApYxkU-U?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11243', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '103');
