INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2713', 'Mr. Brownstone', 'Mr. Brownstone è il titolo di un brano musicale del gruppo statunitense Guns N\' Roses, incluso nel suo primo album, Appetite for Destruction. Il testo della canzone è un inno alla vita sregolata e all\'ebbrezza; \"Mr. Brownstone\" si riferisce all\'eroina, droga di cui i membri della band facevano largo uso nei primi tempi. Ci sono inoltre riferimenti all\'ozio e alla spensieratezza, come recita la prima strofa: I get up around seven/ get out of bed around nine/ and I don\'t worry about nothin\' no/ because worry is a waste of my time. Traduzione: Mi sveglio attorno alle sette/ scendo dal letto attorno alle nove/ e non mi preoccupo di niente/ perché le preoccupazioni sono una perdita del mio tempo. L\'esecuzione di questo brano divenne un passaggio fisso delle esibizioni dal vivo dei Guns N\' Roses; durante il loro tour più famoso, lo Use Your Illusion Tour, era in genere la seconda canzone del concerto dopo Nightrain.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Mr._Brownstone', 'https://www.youtube.com/v/KVYDnQwi3OQ?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Guns N\' Roses', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11249', 'NULL', 'NULL', 'NULL', '1', 'Heavy metal music', '109');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2714', 'Stone Free', 'Stone Free è la b-side di Hey Joe, primo singolo di Jimi Hendrix. Inserita anche nell\'LP Are You Experienced?, è un pezzo considerato essenziale per lo sviluppo dell\'hard rock. È stato pubblicato anche su 45 giri sul lato A, con sul lato B If 6 Was 9. Con il titolo Stone Free è stato pubblicato nel 1993 anche un disco-tributo ad Hendrix contenente suoi pezzi eseguiti da altri gruppi ed artisti tra cui Eric Clapton, Living Colour, The Cure e Pretenders.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Stone_Free', 'https://www.youtube.com/v/rXxRnXTxXuQ?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Jimi Hendrix Experience', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11250', 'NULL', 'NULL', 'NULL', '1', 'Electric blues', '110');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2715', 'Sysyphus', '\"Sysyphus\" è una suite strumentale d\'avanguardia in quattro parti scritta dal tastierista Richard Wright della band progressive rock Pink Floyd. La canzone è considerata molto sperimentale e psichedelica, con le parti III e IV che suonano quasi come prive di senso. La canzone è inclusa nella parte studio di Ummagumma (ed è la canzone che apre l\'album in studio). Sysyphus venne suonata solo quattro volte dal vivo nella storia della band. Il pezzo strumentale di Rick Wright è stato chiamato come un personaggio della mitologia greca, più comunemente scritto in inglese \"Sisyphus\" (Mabbett 1995). Differenza ortografica a parte, la canzone è chiaramente un\'interpretazione musicale della Sfida di Sisifo. La descrizione di Wright di Sisifo che spinge una roccia su una collina scoscesa nell\'Ade è evidente nelle parti lente e monotone della canzone. Brevi momenti di calma musicale quando Sisifo raggiunge la cima della collina sono seguite dalle porzioni cacofoniche della canzone in cui Wright usa la dissonanza per mostrare la disperazione di Sisifo quando insegue la roccia sull\'altro lato del colle. La traccia fu raramente suonata dal vivo nel 1970.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Sysyphus', 'https://www.youtube.com/v/Jpo35OqasTk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11251', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '111');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2716', 'Sweet Leaf', 'Sweet Leaf è un brano musicale dei Black Sabbath contenuto nel loro album del 1971 Master of Reality. La canzone, un inno celebrativo alla marijuana, deve il suo titolo a un pacchetto di sigarette acquistato a Dublino dal bassista del gruppo Geezer Butler, che recava sulla confezione la scritta \"the sweet leaf\" (\"la dolce foglia\") riferita al tabacco contenuto. Il brano comincia con un colpo di tosse del chitarrista Tony Iommi ripetuto più volte con un effetto eco.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Sweet_Leaf', 'https://www.youtube.com/v/H3YtvuZ2-I0?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Black Sabbath', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11252', 'NULL', 'NULL', 'NULL', '1', 'Heavy metal music', '112');
