INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2718', 'Feeling Good', 'Feeling Good (noto anche come Feelin\' Good) è un brano composto da Anthony Newley e Leslie Bricusse in occasione del musical del 1965 The Roar of the Greasepaint-the Smell of the Crowd interpretato da Cy Grant, che ha cantato la versione originale della canzone. Da quel momento è stata ricantata da numerosi artisti fra cui Nina Simone, Muse, Adam Lambert, Sammy Davis Jr. , Bobby Darin, Traffic, Michael Bublé, The Pussycat Dolls, George Michael, John Barrowman, My Brightest Diamond, John Coltrane, Toše Proeski, Joe Bonamassa, Frank Sinatra Jr. , Jennifer Hudson, Stephen Williams, Sharon Jones and the Dap Kings, Ed Sheeran e Alice Russell con The Quantic Soul Orchestra, Prince Poppycock, Rebecca Ferguson, Roman Veremeychik, Eels e Ronan Parke.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Feeling_Good', 'https://www.youtube.com/v/Edwsf-8F3sI?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11254', 'NULL', 'NULL', 'NULL', '1', 'NULL', '114');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2719', 'Duran Duran (singolo)', 'Duran Duran è un brano musicale della cantante finlandese Jenni Vartiainen, estratto come quarto singolo dal suo secondo album Seili. Duran Duran è stato pubblicato il 13 dicembre 2010. Il singolo è entrato in classifica alla diciannovesima posizione e ha raggiunto la decima posizione. È stato in classifica per cinque settimane non consecutive.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Duran_Duran_(song)', 'https://www.youtube.com/v/A7Er5TsQrGg?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Jenni Vartiainen', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11255', 'NULL', 'NULL', 'NULL', '1', 'Pop music', '115');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2720', 'Girlfriend (Michael Jackson)', 'Girlfriend è il quinto ed ultimo singolo estratto dall\'album Off the Wall di Michael Jackson nel 1980. Fu inizialmente pubblicato nel Regno Unito, dove arrivò nella top 50 alla posizione #41. È la prima collaborazione tra Jackson e l\'ex Beatle Paul McCartney. Lavorarono successivamente insieme in \"The Girl Is Mine\", dall\'album Thriller, e in due tracce dell\'album di McCartney Pipes of Peace: \"Say Say Say\" e \"The Man\", entrambe del 1983. La loro amicizia finì nel 1985 quando Michael comprò la maggior parte della ATV Music e quindi i diritti di parecchie canzoni dei Beatles. La canzone fu inizialmente inserita nell\'album di Paul McCartney London Town.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Girlfriend_(Wings_song)', 'https://www.youtube.com/v/l6LUPlmua6I?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Wings (band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11256', 'NULL', 'NULL', 'NULL', '1', 'Pop rock', '116');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2721', 'Roman in Moscow', 'Roman in Moscow è un brano musicale della cantante statunitense Nicki Minaj, pubblicato il 2 dicembre 2011 come singolo promozionale estratto dal suo secondo album in uscita a febbraio 2012 intitolato Pink Friday: Roman Reloaded. La canzone, come del resto il nuovo album, è incentrata su Roman Zolanski, l\'alter ego della cantante, che era già stato introdotto nell\'album di debutto Pink Friday, in particolar modo in Roman\'s Revenge. Roman in Moscow è stato scritto da Onika Maraj (Nicki Minaj), Nicholas Warwar, Raymond Diaz e Steve Morales e prodotto da SAROM e da Street Runner.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Roman_in_Moscow', 'https://www.youtube.com/v/OqOa8JOoL8s?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Nicki Minaj', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11257', 'NULL', 'NULL', 'NULL', '1', 'Hardcore hip hop', '117');
