INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2725', 'L\'estasi dell\'oro', 'L\'Estasi dell\'Oro (o The Ecstasy of Gold) è una canzone composta da Ennio Morricone per la colonna sonora del film di Sergio Leone Il buono, il brutto, il cattivo, ricordata in particolare per essere il sottofondo musicale della scena in cui Tuco cerca freneticamente il cimitero con la tomba dove si trovano 200.000 dollari in oro.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_Ecstasy_of_Gold', 'https://www.youtube.com/v/J3IlqY1CbI0?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11261', 'NULL', 'NULL', 'NULL', '1', 'NULL', '121');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2726', 'Not Like the Movies', 'Not Like the Movies è un brano musicale della cantante statunitense Katy Perry, pubblicato il 3 agosto 2010 come singolo promozionale dal suo secondo album Teenage Dream e promosso dall\'etichetta discografica Capitol Records. Il singolo è stato scritto da Katy Perry e Greg Wells e prodotto da quest\'ultimo. È entrato alle posizioni numero 41 e 53 nelle classifiche rispettivamente del Canada e degli Stati Uniti. Not Like the Movies è una ballata teen pop e pop il cui testo parla di una storia d\'amore nella quale una donna non si sente innamorata e continua ad aspettare il suo \"principe azzurro\". È stata scritta quando la cantante ha iniziato ad uscire con il suo attuale marito, Russell Brand. Not Like the Movies ha ricevuto critiche positive dagli esperti, che l\'hanno definita una canzone forte e adorabile, nonché una ballata molto profonda, ma che hanno tuttavia notato nel testo pochissimi riferimenti a suo marito. Katy Perry ha esibito il brano live alla cinquantatreesima edizione dei Grammy Award il 13 febbraio 2011.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Not_Like_the_Movies', 'https://www.youtube.com/v/9ewTkrfaWtA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Katy Perry', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11262', 'NULL', 'NULL', 'NULL', '1', 'Pop music', '122');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2727', 'Not to Touch the Earth', 'Not to Touch the Earth è un singolo dei The Doors, inserito nel loro album Waiting for the Sun. Ha origine da una raccolta di poesie di Jim Morrison intitolata Celebration of the Lizard. Una registrazione completa di quest\'ultima fu tentata alle sessioni per l\'album, ma solo il passaggio musicale Not to Touch the Earth era ritenuto adatto per la pubblicazione. Così la poesia fu pubblicata sulla copertina dell\'album in forma scritta. La raccolta completa di tali poesie fu realizzata solamente nel 2003 sulla compilation Legacy: The Absolute Best. I Deceased hanno pubblicato una loro versione della canzone intitolata Queens of the Stone Age.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Not_to_Touch_the_Earth', 'https://www.youtube.com/v/d_-HqcNum7M?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Doors', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11263', 'NULL', 'NULL', 'NULL', '1', 'Acid rock', '123');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2728', 'Six Degrees of Inner Turbulence (brano musicale)', 'Six Degrees of Inner Turbulence è la title track dell\'omonimo doppio cd del gruppo progressive metal Dream Theater. Tale brano è una suite di 42 minuti, che occupa interamente il secondo cd dell\'album. Il riferimento al numero \"sei\" è accentuato dal fatto che tale canzone sia la sesta traccia del sesto cd del gruppo. Inoltre, anche la copertina dell\'album presenta la struttura muscolare di una mano che presenta sei dita.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Six_Degrees_of_Inner_Turbulence_(song)', 'https://www.youtube.com/v/zOFrlqOi6qw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Dream Theater', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11264', 'NULL', 'NULL', 'NULL', '1', 'Symphonic metal', '124');
