INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2734', 'Upgrade U', 'Upgrade U è un singolo R&B scritto da Beyoncé Knowles, Sean Garrett, Solange Knowles, Angela Beyincé, Shawn \"Jay-Z\" Carter, Mk. Makeba, Willie Clarke e Clarence Reid per il secondo album da solista di Beyoncé, B\'Day. Esso è interpretato in duetto col rapper Jay Z. Si tratta della quarta collaborazione fra questi due artisti dopo \'03 Bonnie & Clyde, Crazy in Love e Deja Vu.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Upgrade_U', 'https://www.youtube.com/v/6nr8hPnZfMU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Beyoncé Knowles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11270', 'NULL', 'NULL', 'NULL', '1', 'Contemporary R&B', '130');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2735', 'Wish You Were Here (brano musicale Pink Floyd)', 'Wish You Were Here è il titolo di una canzone dei Pink Floyd, inserita nell\'omonimo album del 1975. Come la maggior parte delle canzoni dell\'album, è dedicata all’ex membro dei Pink Floyd Syd Barrett, allontanato dal gruppo nel 1968 per via di una grave infermità mentale e fisica causata dal continuo uso di droghe che aveva compromesso la sua partecipazione ai concerti e al lavoro in studio. Il refrain principale è stato ideato da David Gilmour, mentre suonava la sua chitarra acustica negli Abbey Road Studios. Gilmour propose poi il riff a Roger Waters, il quale ne rimase positivamente colpito; successivamente i due collaborarono per completare la canzone. Nel 2004 il brano è stato inserito dal magazine Rolling Stone nell’elenco delle 500 migliori canzoni di tutti i tempi alla posizione #316.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Wish_You_Were_Here_(Pink_Floyd_song)', 'https://www.youtube.com/v/3prl3Nr7BfA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11271', 'NULL', 'NULL', 'NULL', '1', 'Acoustic music', '131');
