INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2746', 'She\'s Leaving Home', 'She\'s Leaving Home è una canzone, scritta da Paul McCartney e John Lennon, pubblicata nel 1967 sull’album dei Beatles Sgt. Pepper\'s Lonely Hearts Club Band. McCartney scrisse e cantò il brano, mentre Lennon scrisse i cori. Questa è una delle rare canzoni in cui i Beatles non suonano nessuno strumento. Le altre sono Eleanor Rigby, Good Night e The Inner Light.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/She\'s_Leaving_Home', 'https://www.youtube.com/v/-lG3nXyI41M?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11282', 'NULL', 'NULL', 'NULL', '1', 'Classical music', '142');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2747', 'The Narrow Way', 'The Narrow Way è una suite musicale dei Pink Floyd, composta dal chitarrista del gruppo David Gilmour per l\'album Ummagumma. In realtà, rispetto alle altre suite presenti sull\'album (\"Sysyphus\" e \"The Grand Vizier\'s Garden Party\"), la composizione di Gilmour presenta una certa soluzione di continuità fra le sue parti, così che in questo caso è forse più corretto parlare di tre brani differenti, anche se essi sono sempre incentrati sulle trame della chitarra. La prima parte è costruita su una variazione in Re minore di arpeggi di chitarra acustica, e deriva da un nucleo che il gruppo aveva già da qualche tempo nel repertorio. Una progressione di chitarra distorta introduce alla seconda parte, più aggressiva della prima e delineata da un riff vorticoso e fortemente psichedelico. La terza parte, l\'unica con la presenza di una voce (quella di Gilmour), parte da una tenue base di organo e chitarra, e genera col cantato di Gilmour un\'atmosfera calda e sognante. Il pezzo era già presente nelle scalette di numerosi concerti dei Pink Floyd prima dell\'incisione del disco, ma il testo, per la cui stesura Gilmour si trovò in difficoltà, è grossomodo originale.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_Narrow_Way', 'https://www.youtube.com/v/jVdPHLdPnS8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11283', 'NULL', 'NULL', 'NULL', '1', 'Progressive_rock', '143');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2748', 'I See You (Theme from Avatar)', 'I See You (Theme from Avatar) è un brano musicale pop interpretato dalla cantante britannica Leona Lewis.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I_See_You_(Theme_from_Avatar)', 'https://www.youtube.com/v/3YDz-ftqr1g?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Leona Lewis', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11284', 'NULL', 'NULL', 'NULL', '1', 'Electronic music', '144');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2749', 'Better Man', 'Better Man (qualche volta scritta come Betterman) è una canzone dei Pearl Jam, scritta da Eddie Vedder quando era ancora al liceo, eseguita dal vivo dalla sua prima band, i Bad Radio. Considerata \"apertamente una grande canzone pop\" dal produttore Brendan O\'Brien, i Pearl Jam erano riluttanti nel registrarla e rifiutarorono di inserirla in Vs. a causa della sua accessibilità. Better Man appare sull\'album Vitalogy. La canzone fu inclusa anche nella tracklist del greatest hits Rearviewmirror: Greatest Hits 1991-2003. Mai pubblicata come singolo (una pratica della band per incoraggiare le vendite dei CD), divenne comunque una delle canzoni dei Pearl Jam più suonate e mandate in onda per le radio. La canzone raggiunse la prima posizione della Mainstream Rock Tracks chart di Billboard, il secondo sulla Modern Rock Tracks chart, e la numero tredici nella Top 40 Mainstream. La canzone rimase per ben otto settimane in cima alla Mainstream Rock Tracks chart. Al tredicesimo ASCAP Awards, Better Man fu citata come una delle canzoni più performate del 1995. Nei concerti dei Pearl Jam, il verso lento di apertura viene cantato spesso sia dal pubblico che da Vedder. La canzone spesso viene proposta in un medley con la canzone \"Save It For Later\" della band Beat. Nell\'ultimo concerto del tour Vote for Change, nel 2004, Vedder apparve sul palco con Bruce Springsteen and the E Street Band e cantò \"Better Man\" su richiesta di Springsteen; numerosi nel pubblico cantarono con lui. La canzone fa parte del cosiddetto \"Man Trio\" suonata occasionalmente nei concerti. Performance dal vivo di \"Better Man\" possono essere trovate su Live on Two Legs e Live at the Gorge 05/06. Disponibile anche sui DVD Touring Band 2000, Live at the Showbox e Live at the Garden, è inclusa anche in Immagine in cornice.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Better_Man', 'https://www.youtube.com/v/lWzLgWWu5wU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pearl Jam', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11285', 'NULL', 'NULL', 'NULL', '1', 'Alternative rock', '145');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2750', 'And I Love Her', 'And I Love Her è un brano dei Beatles, scritto da Paul McCartney per la compagna di allora, Jane Asher. È la quinta canzone dell\'album A Hard Day\'s Night, del 1964.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/And_I_Love_Her', 'https://www.youtube.com/v/96YQdiMV-Jc?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11286', 'NULL', 'NULL', 'NULL', '1', 'Pop music', '146');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2751', 'Red House', 'Red House è una canzone della versione inglese del primo album di Jimi Hendrix del 1967, Are You Experienced. In questa canzone si sentono le forti influenze blues di Jimi Hendrix. Nella versione americana del disco la traccia non compare, poiché la casa discografica di Jimi Hendrix, la MCA Records disse \"all\'America non piace il blues\" e non lo stampò nell\'edizione americana del disco. La canzone è un blues elettrico in 12/8 ed è la canzone più vicina al blues dell\'intero album. Jimi Hendrix nella versione live la allungava fino a 6 o a 10 minuti. Durante la sua esibizione al Festival di Woodstock, Jimi Hendrix strappò la corda del Mi cantino mentre suonava la canzone, e suonò il resto della canzone con cinque corde. I chitarristi blues Buddy Guy e John Lee Hooker hanno realizzato una cover della canzone. La canzone è stata reinterpretata nei live da numerosi artisti della scena blues e rock internazionale.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Red_House_(song)', 'https://www.youtube.com/v/F_rRJIAQapg?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Jimi Hendrix Experience', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11287', 'NULL', 'NULL', 'NULL', '1', 'Blues', '147');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2752', 'London\'s Burning', 'London\'s Burning è un brano musicale della band punk rock dei Clash. Appare per la prima volta nella versione inglese dell\'album di debutto della band, The Clash. Il testo si focalizza sul problema del traffico inglese, per il quale molti automobilisti erano costretti a restare in macchina fino a tarda sera, annoiandosi per ore lontano da casa. Questo \"messaggio\" è stato espresso nei seguenti versi: «I\'m up and down the Westway, in an\'out the lights / What a great traffic system... it\'s so bright / I can\'t think of a better way to spend the night / Then speeding around underneath the / Yellow lights» (trad. : «Vado su e giù per la tangenziale, alla luce ed all\'ombra dei lampioni / Che gran rete stradale... così luminosa / Non mi viene in mente un modo migliore per passare la notte / Che viaggiare a tutta velocità sotto le luci gialle». La canzone è stata inserita in: The Clash, The Story of the Clash, Volume 1, Clash on Broadway, Singles Box, The Essential Clash e From Here to Eternity: Live .', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/London\'s_Burning_(song)', 'https://www.youtube.com/v/NUu3xISTGVc?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Clash', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11288', 'NULL', 'NULL', 'NULL', '1', 'Punk rock', '148');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2753', 'Telegraph Road', 'Telegraph Road è il titolo di un brano musicale dei Dire Straits, composto da Mark Knopfler e contenuto nell\'album Love over Gold del 1982. Pur non avendo goduto di una grande diffusione (anche a causa della sua durata di ben 14 minuti e 21 secondi), Telegraph Road è una delle canzoni più apprezzate della band britannica ed è considerata un capolavoro della musica rock. La versione dal vivo inserita nell\'album Alchemy: Dire Straits Live è ritenuta una delle prestazioni più brillanti della band in concerto.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Telegraph_Road_(song)', 'https://www.youtube.com/v/dd3btVhwr48?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Dire Straits', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11289', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '149');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2754', 'Safe & Sound', 'Safe & Sound è una canzone della cantante statunitense country pop Taylor Swift in collaborazione con il duo folk statunitense The Civil Wars, pubblicata il 23 dicembre 2011 come singolo promozionale per la colonna sonora del film Hunger Games, in uscita a marzo 2012. Il brano è stato scritto dalla stessa Taylor Swift con Joy Williams e John Paul Whitee e prodotto da T-Bone Burnett. Il singolo è entrato alla diciannovesima posizione della classifica digitale statunitense vendendo 136.000 copie digitali in due soli giorni. Ciò gli ha favorito di entrare alla trentesima posizione della Billboard Hot 100. In Canada è invece entrato alla trentacinquesima posizione ed è salito alla trentatreesima la settimana successiva.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Safe_&_Sound_(song)', 'https://www.youtube.com/v/RzhAS_GnJIc?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Taylor Swift', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11290', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '150');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2755', 'For Good', '\"For Good\" (per sempre) è una canzone del musical Wicked di Stephen Schwartz. Fu interpretata originariamente a Broadway da Idina Menzel, nel ruolo di Elphaba, e da Kristin Chenoweth, nel ruolo di Glinda. Altre versioni particolarmente apprezzate sono quelle di Rachel Tucker e Louise Dearman e Eden Espinosa e Kendra Kassebaum. One Short Day Artista Stephen Schwartz Autore/i Stephen Schwartz (musiche) Winnie Holzman (testi) Genere Musical Stile pop Edito da Decca Records Tempo Riferimento Esecuzioni notevoli Pubblicazione Incisione Wicked Data 2003 Data seconda pubblicazione Etichetta Durata 5min : 10 sec Note Campione audio Wicked – tracce Precedente Successiva March of the Witch Hunters Finale', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/For_Good', 'https://www.youtube.com/v/baulzQ_edgE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11291', 'NULL', 'NULL', 'NULL', '1', 'Show_tune', '151');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2756', 'Hot Revolver', 'Hot Revolver è un brano musicale di Lil Wayne, pubblicato come secondo singolo ufficiale facente parte dell\'album Rebirth, ancora in fase di produzione. Il brano è stato composto da Wayne in collaborazione con Kevin Rudolf.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Hot_Revolver', 'https://www.youtube.com/v/T_O_wUjMWmE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Lil Wayne', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11292', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '152');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2757', 'The End (The Doors)', 'The End è una canzone del gruppo americano The Doors. La canzone nacque e si sviluppò per alcuni mesi grazie a una serie di esibizioni al Whisky a Go Go di Los Angeles nel 1966. In seguito venne registrata nell\'Agosto del 1966 e pubblicata come canzone nell\'album di debutto The Doors il 4 gennaio del 1967.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_End_(The_Doors_song)', 'https://www.youtube.com/v/aGmAmJFUvzM?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Doors', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11293', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '153');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2758', 'Stop the Clocks (brano musicale)', 'Stop the Clocks è una canzone del gruppo musicale britannico Oasis, scritta da Noel Gallagher nel 2001 e mai pubblicata su album o come singolo sino al 2011, quando è stata inclusa nel disco eponimo dei Noel Gallagher\'s High Flying Birds. Originariamente doveva far parte dell\'album Don\'t Believe the Truth del 2005 e fu per questo motivo incisa nel 2004, ma poi fu esclusa sia dal disco che dalla raccolta di successi omonima Stop the Clocks del 2006. Ciononostante gode ugualmente di popolarità e la sua pubblicazione è stata a lungo attesa dai fan, anche perché la canzone è stata citata ripetutamente da Noel durante il tour di Heathen Chemistry nel 2002-2003. Il 6 maggio 2008 comparvero su Internet una versione in studio della canzone, tratta dalle sessioni di registrazione di Don\'t Believe The Truth, e una versione live del brano eseguita nel maggio 2003.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Stop_the_Clocks_(song)', 'https://www.youtube.com/v/4gUXZFzI4SU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Noel Gallagher\'s High Flying Birds', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11294', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '154');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2759', 'You\'ve Got a Friend', 'You\'ve Got a Friend è un brano musicale di Carole King, incluso nell\'album del 1971 Tapestry. Una cover del brano è stata pubblicata come singolo nello stesso anno da James Taylor e inserita in Mud Slide Slim and the Blue Horizon; questa versione ha raggiunto la prima posizione della Billboard Hot 100 e il quarto posto nella UK Singles Chart. You\'ve Got a Friend ha vinto un Grammy Award sia con King, sia con Taylor. Sempre nel 1971, la canzone venne registrata da Dusty Springfield, tuttavia, per un contenzioso con la Atlantic Records, il disco che la include risulta inedito. La Rhino Records ha inserito questa versione come bonus track dell\'edizione deluxe in Dusty in Memphis. Un\'altra cover in versione soul-gospel è stato registrata da Donny Hathaway per l\'album del 1972 Live. Barry Manilow ha eseguito il brano insieme a Melissa Manchester per il suo album Duets. Numerose sono le cover del brano interpretate da altri artisti.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/You\'ve_Got_a_Friend', 'https://www.youtube.com/v/rJPgxEi2BM8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Carole King', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11295', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '155');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2760', 'Signs of Life (Pink Floyd)', 'Signs of Life è un brano musicale della progressive rock band inglese Pink Floyd, contenuto nell\'album A Momentary Lapse of Reason e scritto da David Gilmour e Bob Ezrin.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Signs_of_Life_(instrumental)', 'https://www.youtube.com/v/r_HqqL43TD0?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11296', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '156');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2761', 'I\'ve Just Begun (Having My Fun)', 'I\'ve Just Begun (Having My Fun) è una canzone della cantante americana Britney Spears contenuta nel suo primo greatest hits, Greatest Hits: My Prerogative. La canzone è stata co-prodotta dai Bloodshy & Avant e originalmente registrata per il suo quarto album, In the Zone. È stata resa disponibile per il download digitale il 17 agosto 2004, prima della pubblicazione del greatest hits. La canzone ha un sound electro-funk che la può paragonare al singolo dei No Doubt, Hella Good, così come alle band americane funky del 1970. I\'ve Just Begun (Having My Fun) ha ricevuto recensioni miste dalla critica, alcune la indicano come la miglior canzone della compilation mentre altre scartano il significato del testo. La canzone è stata inclusa inoltre nella colonna sonora del film \"Le Amiche Della Sposa\"', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I\'ve_Just_Begun_(Having_My_Fun)', 'https://www.youtube.com/v/NqExbp_1sUo?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Britney Spears', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11297', 'NULL', 'NULL', 'NULL', '1', 'Electro (music)', '157');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2762', 'Let\'s Go Away for Awhile', 'Let\'s Go Away for Awhile (\"Andiamocene via per un po\'\") è una traccia strumentale presente sull\'album Pet Sounds del gruppo musicale statunitense The Beach Boys, pubblicato dalla Capitol Records nel maggio 1966. È la sesta traccia dell\'album. Sempre nel 1966, il brano venne anche pubblicato su singolo negli Stati Uniti come B-side di Good Vibrations.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Let\'s_Go_Away_for_Awhile', 'https://www.youtube.com/v/BbAA4_B8k0I?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beach Boys', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11298', 'NULL', 'NULL', 'NULL', '1', 'Instrumental rock', '158');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2763', 'All I Really Want to Do', 'All I Really Want to Do è il titolo di una canzone di genere pop-folk scritta e incisa nel 1964 da Bob Dylan per la columbia Records. Lo stesso Dylan l\'ha interpretata diverse volte anche in concerto, specialmente nel tour del 1965. Brano di apertura dell\'album Another Side of Bob Dylan, è stato ripresa l\'anno seguente in numerose cover fra cui quella contenuta nell\'album omonimo di Cher, All I Really Want to Do, e quella del gruppo musicale californiano The Byrds, incisa prima come singolo e poi inserita nell\'album che conteneva anche la versione rock di Mr Tambourine Man, dello stesso Dylan.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/All_I_Really_Want_to_Do', 'https://www.youtube.com/v/HQdCwkp_0R0?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11299', 'NULL', 'NULL', 'NULL', '1', 'Folk music', '159');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2764', 'Corduroy', 'Corduroy è l\'ottava traccia di Vitalogy, album dei Pearl Jam del 1994. Nonostante non fosse stata pubblicata come singolo, la canzone raggiunse il tredicesimo posto della Billboard Modern Rock Tracks chart. Fu inclusa nella tracklist del greatest hits Rearviewmirror: Greatest Hits 1991-2003. Corduroy comincia con un potente riff suonato come un arpeggio di cui le prime due note sono di un power chord. La canzone decolla, procedendo con una struttura strofa-ritornello-strofa-ritornello-ponte-ritornello-strofa. Sebbene non rivoluzionaria, la struttura della canzone non è completamente normale, infatti quasi nessun verso è ripetuto (anche nel ritornello) e la dissolvenza della canzone comincia dopo una strofa, piuttosto che una tradizionale fine della canzone dopo il terzo ritornello. La canzone è divenuta una delle più eseguite dal vivo, sebbene viene proposta con un ritmo più veloce. Alcune performance sono precedute da una breve improvvisazione sulla canzone dei Pink Floyd \"Interstellar Overdrive\". Performance dal vivo di Corduroy sono disponibili su Live on Two Legs e Live at the Gorge 05/06. Disponibile anche su due DVD della band, Touring Band 2000 e Live at the Showbox, oltre che nel DVD Immagine in cornice, uscito nel 2007.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Corduroy_(song)', 'https://www.youtube.com/v/S73ypK3As8I?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pearl Jam', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11300', 'NULL', 'NULL', 'NULL', '1', 'Grunge', '160');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2765', 'Breathe (Pink Floyd)', 'Breathe è un brano del gruppo britannico dei Pink Floyd, facente parte dell’album The Dark Side of the Moon. Nell’edizione di The Dark Side of the Moon diffusa nel 1992 su Compact Disc il brano è indicato come Breathe in the Air.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Breathe_(Pink_Floyd_song)', 'https://www.youtube.com/v/mrojrDCI02k?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11301', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '161');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2766', 'Set the Controls for the Heart of the Sun', 'Set the Controls for the Heart of the Sun è una canzone della progressive rock band Pink Floyd, tratta dall\'album A Saucerful of Secrets, uscito nel 1968, ultimo album con i Floyd per Syd Barrett e primo album con la chitarra di David Gilmour. Scritta da Roger Waters, è stata regolarmente suonata nei concerti tra il 1967 e il 1973, e nei tour solisti di Waters dal 1984 in poi. Appare anche nell\'album Ummagumma nel film concerto Live at Pompeii e infine nella raccolta Echoes: The Best of Pink Floyd del 2001. È l\'unico pezzo suonato da tutti i cinque componenti della band inglese.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Set_the_Controls_for_the_Heart_of_the_Sun', 'https://www.youtube.com/v/8RbXIMZmVv8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11302', 'NULL', 'NULL', 'NULL', '1', 'Avant-garde music', '162');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2767', 'Third Stone from the Sun', 'Third Stone from the Sun è un brano musicale del primo album di Jimi Hendrix del 1967 Are You Experienced. È uno dei primi esempi di fusione di diversi generi musicali, in questo caso di rock e jazz, ed è stato soggetto di cover da parte di numerosi artisti come Pat Metheny, Weather Report, Stevie Ray Vaughan, Yew, Dick Dale ed Eric Burdon. Il titolo Third Stone from the Sun, che in italiano si traduce con La terza pietra dal sole, si riferisce alla Terra, terzo pianeta del sistema solare.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Third_Stone_from_the_Sun', 'https://www.youtube.com/v/GoMITlO-USI?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Jimi Hendrix Experience', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11303', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '163');
