INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2775', 'Roman\'s Revenge', 'Roman\'s Revenge è un brano musicale della cantante statunitense Nicki Minaj, estratto come singolo promozionale dal suo album di debutto, Pink Friday. Il brano è un duetto con il rapper Eminem ed è stato scritto da Kaseem Dean, Marshall Mathers, T. Smith e Onika Maraj e prodotto da Swizz Beatz. È stato pubblicato su iTunes il 30 ottobre 2010. Il 19 gennaio 2011 è stata pubblicata una versione di Roman\'s Revenge con Lil Wayne. L\'8 febbraio dello stesso anno, la versione è stata inviata alle stazioni radiofoniche statunitensi.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Roman\'s_Revenge', 'https://www.youtube.com/v/K9h_I90M8-M?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Nicki Minaj', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11311', 'NULL', 'NULL', 'NULL', '1', 'Hardcore hip hop', '171');
