INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2777', 'Beautiful, Dirty, Rich', 'Beautiful, Dirty, Rich è un brano musicale della cantautrice statunitense Lady Gaga, registrato nel 2006, prima della fama mondiale. È stato pubblicato come singolo promozionale dal suo album di debutto, The Fame, il 16 settembre 2008. Nel brano, Lady Gaga racconta le esperienze vissute nel quartiere Lower East Side di New York, poco prima del suo debutto nel panorama musicale mondiale. In tono ironico e contenuto, la cantante denuncia la situazione di povertà del quartiere, in contrasto con la spensieratezza dei residenti che amano divertirsi e vestirsi secondo la moda. Il singolo ha riscontrato un minore successo commerciale classificandosi alla posizione #83 della UK Singles Chart, ma in compenso ha ricevuto buone critiche per la parte tecnica del brano e per il forte timbro vocale.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Beautiful,_Dirty,_Rich', 'https://www.youtube.com/v/7Nr33m1zXVE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11313', 'NULL', 'NULL', 'NULL', '1', 'Dance-pop', '173');
