INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2781', 'I Turn to You (Christina Aguilera)', 'I Turn to You è una canzone pop/R&B scritta da Diane Warren nel 1996. La versione originale del brano è stato registrato dal quartetto All-4-one per la colonna sonora dell\'album del film della Warner Bros, Space Jam. Tre anni più tardi, la cantante pop statunitense Christina Aguilera ha registrato una cover, prodotta da Guy Roche, per il suo album di debutto, Christina Aguilera. La sua versione è stata pubblicata come singolo il 8 maggio 2000 dall\'etichetta discografica RCA. La canzone è stata incisa dalla Aguilera anche in lingua spagnola con il titolo Por siempre tu.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I_Turn_to_You_(All-4-One_song)', 'https://www.youtube.com/v/z4q05resEvc?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'All-4-One', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11317', 'NULL', 'NULL', 'NULL', '1', 'Soul music', '177');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2782', 'Tombstone Blues', 'Tombstone Blues (lett. \"il blues della pietra tombale\") è una canzone scritta da Bob Dylan e contenuta nel suo acclamato album del \'65 intitolato Highway 61 Revisited. Musicalmente si tratta di un brano di blues rock piuttosto canonico, ma con un testo pieno zeppo di immagini surreali tipiche del Dylan del periodo, con frasi come: «the sun\'s not yellow, it\'s chicken» .', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Tombstone_Blues', 'https://www.youtube.com/v/j-z-WCGDXlk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11318', 'NULL', 'NULL', 'NULL', '1', 'Blues rock', '178');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2783', 'Dancing Through Life', '\"Dancing Through Life\" (Danzando nella vita) è una canzone del musical Wicked di Stephen Schwartz. Fu interpretata originariamente a Broadway da Norbert Leo Butz nel ruolo di Fiyero, Kristin Chenoweth, Idina Menzel, Carole Shelley, Michelle Federer (Nessa) e Christopher Fitzgerald insieme a tutto il resto dell\'ensemble degli studenti. Dancing Through Life Artista Stephen Schwartz Autore/i Stephen Schwartz (musiche) Winnie Holzman (testi) Genere Musical Stile pop Edito da Decca Records Tempo Riferimento Esecuzioni notevoli Pubblicazione Incisione Wicked Data 2003 Data seconda pubblicazione Etichetta Durata 7min : 38 sec Note Campione audio Wicked – tracce Precedente Successiva Something Bad Popular', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Dancing_Through_Life', 'https://www.youtube.com/v/of03sHr0O5I?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Kristin Chenoweth', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11319', 'NULL', 'NULL', 'NULL', '1', 'Showtunes', '179');
