INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2786', 'Fresh Out The Oven', 'Fresh Out The Oven è un brano registrato dalla cantante e attrice Jennifer Lopez, con il rapper americano Pitbull. La canzone è stata registrata per il settimo album di studio della Lopez, Love?. Il singolo venne messo online nel mese di ottobre 2009 dalla Epic Records. Non è mai stato ufficialmente rilasciato per l\'acquisto, anche se un video è stato registrato da Jonas Akerlund e rilasciato per promuovere la canzone nei principali siti web: Facebook, Myspace, Twitter e Youtube tutti dal titolo \"Who is Lola?\". La canzone è riuscita a raggiungere il numero uno della Hot Dance Club Songs.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Fresh_Out_the_Oven', 'https://www.youtube.com/v/86F5PKwvs4A?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Jennifer Lopez', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11322', 'NULL', 'NULL', 'NULL', '1', 'Rhythm and blues', '182');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2787', 'Jillian (I\'d Give My Heart)', 'Jillian (I\'d Give My Heart) è una canzone della symphonic metal band olandese Within Temptation. Più precisamente è la traccia n. 3 del terzo album della band, The Silent Force. Nel 2005 il brano è stato rilasciato sottoforma di promo-single per promuovere il DVD The Silent Force Tour, pubblicato nello stesso anno.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Jillian_(I\'d_Give_My_Heart)', 'https://www.youtube.com/v/F8gfloMvim4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Within Temptation', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11323', 'NULL', 'NULL', 'NULL', '1', 'Symphonic metal', '183');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2788', 'Hey You (Pink Floyd)', 'Hey You è una canzone della band inglese Pink Floyd, pubblicata nel 1979. Fa parte del doppio album The Wall ed è la canzone che apre il secondo disco. Non fu inserita nel film Pink Floyd The Wall per ragioni di spazio, ma una versione abbozzata del video è inclusa negli extra del DVD pubblicato in occasione del 25º anniversario dall’uscita dell’album. Benché non abbia trovato spazio nel film, è una delle più famose canzoni della band.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Hey_You_(Pink_Floyd_song)', 'https://www.youtube.com/v/ndYEdGd8Gs4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11324', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '184');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2789', '(What Is) Love?', '(What Is) Love? è un brano musicale della cantante e attrice americana Jennifer Lopez, estratto come singolo promozionale dal suo settimo album di inediti, Love?. Questo brano è stato usato come la colonna sonora del Piacere, sono un po\' incinta del 2010, di cui è protagonista la stessa Lopez. Il brano è stato scritto da Diana Gordon ed Emile Dernst II e prodotto da D\'Mile. È stato pubblicato su iTunes il 25 aprile 2011 ed è entrato in classifica in Spagna alla trentatreesima posizione, dove è rimasto per una sola settimana. Il brano è stato presentato in anteprima in Italia al Festival di Sanremo 2010. La gestazione del brano è stata molto lunga: una versione incompleta, dal titolo What Is Love, è approdata in rete nel mese di maggio 2009. Gordon ha comunicato il proprio dissenso per la circolazione della demo in un post del suo MySpace.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/(What_Is)_Love%3F', 'https://www.youtube.com/v/Ktbhw0v186Q?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Jennifer Lopez', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11325', 'NULL', 'NULL', 'NULL', '1', 'Dance-pop', '185');
