INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2797', 'Strangers in the Night', 'Strangers in the Night è una celebre canzone, scritta da Bert Kaempfert per la musica e da Charles Singleton ed Eddie Snyder per il testo. Venne incisa per la prima volta nel 1966 dal cantante statunitense Frank Sinatra, che ne ha fatto uno dei suoi tanti cavalli di battaglia.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Strangers_in_the_Night', 'https://www.youtube.com/v/hlSbSKNk9f0?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Frank Sinatra', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11333', 'NULL', 'NULL', 'NULL', '1', 'Traditional pop music', '193');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2798', 'Mr. Tambourine Man', 'Mr. Tambourine Man è una canzone folk scritta da Bob Dylan nel 1965 e inclusa nel suo quinto album Bringing It All Back Home. È considerato uno dei brani fondamentali della musica rock degli anni sessanta. Nello stesso anno in cui fu pubblicata, la canzone fu portata al successo, in una originale versione a tempo di folk-rock, dal gruppo dei Byrds che, dopo la distribuzione in singolo a 45 giri, la inserirono nel loro primo long playing, integrato con altri motivi dello stesso Dylan (All I Really Want To Do, Spanish Harlem Incident e Chimes Of Freedom). La canzone decretò, al contempo, il successo presso il grande pubblico tanto per Bob Dylan quanto per il gruppo californiano che, per l\'incisione della propria versione del brano, si sarebbe peraltro avvalso non degli elementi della formazione originaria al completo ma di un gruppo di sessionman professionalmente collaudati - fra cui Leon Russell e Hal Blaine - e ritenuti più affidabili sul piano puramente tecnico.. Il motivo figura nella lista delle 500 migliori canzoni secondo Rolling Stone e, nella versione contenuta nell\'album dei Byrds, in quella dei 500 migliori album, sempre secondo la rivista Rolling Stone.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Mr._Tambourine_Man', 'https://www.youtube.com/v/KE_hDWMftgc?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11334', 'NULL', 'NULL', 'NULL', '1', 'Folk music', '194');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2799', 'White Light/White Heat (brano musicale)', 'White Light/White Heat (\"Bianca luce, bianco calore\") è una canzone del gruppo rock statunitense The Velvet Underground, la title track dell\'omonimo secondo album della band, pubblicato nel 1968. Si tratta di un rock frenetico e veloce, una partenza relativamente aggressiva per il disco, simile al successivo genere punk rock che il brano influenzerà non poco. White Light/White Heat è stata pubblicata anche come singolo sempre nel 1968 (B-side Here She Comes Now).', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/White_Light/White_Heat_(song)', 'https://www.youtube.com/v/NQfyhKcL-nQ?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Velvet Underground', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11335', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '195');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2800', 'Isn\'t She Lovely', 'Isn\'t She Lovely è una canzone scritta, ed originariamente interpretata da Stevie Wonder, per il suo album del 1976 Songs in the Key of Life. Nel brano Wonder, celebra la nascita di sua figlia Aisha. La canzone inizia con un campionamento del pianto della bambina.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Isn\'t_She_Lovely%3F', 'https://www.youtube.com/v/IVvkjuEAwgU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Stevie Wonder', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11336', 'NULL', 'NULL', 'NULL', '1', 'Rhythm and blues', '196');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2801', 'Rosalita (Come Out Tonight)', 'Rosalita (Come Out Tonight) è un brano musicale dell\'artista statunitense Bruce Springsteen, pubblicato nel 1973 dalla Columbia Records all\'interno dell\'album The Wild, the Innocent & the E Street Shuffle. Diventò uno dei brani di maggior successo di Springsteen, pur non essendo stata pubblicata come singolo negli Stati Uniti. (È stata però pubblicata come singolo nei Paesi Bassi) Nel 1986 è stata inseria inserito nel primo album live del cantante, Live/1975-85, inserito 1995, nel 2003 in The Essential Bruce Springsteen e nel 2009 nella raccolta Bruce Springsteen & The E Street Band Greatest Hits.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Rosalita_(Come_Out_Tonight)', 'https://www.youtube.com/v/XXWVSussrt0?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bruce Springsteen', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11337', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '197');
