INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2803', 'Funeral for a Friend/Love Lies Bleeding', 'Funeral for a Friend/Love Lies Bleeding è una suite progressive composta ed interpretata dall\'artista britannico Elton John; il testo di Love Lies Bleeding è di Bernie Taupin.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Funeral_for_a_Friend/Love_Lies_Bleeding', 'https://www.youtube.com/v/3p_xAToFzck?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Elton John', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11339', 'NULL', 'NULL', 'NULL', '1', 'Instrumental rock', '199');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2804', 'Children of the Grave', 'Children of the Grave (in italiano Figli della Tomba) è una famosa canzone del gruppo heavy metal britannico Black Sabbath, pubblicata per la prima volta nel 1971 nell\'album Master of Reality. È inoltre apparsa nell\'omonimo split album con gli Status Quo pubblicato nel 1973 dalla Vertigo Records.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Children_of_the_Grave', 'https://www.youtube.com/v/9rihpED_obk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Black Sabbath', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11340', 'NULL', 'NULL', 'NULL', '1', 'Heavy metal music', '200');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2805', 'Electric Funeral', 'Electric Funeral è una canzone heavy metal del gruppo britannico Black Sabbath, contenuta nell\'album Paranoid pubblicato nel 1970. </br> Il testo racconta di una guerra nucleare e delle sue conseguenze ed è quindi tematicamente molto vicino a \"War Pigs\", rispetto alla quale risulta essere però più oscura a livello di liriche. La canzone non è stata mai suonata dal vivo prima del 1977, dopo di che non fu più eseguita fino al Reunion Tour. Della canzone sono state fatte delle reinterpretazioni dai Pantera, dai Soulfly, dagli Iced Earth, dai Brutality (nell\'album When the Sky Turns Black) e dagli Eternal (in seguito diventati Electric Wizard) sull\'EP Lucifer\'s Children. La canzone è anche inclusa nel \"Black Sabbath Medley\" contenuto nell\'album Ancient Dreams dei Candlemass. Alla canzone fanno riferimento Beavis and Butt-head in molti degli episodi della serie animata.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Electric_Funeral', 'https://www.youtube.com/v/tsLkL8DTHeg?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Black Sabbath', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11341', 'NULL', 'NULL', 'NULL', '1', 'Heavy metal music', '201');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2806', 'Play the Guitar', 'Play the Guitar è un brano musicale del cantante statunitense hip hop B.o. B, registrato in in collaborazione con il rapper André 3000 e prodotto da Salaam Remi. Il brano, estratto come singolo dall\'album Strange Clouds il 27 dicembre 2011 utilizza un campionamento di Bo Diddley e di Fancy di Drake, Swizz Beatz e T.I..', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Play_the_Guitar', 'https://www.youtube.com/v/gSedE5sU3uc?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'B.o.B', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11342', 'NULL', 'NULL', 'NULL', '1', 'Rap rock', '202');
