INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2808', 'Next to You', 'Next to You è il primo singolo estratto dal Greatest Hits del 2005 della band punk Offspring, presente come traccia fantasma. Si tratta di una cover della canzone omonima dei Police, presente nel loro primo album. Ha raggiunto la posizione #29 nella classifica Billboard Mainstream Rock Tracks. È stata descritta come l\'unica canzone punk dei Police.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Next_to_You_(The_Police_song)', 'https://www.youtube.com/v/EEuQU6a90Pc?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Police', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11344', 'NULL', 'NULL', 'NULL', '1', 'Post-punk', '204');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2809', 'I\'m Not That Girl', 'I\'m not that Girl (non sono quella ragazza) è una canzone del musical Wicked di Stephen Schwartz. Fu interpretata originariamente a Broadway da Idina Menzel nel ruolo di Elphaba. Altre versioni particolarmente apprezzate sono quelle di Nikki Davis-Jones ed Eden Espinosa', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I\'m_Not_that_Girl_(song)', 'https://www.youtube.com/v/IlV7RhT6zHs?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Idina Menzel', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11345', 'NULL', 'NULL', 'NULL', '1', 'Show tune', '205');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2810', 'Thank You for the Music', 'Thank You for the Music è il venticinquesimo ed ultimo singolo inglese degli ABBA, pubblicato nel novembre 1983 per promuovere il greatest hits della Epic Records Thank You for the Music - A Collection of Love Songs. La canzone Our Last Summer, estratta da Super Trouper fu scelta come lato B del singolo. Thank You for the Music era stata registrata sei anni prima, nel 1977 ed era stata inserita nell\'album The Album. Era stata già pubblicata nel 1978 come lato B di Eagle, che aveva però avuto distribuzione soltanto in Belgio, Germania, Francia, Austria, Svizzera ed Australia. Thank You for the Music è stata inserita anche nella colonna sonora di ABBA spettacolo.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Thank_You_for_the_Music', 'https://www.youtube.com/v/0dcbw4IEY5w?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'ABBA', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11346', 'NULL', 'NULL', 'NULL', '1', 'Europop', '206');
