INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2812', 'Wearing the Inside Out', 'Wearing the Inside Out è una canzone dei Pink Floyd del 1994, presente nell\'album The Division Bell. È la prima canzone del gruppo da Time in cui Richard Wright è il cantante solista, e l\'ultima in cui è il solista su un album dei PInk Floyd. Questa canzone non fu mai eseguita dal vivo dei Pink Floyd, anche se è stata effettuata nel 2006 da David Gilmour nel suo On An Island tour; appare anche sul DVD Remember That Night e sul CD bonus della versione Deluxe di Live in Gda?sk.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Wearing_the_Inside_Out', 'https://www.youtube.com/v/B201O63uqhk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11348', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '208');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2813', 'Change (Taylor Swift)', 'Change è una canzone della cantante statunitense country pop Taylor Swift, pubblicata come singolo promozionale prima della pubblicazione del suo secondo album Fearless. Il singolo è stato pubblicato l\'8 agosto 2008 dall\'etichetta discografica Big Machine Records. Il singolo è inizialmente entrato alla centoventitreesima posizione della classifica americana, per poi salire alla decima grazie alle vendite digitali. Ha inoltre ricevuto un discreto airplay radiofonico, raggiungendo la ventunesima posizione della classifica delle canzoni pop e la cinquantasettesima di quella delle canzoni country. La National Broadcasting Company ha pubblicato un video musicale della canzone sul suo sito. Include scene di Taylor che canta la canzone alle olimpiadi americane. È stato pubblicato su iTunes il 25 novembre 2008.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Change_(Taylor_Swift_song)', 'https://www.youtube.com/v/B1jYllE0T-k?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Taylor Swift', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11349', 'NULL', 'NULL', 'NULL', '1', 'Pop rock', '209');
