INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2817', 'Rearviewmirror (brano musicale)', 'Rearviewmirror è il titolo della traccia 8 del secondo disco dei Pearl Jam, Vs.. Sebbene questa non fu mai rilasciata come singolo, la canzone risulta molto apprezzata dai fan (simile al caso di Yellow Ledbetter, b-side di Jeremy, che è divenuta una delle canzoni più famose della band), ed è, inoltre, la title-track del greatest hits della band Rearviewmirror: Greatest Hits 1991-2003. Questa è anche una delle prime canzoni nella quale il cantante Eddie Vedder suona la chitarra ritmica, portando a tre il numero delle chitarre suonanti (come da questo momento in poi accadrà ancora più spesso nelle produzioni successivi). Nell\'aprile 1994 la band performò la Rearviewmirror al Saturday Night Live per promuovere l\'album. Al termine della versione in studio della canzone, si può sentire il batterista Dave Abbruzzese gettare le sue bacchette contro il muro per frustrazione. Questo è una risposta alle pressioni subite da Brendan O\'Brien durante la registrazione della canzone.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Rearviewmirror', 'https://www.youtube.com/v/O4_5o0OLPDY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pearl Jam', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11353', 'NULL', 'NULL', 'NULL', '1', 'Grunge', '213');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2818', 'Gypsy Eyes', 'Gypsy Eyes è una canzone della band rock The Jimi Hendrix Experience inserita nel loro terzo album Electric Ladyland. Pubblicata come singolo dal doppio lato A in accoppiata con Remember, il brano raggiunse la posizione numero 35 nelle classifiche britanniche.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Gypsy_Eyes', 'https://www.youtube.com/v/3t_aS9JTeD8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11354', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic_rock', '214');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2819', 'Machine Messiah', 'Machine Messiah è un brano del gruppo musicale inglese di rock progressivoYes, uscito nel 1980 e contenuto nell\'album Drama. Scritta principalmente da Trevor Horn e Geoff Downes, ha avuto contributi dagli altri membri Chris Squire, Steve Howe e Alan White, e nei crediti dell\'album compare a nome della band. Il brano è la risposta della band ai fan che volevano la pubblicazione di brani lunghi che caratterizzano il primo periodo del gruppo, e con i suoi 10 minuti e 27 secondi è la traccia più lunga dell\'album.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Machine_Messiah', 'https://www.youtube.com/v/kHFbzaf8FX8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Yes (band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11355', 'NULL', 'NULL', 'NULL', '1', 'Hard rock', '215');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2820', 'I Got Id', 'I Got Id è una canzone dei Pearl Jam, contenuta nell\'EP Merkin Ball, in qualità di A-side e realizzato in collaborazione con Neil Young. Conosciuta anche come I Got Shit, la canzone è contenuta anche in Rearviewmirror: Greatest Hits 1991-2003. La canzone fu realizzata durante le session di Neil Young e dei Pearl Jam per la registrazione di Mirror Ball, album del 1995 del rocker canadese. Solo due membri della band appaiono su questa canzone: Eddie Vedder alla voce e Jack Irons alla batteria. Young suona la chitarra solista e Brendan O\'Brien il basso. Il 10 maggio 2006, nel concerto dei Pearl Jam a Toronto, il cantante rivelò che il ritornello fu ispirato da un verso di Cinnamon Girl di Neil Young', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I_Got_Id', 'https://www.youtube.com/v/qMyToPVWH9c?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pearl Jam', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11356', 'NULL', 'NULL', 'NULL', '1', 'Alternative rock', '216');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2821', 'Long Walk Home', 'Long Walk Home è la decima canzone dell\'album Magic, quindicesimo disco di studio di Bruce Springsteen. Il testo parla di un ritorno a casa e di una nuova fiducia nel domani, quasi che, chiuse le apocalittiche immagini di The rising, il lascito della tragedia, non fosse che una incomparabile speranza. La canzone recita: «Here everybody has a friend, everybody has a reason to begin again».', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Long_Walk_Home', 'https://www.youtube.com/v/i0Eris41lD4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bruce Springsteen', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11357', 'NULL', 'NULL', 'NULL', '1', 'Alternative rock', '217');
