INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2823', 'The Fool on the Hill', 'The Fool on the Hill è una canzone dei Beatles del 1967. Scritta principalmente da Paul McCartney per la colonna sonora del film Magical Mystery Tour. Essa è una ballata che narra la fantasiosa vicenda del folle sulla collina.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_Fool_on_the_Hill', 'https://www.youtube.com/v/EDtK7xUIDxk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11359', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic pop', '219');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2824', 'Stop (Pink Floyd)', 'Stop è una canzone dei Pink Floyd, pubblicata nel 1979 all\'interno dell\'album The Wall e scritta interamente da Roger Waters. Dura 30 secondi ed è, quindi, la canzone più breve della band.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Stop_(Pink_Floyd_song)', 'https://www.youtube.com/v/2Vqu2zOwYYI?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11360', 'NULL', 'NULL', 'NULL', '1', 'Art rock', '220');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2825', 'That\'s What Friends Are For', 'That\'s What Friends Are For è un brano musicale scritto nel 1982 da Burt Bacharach e Carole Bayer Sager, e originariamente registrato da Rod Stewart per la colonna sonora del film Night Shift - Turno di notte. Tuttavia il brano è principalmente conosciuto nella cover registrata da Dionne Warwick & friends, sotto il cui nome fu creata una collaborazione fra i cantanti Gladys Knight, Elton John e Stevie Wonder. Il singolo fu pubblicato nel 1985 e i suoi proventi furono interamente devoluti ad una fondazione statunitense per la ricerca sull\'AIDS, e furono raccolti oltre tre milioni di dollari. Il singolo raggiunse la vetta della Billboard Hot 100 per tre settimane nel gennaio 1986. La canzone vinse anche i Grammy Award nella categoria \"migliore performance pop di un gruppo\" e \"canzone dell\'anno\", premio effettivamente consegnato ai due autori del brano Bacharach e Bayer Sager. La canzone fu anche nominata dalla rivista Billboard come la più popolare del 1986. La canzone è stata anche posizionata al numero 61 della lista della più grandi canzoni di tutti i tempi stilata dalla rivista Billboard. Fra gli altri interpreti ad aver registrato una versione del brano si possono ricordare Shirley Bassey nel 1991 ed Helen Reddy nel 1998.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/That\'s_What_Friends_Are_For', 'https://www.youtube.com/v/xGbnua2kSa8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Rod Stewart', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11361', 'NULL', 'NULL', 'NULL', '1', 'Pop music', '221');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2826', 'Mother Goose (Jethro Tull)', 'Mother Goose è una canzone del gruppo rock britannico dei Jethro Tull, pubblicata come quarta traccia dell\'album Aqualung del 1971. Il testo è un pasticcio di immagini reali basati su immagini che Ian Anderson ha visto mente girovagava ad Hampstead Heath. Il brano è prevalentemente acustico molto simile a Cheap Day Return o Slipstream, dello stesso album.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Mother_Goose_(song)', 'https://www.youtube.com/v/tpO_oVtXCa4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Jethro Tull (band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11362', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '222');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2827', 'A New Machine', 'A New Machine è un brano musicale del gruppo progressive rock inglese Pink Floyd, contenuto nell\'album A Momentary Lapse of Reason e scritto da David Gilmour. Il brano è diviso in due parti, situate in due tracce diverse dell\'album (la prima parte nella traccia 7 e la seconda nella traccia 9). Tra le due parti è situato il brano strumentale Terminal Frost. È il primo brano dei Pink Floyd accreditato solo a David Gilmour da Childhood\'s End, sull\'album Obscured By Clouds del 1972.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/A_New_Machine', 'https://www.youtube.com/v/lcSL2yN39JM?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11363', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '223');
