INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2829', 'Beijing Huanying Ni', 'Beijing Huanying ni è la canzone ufficiale utilizzata come tema per le Olimpiadi di Pechino 2008, pubblicata per la prima volta il 30 aprile dello stesso anno, per la cerimonia del conto alla rovescia per i 100 giorni dall\'inizio dei giochi, tenutasi a Pechino. La canzone è cantata da decine di artisti provenienti da Cina continentale, Hong Kong, Taiwan, Giappone e Corea del Sud. Il testo della canzone è stato scritto dal compositore di Hong Kong Albert Leung, mentre le musiche sono state composte dal cinese Ke Zhao Lei, conosciuto anche come Xiao Ke. I cinque caratteri del titolo cinese della canzone (Bei Jing Huan Ying Ni) sono stati usati per creare i nomi dei Fuwa, le mascotte simbolo dei Giochi Olimpici di Pechino: il pesce Bei-Bei, il panda gigante Jing-jing, la fiamma olimpica Huan-Huan, la gazzella Ying-Ying e la rondine Ni-Ni. La canzone dura più di sei minuti, e sin dalla sua pubblicazione è stata estremamente popolare tra il pubblico cinese e non.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Beijing_Welcomes_You', 'https://www.youtube.com/v/tPiWsequAZw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Beijing Welcomes You', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11365', 'NULL', 'NULL', 'NULL', '1', 'Mandopop', '225');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2830', 'Into the Void (Black Sabbath)', 'Into the Void è un brano musicale dei Black Sabbath, contenuto nel loro album del 1971 intitolato Master of Reality, del quale è la traccia conclusiva. Una versione embrionale di Into the Void chiamata Spanish Sid è stata pubblicata come traccia bonus nell\'edizione deluxe di Master of Reality. Essendo notevolmente differente dal resto della canzone, la cupissima introduzione di Into the Void è conosciuta presso i fan e gli addetti ai lavori con il nome The Death Mask.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Into_the_Void_(Black_Sabbath_song)', 'https://www.youtube.com/v/5zWDa9NT88E?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Black Sabbath', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11366', 'NULL', 'NULL', 'NULL', '1', 'Heavy metal music', '226');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2831', 'Tea Party (Kerli)', 'Tea Party è il terzo singolo della colonna sonora di Alice in Wonderland, eseguito dalla cantante estone Kerli scritto e prodotto da lei e da Brian Ziff. Il video è diretto da Justin Harder ed è stato pubblicato il 10 marzo 2010. Kerli in una festa sontusa beve il tè con i suoi ospiti pieni di make-up e costumi; verso la fine Kerli versa una pozione nel tè che trasforma gli ospiti in bambole, li raccoglie e li mette su uno scaffale. Kerli ha esebito una performance live delle canzoni \"Tea Party\", \"Walking On Air\" e \"Strange\" presso l\'Alice in Wonderland Ultimate Fan Event il 19 febbraio 2010.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Tea_Party_(song)', 'https://www.youtube.com/v/uY58uPtAM68?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Kerli', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11367', 'NULL', 'NULL', 'NULL', '1', 'Electronic rock', '227');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2832', 'Don\'t Let Me Be Misunderstood', 'Don\'t Let Me Be Misunderstood è un brano musicale scritto da Bennie Benjamin, Gloria Caldwell e Sol Marcus per la cantante e pianista Nina Simone, che la registrò per la prima volta nel 1964. In seguito Don\'t Let Me Be Misunderstood è stata registrata o eseguita da numerosi artisti nel corso degli anni, ma è conosciuta principalmente per la registrazione del 1965 in chiave blues-rock dei The Animals, e nella sua reinterpretazione disco del 1977 dei Santa Esmeralda.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Don\'t_Let_Me_Be_Misunderstood', 'https://www.youtube.com/v/d2FT4FprxDg?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Nina Simone', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11368', 'NULL', 'NULL', 'NULL', '1', 'Soul music', '228');
