INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2837', 'I\'ve Been Loving You Too Long', 'I\'ve Been Loving You Too Long (spesso chiamata anche I\'ve Been Loving You Too Long è una canzone scritta da Otis Redding e Jerry Butler. Il brano fu pubblicato come \"lato A\" di un singolo del 1965 di Otis Redding, ed in seguito fu inserita nel suo terzo album Otis Blue. Il brano fu un enorme successo, riuscendo ad arrivare alla posizione numero 21 della Billboard Hot 100 ed alla seconda della classifica Billboard R&B, e tutt\'oggi è uno dei brani più celebri di Redding. Il \"lato B\" del disco singolo era Just One More Day che fu un moderato successo, raggiungendo al massimo la posizione nomero 85 della Hot 100. La canzone è stata classificata alla posizione 110 della Lista delle migliori 500 canzoni di tutti i tempi stilata dalla rivista Rolling Stone.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I\'ve_Been_Loving_You_Too_Long', 'https://www.youtube.com/v/qZ6OrrkeVFo?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Otis Redding', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11373', 'NULL', 'NULL', 'NULL', '1', 'Soul music', '233');
