INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2842', 'Whatever U Like', 'Whatever U Like è il titolo del primo singolo estratto dall\'album di debutto di Nicole Scherzinger, \"Her Name Is Nicole\", pubblicato nel 2008. Il singolo è stato prodotto con la collaborazione del rapper T.I. ed è stato pubblicato nel luglio del 2007 negli Stati Uniti.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Whatever_U_Like', 'https://www.youtube.com/v/nQJACVmankY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11378', 'NULL', 'NULL', 'NULL', '1', 'Contemporary_R&B', '238');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2843', 'State of Love and Trust', 'State of Love and Trust è una canzone dei Pearl Jam comparsa per la prima volta sulla colonna sonora del film Singles - L\'amore è un gioco. Questa è una delle prime canzoni registrate con il batterista Dave Abbruzzese; nella stessa session, furono registrate anche \"Breath\", \"Dirty Frank\" e la nuova registrazione di \"Even Flow\". La canzone fu inclusa nella tracklist dell\'album Rearviewmirror: Greatest Hits 1991-2003; tuttavia la versione del greatest hits risulta essere il mix che fu incluso nel film, non quello che fu incluso nella colonna sonora. Quando State of Love and Trust fu performata all\'MTV Singles Scene, il party per l\'uscita del film, Eddie Vedder cantò intenzionalmente con parolacce. Brendan O\'Brien per mandare in tv quelle scene, sostituì quelle parolacce con degli spezzoni della versione studio della canzone. Performance dal vivo della canzone sono disponibili sul box-set Live at the Gorge 05/06 e su Immagine in cornice, pubblicato nel settembre 2007.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/State_of_Love_and_Trust', 'https://www.youtube.com/v/1q1XZJMdRi4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pearl Jam', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11379', 'NULL', 'NULL', 'NULL', '1', 'Grunge', '239');
