INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2846', 'Julia (The Beatles)', 'Julia è un brano dei Beatles contenuto nell\'album The Beatles (meglio noto come White Album o Album Bianco). Non solo fu scritta esclusivamente da John Lennon, ma è anche l\'unico brano nella storia dei Beatles completamente realizzato solo da lui. In questa ballata dedicata alla madre, Julia Stanley, morta quando egli aveva solo 17 anni, inserì anche un riferimento a Yoko Ono, ormai da mesi diventata la sua compagna. Ocean child è infatti la traduzione inglese del suo nome.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Julia_(The_Beatles_song)', 'https://www.youtube.com/v/ZcWzlxECaPo?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11382', 'NULL', 'NULL', 'NULL', '1', 'Acoustic music', '242');
