INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2848', 'A Spanish Piece', 'A Spanish Piece è un brano del gruppo musicale progressive rock britannico Pink Floyd, contenuta nella colonna sonora Soundtrack from the Film More, del film More - Di più, ancora di più, del 1969. Caratterizzato da sonorità tipiche spagnole, è un pezzo strumentale molto corto della durata di poco più di un minuto. È stato il primo pezzo dei Pink Floyd ad essere stato scritto interamente da David Gilmour. In sottofondo si sente la voce di Gilmour che interpreta un ubriaco che chiede della tequila ad un certo Manuel. Poi parla ad una signorina spagnola facendole dei complimenti.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/A_Spanish_Piece', 'https://www.youtube.com/v/UG411y3_zX0?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11384', 'NULL', 'NULL', 'NULL', '1', 'Flamenco', '244');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2849', 'Hey You (Madonna)', 'Hey You è una canzone della popstar Madonna. La canzone, scritta e prodotta da Madonna e Pharrell Williams per il Live Earth, è scaricabile solo dal web ed i proventi del download vanno tutti a favore dell\'iniziativa Live Earth. Il Live Earth è una manifestazione organizzata da Al Gore a favore della difesa dell\'ambiente che si è svolta il 7 luglio 2007 in otto città diverse in sette continenti. Il brano è stato inserito nella compilation che contiene i più importanti brani eseguiti durante la manifestazione.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Hey_You_(Madonna_song)', 'https://www.youtube.com/v/Pbm6Q59yooE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Madonna (entertainer)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11385', 'NULL', 'NULL', 'NULL', '1', 'Pop music', '245');
