INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2851', 'I\'m So Lonesome I Could Cry', 'I\'m So Lonesome I Could Cry è una canzone scritta e registrata dal cantautore country Hank Williams nel 1949, ispirata dalla relazione con la moglie Audrey Sheppard. Inizialmente pubblicata come lato B di My Bucket\'s Got a Hole in It nel 1949 è stata poi pubblicata come singolo nel 1966. È stata inserita al 111° posto nella classifica delle migliori 500 canzoni della storia redatta dalla rivista Rolling Stone.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I\'m_So_Lonesome_I_Could_Cry', 'https://www.youtube.com/v/4WXYjm74WFI?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Hank Williams', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11387', 'NULL', 'NULL', 'NULL', '1', 'Country music', '247');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2852', 'American Ghost Dance', 'American Ghost Dance è il titolo di una canzone dei Red Hot Chili Peppers. Si tratta del secondo singolo estratto dal loro album in studio, Freaky Styley.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/American_Ghost_Dance', 'https://www.youtube.com/v/VcnjxEbaDQE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Red Hot Chili Peppers', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11388', 'NULL', 'NULL', 'NULL', '1', 'Funk rock', '248');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2853', 'Beyond the Sea (Bobby Darin)', 'Beyond the Sea è il titolo della versione in lingua inglese della canzone La Mer composta nel 1943 dal fantasista francese Charles Trenet e da Léo Chauliac durante un viaggio in treno fra Narbonne e Carcassonne. Il brano fu poi inciso da Trenet e lanciato sul mercato discografico internazionale nel 1946. Secondo gli storici della musica occorsero a Trenet e a Chauliac soltanto una ventina di minuti per comporre quello che era destinato a diventare un successo mondiale della musica leggera. Il testo in inglese è di Jack Lawrence: scritto in maniera originale, non ha alcun riferimento semantico con quello del corrispettivo brano in lingua francese. A parere di taluni critici, mentre il testo di Le Mer è suggestivo per le evocazioni poetiche che racchiude in sé, ricche di crepuscolari riflessioni sulla vita e sul sentimento amoroso in senso universale, la versione in lingua inglese appare come un, peraltro riuscito, tentativo di confezionare una canzone di puro sentimentalismo. Il refrain ruota attorno alle aspettative di un innamorato che, guardando al di là del mare (beyond the sea, appunto), spera di incontrare un giorno la ragazza del cuore in grado di non farlo salpare più. Il brano ha avuto oltre quattrocento versioni ma è soprattutto nell\'incisione del cantante italo-statunitense Bobby Darin che ha raggiunto negli anni sessanta il successo internazionale.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Beyond_the_Sea_(song)', 'https://www.youtube.com/v/m8OlDPqYBLw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11389', 'NULL', 'NULL', 'NULL', '1', 'NULL', '249');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2854', 'The End (The Beatles)', 'The End è la penultima canzone del penultimo album dei Beatles, intitolato Abbey Road.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_End_(The_Beatles_song)', 'https://www.youtube.com/v/7a_8F6gflxQ?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11390', 'NULL', 'NULL', 'NULL', '1', 'Art rock', '250');
