INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2856', 'The Lonesome Death of Hattie Carroll', 'The Lonesome Death of Hattie Carroll è una canzone scritta e interpretata da Bob Dylan nel 1964, contenuta nel suo terzo album The Times They Are A-Changin\', e parla di un fatto di cronaca avvenuto negli anni cinquanta, in cui un uomo di nome William Zanziger uccise Hattie Carrol, una donna di colore di cinquantuno anni che lavorava come cameriera in un locale, con alle spalle una famiglia di sei figli. Il brano, pur non essendo stato pubblicato come singolo, è piuttosto noto al pubblico e ne sono state realizzate numerose cover da parte di artisti come Billy Bragg, Rx Bandits, Michael Rose, Christy Moore, Mason Jennings, Martin Carthy, Robert Levon Been, Phranc e Julie Felix.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_Lonesome_Death_of_Hattie_Carroll', 'https://www.youtube.com/v/wlw_qzefEaA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11392', 'NULL', 'NULL', 'NULL', '1', 'Folk music', '252');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2857', 'I Won\'t Say (I\'m in Love)', 'I Won\'t Say (I\'m in Love) (nella versione in italiano Ti vada o no) è una canzone composta da Alan Menken e scritta da David Zippel per la colonna sonora del film d\'animazione Disney Hercules del 1997. Nella versione originale è cantata da Susan Egan, mentre in quella italiana da Barbara Cola.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I_Won\'t_Say_(I\'m_in_Love)', 'https://www.youtube.com/v/I_bEWXs_FX4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Susan Egan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11393', 'NULL', 'NULL', 'NULL', '1', 'Blues', '253');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2858', 'Alan\'s Psychedelic Breakfast', 'Alan\'s Psychedelic Breakfast è il brano conclusivo dell\'album Atom Heart Mother dei Pink Floyd. È stato concepito da tutt\'e quattro i componenti del gruppo.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Alan\'s_Psychedelic_Breakfast', 'https://www.youtube.com/v/YF1K1rQ8QNA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11394', 'NULL', 'NULL', 'NULL', '1', 'Spoken word', '254');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2859', 'Interstellar Overdrive', 'Interstellar Overdrive è una canzone della progressive rock band Pink Floyd, tratta dall\'album The Piper at the Gates of Dawn, uscito nel 1967. Una versione più lunga del brano appare nel film Tonite Let\'s All Make Love in London, alla cui colonna sonora hanno partecipato i Pink Floyd (e pubblicata nell\'omonimo album Tonite Let\'s All Make Love in London). E\' sicuramente il brano più famoso di tutto l\'album ed è la cronaca di un viaggio umano nell\'universo, portandoci negli angoli più remoti e bui del cosmo. Si sviluppa nei suoi undici minuti seguendo una sola regola: almeno uno strumento deve mantenere il ritmo e sopra questo ritmo, interpretato ora da uno, ora da un altro strumento, si sviluppa una jam acidissima. Questo brano è ricordato anche per il grande impatto live. I Pink Floyd lo suonavano ogni sera all’UFO. Le versioni live erano lunghe oltre venti minuti e quasi del tutto improvvisate, mentre quella sull\'album è molto più corta e sintetizzata, in modo da poter reggere ascolti ripetuti. Si viene introdotti in un incredibile viaggio spaziale che si fa sempre più inquietante fino alla conclusione del brano, scandita dal riff iniziale e poi da rumori meccanici.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Interstellar_Overdrive', 'https://www.youtube.com/v/Jq5t7Y_BYIM?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11395', 'NULL', 'NULL', 'NULL', '1', 'Instrumental rock', '255');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2860', 'Half the World Away', 'Half the World Away è un brano della band inglese Oasis, pubblicato per la prima volta come b-side del singolo Whatever nel 1994. Il testo è opera di Noel Gallagher che nel brano, oltre che a suonare il suo strumento abituale che sarebbe la chitarra, suona anche la batteria che è sempre stata una sua grande passione. Per rivederlo in veste di batterista bisognerà aspettare il 2008, nell\'album Dig Out Your Soul infatti addirittura tre brani lo vedono in questo ruolo. Paul Weller, grande amico di Noel, ha affermato che questa è la sua canzone degli Oasis preferita. In Inghilterra la canzone è molto popolare, questo perché è anche la sigla di una famosa sitcom britannica della BBC, The Royle Family con l\'attrice Liz Smith. Il buon successo del brano ha spinto la band ad inserire la canzone nella raccolta di b-sides The Masterplan del 1998 e nel Greatest Hits del 2006 Stop the Clocks.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Half_the_World_Away', 'https://www.youtube.com/v/C1YqF3pYAeg?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Oasis', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11396', 'NULL', 'NULL', 'NULL', '1', 'Britpop', '256');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2861', 'Once (Pearl Jam)', 'Once è il nome del brano musicale di apertura di Ten, l\'album di debutto dei Pearl Jam. Sull\'LP è preceduta da un breve interludio che però fa parte della traccia fantasma di chiusura Master/Slave. La canzone è anche una b-side del singolo Alive. Once è stata passata numerose volte per le radio grazie alla durevole popolarità dei Pearl Jam. Fu inclusa nella tracklist del greatest hits della band Rearviewmirror: Greatest Hits 1991-2003. Una performance live della canzone è disponibile sul box-set Live at the Gorge 05/06', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Once_(Pearl_Jam_song)', 'https://www.youtube.com/v/tPkz7bZoq18?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pearl Jam', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11397', 'NULL', 'NULL', 'NULL', '1', 'Grunge', '257');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2862', 'Norwegian Wood (This Bird Has Flown)', 'Norwegian Wood (This Bird Has Flown) è una canzone dei Beatles, scritta da John Lennon, ed inserita nell\'album Rubber Soul, del 1965, e presenta come peculiarità principale la prima comparsa in assoluto in una canzone occidentale dello strumento del sitar, suonato da George Harrison.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Norwegian_Wood_(This_Bird_Has_Flown)', 'https://www.youtube.com/v/KkcRZSdc8us?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11398', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '258');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2863', 'Gabriel\'s Oboe', 'Gabriel\'s Oboe è un brano musicale scritto da Ennio Morricone per il film Mission, candidato all\'Oscar come miglior colonna sonora, del 1986. La sua caratteristica è la capacità di trasmettere, con pochi strumenti tra i quali in primo piano un oboe, un senso celestiale che pochi altri brani musicali riescono a trasmettere. Il brano è stato ripreso da molti spot televisivi, tra i quali il più trasmesso è lo spot della Chiesa Cattolica per la donazione dell\'otto per mille.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Gabriel\'s_Oboe', 'https://www.youtube.com/v/2WJhax7Jmxs?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Ennio Morricone', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11399', 'NULL', 'NULL', 'NULL', '1', 'Classical music', '259');
