INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2866', 'It Ain\'t Gonna Be Easy', 'It Ain\'t Gonna Be Easy è un brano composto ed interpretato dall\'artista britannico Elton John; il testo è di Gary Osborne.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/It_Ain\'t_Gonna_Be_Easy', 'https://www.youtube.com/v/QufAIYg8__8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Elton John', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11402', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '262');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2867', 'Love Street', 'Love Street è un singolo del 1968 del gruppo statunitense The Doors, scritto dalla band stessa e pubblicato sull\'album Waiting for the Sun, La canzone parla del Laurel Canyon Boulevard, a Laurer Canyon, California dove Jim Morrison visse con la sua fidanzata, Pamela Courson. Il loro indirizzo era 1812 di Rothdell Trail. È stato pubblicato come lato-B di Hello, I Love You. Il pianista George Winston ha realizzato una cover della canzone.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Love_Street', 'https://www.youtube.com/v/pldftoUbM80?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Doors', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11403', 'NULL', 'NULL', 'NULL', '1', 'Baroque pop', '263');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2868', 'YYZ (brano musicale)', 'YYZ è una canzone del gruppo rock canadese Rush. Si tratta di un brano strumentale pubblicato per la prima volta nell\'album Moving Pictures nel 1981 come terza traccia. È in ordine cronologico la seconda strumentale del trio canadese (la prima è La Villa Strangiato presente sul disco Hemispheres) e ci vorranno dieci anni affinché i Rush ne pubblichino un\'altra, precisamente Where\'s My Thing? (Part IV, \"Gangster of Boats\" Trilogy) uscita nel 1991 sull\'album Roll the Bones. Dal momento della sua prima comparsa YYZ è diventata subito una delle canzoni più apprezzate e più suonate in sede live dai Rush. Inoltre compare in tutti i CD dal vivo del trio e nei video Exit... Stage Left, A Show of Hands (anche se nella versione DVD non compare nella scaletta), Grace Under Pressure Tour e Rush in Rio.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/YYZ_(instrumental)', 'https://www.youtube.com/v/OfmlKhrcfNU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Rush (band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11404', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '264');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2869', 'Lying from You', 'Lying from You è un brano del gruppo musicale statunitense Linkin Park, quarta traccia del secondo album studio Meteora, pubblicato il 25 marzo 2003 per la Warner Bros Records. Nonostante non fosse stato pubblicato come singolo, il brano riscosse un discreto successo e raggiunse la prima posizione nella \"Billboard Modern Rock Tracks\" diventando così il quarto brano consecutivo ad ottenere questa posizione. Nel 2004 il gruppo registrò un mash-up di Lying from You con Dirt off Your Shoulder di Jay-Z per l\'album Collision Course.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Lying_from_You', 'https://www.youtube.com/v/1V4FLUOlMks?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Linkin Park', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11405', 'NULL', 'NULL', 'NULL', '1', 'Rap metal', '265');
