INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2877', 'Several Species of Small Furry Animals Gathered Together in a Cave and Grooving with a Pict', 'Several Species of Small Furry Animals Gathered Together in a Cave and Grooving with a Pict è la 6° traccia dell\'album dei Pink Floyd Ummagumma del 1969, forse il lavoro più controverso della band inglese per via della sua fortissima connotazione sperimentale.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Several_Species_of_Small_Furry_Animals_Gathered_Together_in_a_Cave_and_Grooving_with_a_Pict', 'https://www.youtube.com/v/s_MvZxpE7YU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11413', 'NULL', 'NULL', 'NULL', '1', 'Musique concrète', '273');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2878', 'Is There Anybody Out There?', 'Is There Anybody Out There? è una canzone, quasi interamente strumentale, contenuta nell’album dei Pink Floyd, The Wall. La prima metà della canzone trasmette lo stesso messaggio di Hey You: cioè una richiesta di aiuto da parte di Pink, mentre la seconda parte è interamente strumentale ed è basata su un arpeggio di chitarra acustica. David Gilmour ha dichiarato in alcune interviste di aver tentato di eseguirla molte volte, ma di non essere mai stato soddisfatto del risultato finale (\"Sono riuscito a suonarla con un plettro di cuoio, ma non sono riuscito a suonarla correttamente con le dita\")). Fu quindi il turnista Ron di Blasi ad eseguire l\'arpeggio registrato per l\'album. Gilmour ha inoltre dichiarato che la canzone è stata composta da Bob Ezrin, con l\'accordo che non venisse citato tra i crediti. Tra la prima e la seconda parte si trova una seconda citazione di Echoes (Pink Floyd): Il suono stridulo e simile a quello di un uccello marino (o di una sirena) fa parte di un lungo intermezzo strumentale di questa suite che occupa l\'intero lato B dell\'album Meddle.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Is_There_Anybody_Out_There%3F', 'https://www.youtube.com/v/fNLhxKpfCnA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11414', 'NULL', 'NULL', 'NULL', '1', 'Rock_opera', '274');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2879', 'Chimes of Freedom (Bob Dylan)', 'Chimes of Freedom è il titolo di una canzone di Bob Dylan, pubblicata nell\'album Another Side of Bob Dylan nel 1964. La sua cover è stata incisa da diversi artisti tra cui Joan Baez, The Byrds, Roger McGuinn, Martyn Joseph, The Axis of Justice, The West Coast Pop Art Experimental Band, X, Bruce Springsteen.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Chimes_of_Freedom_(song)', 'https://www.youtube.com/v/rkkA-iyOd3c?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11415', 'NULL', 'NULL', 'NULL', '1', 'Folk music', '275');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2880', 'So What (Miles Davis)', 'So What è uno standard composto da Miles Davis e inciso come primo brano del famoso album Kind of Blue, che inaugurò la stagione del jazz modale. Ripreso da moltissimi interpreti, spesso con l\'aggiunta dell\'assolo di Davis (ad esempio, George Russell ne ha prodotto una versione per grande orchestra, e ne esiste una versione cantata in vocalese da Eddie Jefferson) è considerato uno dei maggiori successi di Davis.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/So_What_(composition)', 'https://www.youtube.com/v/DEC8nqT6Rrk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11416', 'NULL', 'NULL', 'NULL', '1', 'NULL', '276');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2881', 'Night of Your Life', 'Night of Your Life è il terzo e ultimo singolo promozionale estratto dal quinto album in studio di David Guetta, Nothing but the Beat. È dotato dalla voce dell\'americana Jennifer Hudson. Il brano è stato pubblicato digitalmente il 22 agosto 2011 come ultimo singolo promozionale dall\'album, dopo Lunar. Questa canzone è stata scritta da David Guetta, Giorgio Tuinfort, Crystal Nicole Johnson, Anthony Preston, Olivia Nervo e Miriam Nervo. In questo singolo c\'è un sample di Only Girl (In The World), un singolo di Rihanna del 2010. La critica ha elogiato molto questo pezzo dandogli quattro su cinque stelle nella scrittura del pezzo. Continuando ha anche detto che il francese David Guetta si è riscattato con questo singolo facendolo diventare un vero e proprio inno all\'amore originale grazie anche al ritmo dance e alla straordinaria voce della Hudson.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Night_of_Your_Life_(David_Guetta_song)', 'https://www.youtube.com/v/qMrbhz24DcA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'David Guetta', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11417', 'NULL', 'NULL', 'NULL', '1', 'Pop music', '277');
