INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2883', 'Thank You (Led Zeppelin)', 'Queste le dolci parole d\'amore che aprono e chiudono la parte cantata di Thank You. Registrato nel 1969 nei Morgan Studios, a Londra, inserito come quarta traccia di Led Zeppelin II, album registrato dall\'omonima band, il brano porta la firma di Jimmy Page e Robert Plant. È un brano che rispecchia molte caratteristiche dei brani Soft Rock, in netto contrasto con la tendenza Hard Rock ed Heavy Metal che domina gli altri brani di questo album (considerato dai critici il primo vero esempio di questi generi, insieme agli album dei Black Sabbath), e del gruppo in generale.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Thank_You_(Led_Zeppelin_song)', 'https://www.youtube.com/v/tfUSZVIWhxA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Led Zeppelin', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11419', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '279');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2884', 'Shine on Through', 'Shine On Through è un brano composto ed interpretato dall\'artista britannico Elton John; il testo è di Gary Osborne.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Shine_on_Through', 'https://www.youtube.com/v/HLlIJjaRJiI?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11420', 'NULL', 'NULL', 'NULL', '1', 'Pop_music', '280');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2885', '4th of July, Asbury Park (Sandy)', '4th of July, Asbury Park (Sandy), conosciuta semplicemente anche come Sandy, è una canzone di Bruce Springsteen del 1973, che appare nel suo secondo album The Wild, the Innocent & the E Street Shuffle. Il pezzo è uno dei più famosi del cantautore statunitense, infatti è presente anche nell\'album The Essential Bruce Springsteen e conta diverse interpretazioni live, tra cui quella dell\'album triplo Live/1975-85. La vicenda narrata si svolge, come suggerisce il titolo, il 4 luglio, giorno dell\'indipendenza americana, durante il quale il protagonista dichiara il suo amore verso Sandy, sullo sfondo di una società depressa in una cittadina quale Asbury Park; egli si definisce stufo di tutte le umiliazioni subite dalle ragazze, soprattutto dalla cameriera che non prova più alcun sentimento per lui (That waitress I was seeing lost her desire for me). Nel testo viene citato spesso the boardwalk, che in italiano significa la passeggiata lungomare caratterizzata da una struttura (spesso di legno): per il protagonista la vita da spiaggia che gli ha recato tante delusioni è finita ed è deciso ad incominciarne una nuova con la ragazza che ama veramente.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/4th_of_July,_Asbury_Park_(Sandy)', 'https://www.youtube.com/v/KgFHM8HMbWQ?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bruce Springsteen', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11421', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '281');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2886', 'Isis (brano musicale)', 'Isis è la seconda traccia dell\'album Desire di Bob Dylan. Racconta di un uomo che sposa la sua ragazza e poi se ne va di casa. Iside è la dea egiziana della medicina, della luna e del matrimonio (quando Dylan introduceva questa canzone durante la Rolling Thunder Revue affermava che la canzone parlava proprio del matrimonio). Iside è anche all\'origine dell\'Imperatrice dei tarocchi, la cui immagine è presente sia nel libretto che nel retro dell\'album. La canzone è scritta in modo che l\'ultima strofa sia immediatamente precedente alla prima, come capita anche in Tangled up in blue e All along the watchtower.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Isis_(song)', 'https://www.youtube.com/v/GOJk0HW_hJw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11422', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '282');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2887', 'Queen Bitch', 'Queen Bitch è una canzone scritta ed interpretata da David Bowie nel 1971 per l\'album Hunky Dory. La canzone è un tributo a Lou Reed. Benché il riff del brano sia simile a quello di Sweet Jane dei Velvet Underground, in realtà è stato campionato da Three Steps to Heaven di Eddie Cochran. (singolo del 1960, numero uno nel Regno Unito postumo). La canzone è stata utilizzata anche durante i titoli finali del film di Wes Anderson Le avventure acquatiche di Steve Zissou del 2004 e nella colonna sonora del film Milk.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Queen_Bitch', 'https://www.youtube.com/v/S5P63qGTm_g?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'David Bowie', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11423', 'NULL', 'NULL', 'NULL', '1', 'Protopunk', '283');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2888', 'On the Run', 'On the Run è un brano dei Pink Floyd, che rappresenta uno dei punti estremi mai toccati dal Rock sperimentale e dal Rock psichedelico. Il pezzo rappresentava una rivoluzione anche per il genere sperimentale, in quanto il ritmo è semplice, ripetuto in tutto il brano, veloce e ipnotico. Il brano è pieno di suoni indefiniti coperti da altri, riecheggianti e inusuali.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/On_the_Run_(instrumental)', 'https://www.youtube.com/v/S7D65IomNYY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11424', 'NULL', 'NULL', 'NULL', '1', 'Electronic rock', '284');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2889', 'Love Me (Justin Bieber)', 'Love Me è una canzone elettropop dell\' artista canadese Justin Bieber. Il brano è stato rilasciato in esclusiva per iTunes come primo singolo digitale di debutto del cantante, il 26 ottobre 2009. La canzone prende spunto da \"Lovefool\" della band svedese The Cardigans. \"Love Me\" è stato uno dei brani con maggior successo dell\'album, e anche se è stato rilasciato solo tramite iTunes, la canzone ha avuto un discreto successo in Canada e negli Stati Uniti. Il video musicale ufficiale del brano è stato rilasciato il 3 agosto 2010 e simboleggia un \"omaggio ai suoi fans in tutto il mondo, ringraziandoli per il loro sostegno\". Le scene sono composte per la maggior parte di esibizioni dal vivo, con l\'aggiunta di filmati dietro le quinte; Bieber è collocato con alle proprie spalle uno sfondo bianco e blu. Bieber ha eseguito la canzone in numerose occasioni, soprattutto nel Tour Fearless.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Love_Me_(Justin_Bieber_song)', 'https://www.youtube.com/v/qdDVtFvJwUc?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Justin Bieber', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11425', 'NULL', 'NULL', 'NULL', '1', 'Synthpop', '285');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2890', 'Masters of War', 'Masters of War è una canzone scritta da Bob Dylan contenuta nell\'album The Freewheelin\' Bob Dylan del 1963. Si tratta di una riscrittura, con un nuovo testo, dell\'antica canzone folk tradizionale Nottamun Town nell\'arrangiamento della folksinger Jean Ritchie.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Masters_of_War', 'https://www.youtube.com/v/JaMz8pgua_0?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11426', 'NULL', 'NULL', 'NULL', '1', 'Folk music', '286');
