INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2895', 'Crickets Sing for Anamaria', 'Crickets Sing for Anamaria è il quarto e ultimo singolo estratto dal secondo album della cantautrice inglese Emma Bunton, Free Me, pubblicato dall\'etichetta Polydor. Si tratta di una cover di una canzone di Astrud Gilberto pubblicata nel 1965. Il singolo è stato pubblicato il 31 maggio 2004 in Regno Unito ma non ha avuto un grosso successo, raggiungendo appena la posizione numero quindici nella classifica dei singoli britannica nella sua prima settimana di vendita. Il video della canzone è stato diretto da Harvey & Carolyn, che avevano già collaborato con la Bunton per il video del precedente singolo Maybe.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Crickets_Sing_for_Anamaria', 'https://www.youtube.com/v/TQzotPMPSRU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Marcos Valle', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11431', 'NULL', 'NULL', 'NULL', '1', 'Bossa nova', '291');
