INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2898', 'I Saw Her Standing There', 'I Saw Her Standing There è una canzone scritta da John Lennon e Paul McCartney ed è il brano di apertura dell\'album di debutto dei Beatles, Please Please Me del 1963. Il 26 dicembre 1963, negli Stati Uniti la Capitol Records ha pubblicato I Saw Her Standing There come lato B di I Want to Hold Your Hand ed il 18 gennaio 1964 il disco ha raggiunto la prima posizione delle classifiche americane rimanendovi per sette settimane consecutive. Il brano è entrato nella classifica Hot 100 di Billboard l\'8 febbraio 1964, rimanendovi per 11 settimane e raggiungendo la 14ª posizione. La canzone è stata inoltre inclusa nei primi due album americani dei Beatles, Introducing... The Beatles, pubblicato dalla Vee Jay Records il 10 gennaio 1964 e Meet the Beatles!, pubblicato dalla Capitol Records appena dieci giorni dopo.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I_Saw_Her_Standing_There', 'https://www.youtube.com/v/DsgWfAilIEM?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11434', 'NULL', 'NULL', 'NULL', '1', 'Beat music', '294');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2899', 'Your Blue Room', 'Your Blue Room è la terza traccia dell\'album del 1995 Original Soundtracks 1, registrato dagli U2 e da Brian Eno sotto lo pseudonimo di Passengers. La canzone è stata scritta per il film Al di là delle nuvole, diretto da Michelangelo Antonioni e Wim Wenders e sarebbe dovuta essere il secondo singolo estratto dopo Miss Sarajevo, ma le vendite del disco non ebbero il successo sperato tanto che di conseguenza non se ne fece più nulla.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Your_Blue_Room', 'https://www.youtube.com/v/xS4hJabqRc4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Original Soundtracks 1', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11435', 'NULL', 'NULL', 'NULL', '1', 'Ambient music', '295');
