INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2901', 'Black (Pearl Jam)', 'Black è un brano musicale tratto da Ten, album di debutto dei Pearl Jam. La canzone è il soliloquio di un uomo dal cuore spezzato che ricorda la sua amata perduta. Black è uno dei brani più noti del gruppo ed è un pezzo centrale ed emozionante dell\'album. Come per \"Rearviewmirror\" tratto da Vs. e Better Man tratto da Vitalogy, il gruppo si è rifiutato di farne un singolo, ritenendo che fosse troppo personale e che le emozioni sarebbero andate perdute se se ne fosse fatto un video o un singolo.. Nonostante questo, il brano ha raggiunto la posizione numero 3 della classifica di Billboard Mainstream Rock Tracks nel 1992. La canzone è inclusa nella raccolta Rearviewmirror: Greatest Hits 1991-2003 dei Pearl Jam.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Black_(Pearl_Jam_song)', 'https://www.youtube.com/v/JfhsRIDh1RQ?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pearl Jam', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11437', 'NULL', 'NULL', 'NULL', '1', 'Grunge', '297');
