INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2903', 'Bring the Boys Back Home', 'Bring the Boys Back Home è una canzone dei Pink Floyd pubblicata nel 1979 all\'interno dell\'album The Wall. La canzone fu inserita anche all\'interno del singolo When the Tigers Broke Free. Secondo Roger Waters è la canzone che unifica l\'album. Infatti ha detto: « \" . . . in parte dice di non lasciare le persone andare e morire nelle guerre, ma in particolare dice di non permettere che fare rock and roll, o fabbricare automobili, o vendere sapone, o impegnarsi in una ricerca scientifica, o qualsiasi altra cosa che le persone possono fare . . . non permettere che quello diventi tanto importante da lasciarci trascurare i nostri amici, nostra moglie, i nostri figli o altre persone.  »</div>', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Bring_the_Boys_Back_Home', 'https://www.youtube.com/v/U5YxY_CJwz4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11439', 'NULL', 'NULL', 'NULL', '1', 'Symphonic rock', '299');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2904', 'Out of Time (The Rolling Stones)', 'Out of Time è un brano della rock band inglese Rolling Stones, pubblicato dalla Decca Records il 15 aprile 1966 come secondo singolo estratto dall\'album Aftermath (versione UK). Nel 1967 negli Stati Uniti ne venne pubblicata una versione alternativa, più corta, nell\'album Flowers.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Out_of_Time_(The_Rolling_Stones_song)', 'https://www.youtube.com/v/yFe78Cm0YCE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Rolling Stones', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11440', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '300');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2905', 'Wait (The Beatles)', 'Wait è un brano musicale dei Beatles, accreditato alla coppia Lennon/McCartney, pubblicato nell\'album Rubber Soul. La canzone di solito è indicata come un lavoro fatto in coppia da Lennon e McCartney, anche se nel 1997 tramite il libro Many Years from Now, McCartney dichiarò la canzone composta da lui.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Wait_(The_Beatles_song)', 'https://www.youtube.com/v/6O5w5h2T87c?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11441', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '301');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2906', 'Oceania (Björk)', 'Oceania è una canzone della cantante islandese Björk ed è estratta dall\'album Medúlla. È stata scritta appositamente per la cerimonia di apertura della XXVIII Olimpiade ad Atene. Come tutte le canzoni contenute nell\'album, la canzone è composta solo dal suono della voce umana e, in particolare, in questo caso hanno partecipato alla realizzazione un coro di Londra e un famoso beatboxer inglese, Shlomo. Il testo della canzone è stato scritto insieme ad un amico e collaboratore della cantante, Sjón; è una descrizione dell\'evoluzione umana vista e commentata dal punto di vista dell\'acqua, da cui tutto ha avuto origine. Oceania è l\'ultima canzone appartenente al gruppo composto da Human Behaviour, Isobel e Bachelorette. La canzone ha avuto una nomination ai Grammy Award del 2005.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Oceania_(song)', 'https://www.youtube.com/v/Qv5ZU06JDN4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bj%C3%B6rk', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11442', 'NULL', 'NULL', 'NULL', '1', 'Vocal music', '302');
