INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2910', 'Crucify the Dead', 'Crucify the Dead è la seconda traccia, nonché terzo singolo, dell\'album solista dell\'ex chitarrista dei Guns N\' Roses, ora Velvet Revolver, Slash. La canzone vede Ozzy Osbourne come ospite speciale.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Crucify_the_Dead', 'https://www.youtube.com/v/RtTqHA0oric?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11446', 'NULL', 'NULL', 'NULL', '1', 'Heavy_metal_music', '306');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2911', 'All My Love', 'All my love è il titolo di una canzone scritta nel 1979 a firma Jones/Plant per ricordare Karac, il figlio di Plant, morto a 5 anni d\'infezione gastrica nel 1977. Pur non essendo il fatto mai stato confermato, la canzone è stata dedicata alla memoria del piccolo. Sesta traccia dell\'LP In Through The Out Door, il pezzo fu registrato in una singola sessione. È stata, insieme a South Bound Saurez dello stesso LP In Through the Out Door, la sola canzone priva della firma di Jimmy Page nella discografia dei Led Zeppelin. Durante l\'assolo di Synth di John Paul Jones c\'è stata una lieve calonzata a 2:51 in cui sono state suonate due note dissonanti, e per alcuni la cosa sarebbe stata voluta per sottolineare il dolore del testo.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/All_My_Love_(song)', 'https://www.youtube.com/v/5pHEfTgStfU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Led Zeppelin', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11447', 'NULL', 'NULL', 'NULL', '1', 'Symphonic rock', '307');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2912', 'It Won\'t Be Long (The Beatles)', 'It Won\'t Be Long è un brano musicale dei Beatles, contenuto nell\'album With the Beatles del 1963. È accreditato alla coppia Lennon/McCartney, anche se è prevalentemente scritta dal solo Lennon, mentre McCartney ha contribuito nel testo e nell\'arrangiamento.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/It_Won\'t_Be_Long', 'https://www.youtube.com/v/oRPbSF25EkE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11448', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '308');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2913', 'While Your Lips Are Still Red', 'While Your Lips Are Still Red è una canzone scritta nel 2007 da Tuomas Holopainen e Marco Hietala, rispettivamente il tastierista e il bassista e cantante dei Nightwish, metal band finlandese. È stata interpretata da Holopainen, Hietala e dal batterista Jukka Nevalainen per il film Lieksa!, scritto e diretto dal rinomato direttore finlandese Markku Pölönen. La canzone fa parte del singolo \"Amaranth\", uscito il 22 agosto 2007 come secondo singolo del sesto album dei Nightwish, ovvero Dark Passion Play. La frase \"Kiss while your lips are still red\" si trova all\'interno della canzone stessa e si riferisce al momento in cui il colore delle labbra svanisce quando si sta per morire; tale frase indica semplicemente \"bacia finché ancora puoi\" o \"assapora finché ancora puoi\". Il video musicale ufficiale della canzone contiene una serie di clips riprese dal film Lieksa!, mentre Hietala canta e Holopainen cammina dietro di lui. Il video è stato pubblicato su YouTube il 14 giugno 2007. “While Your Lips Are Still Red” non è una traccia ufficiale dei Nightwish, ma Holopainen ha dichiarato che lui non è d\'accordo con la pubblicazione di alcun materiale nell\'ambito del proprio nome. Sul sito internet dei Nightwish è possibile leggere che la canzone è stata scritta da Tuomas Holopainen ed eseguita da lui con le tastiere, da Marco Hietala alla voce e al basso e da Jukka Nevalainen alla batteria. La canzone non include né chitarre né voci femminili. Il videoclip avvicina \"While Your Lips Are Still Red\" a Holopainen e Hietala, lasciando fuori Nevalainen, che non fu implicato nella scrittura della canzone stessa. Il sussurro in sottofondo è eseguito da Tuomas Holopainen. La canzone è stata recentemente aggiunta ai live set della band.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/While_Your_Lips_Are_Still_Red', 'https://www.youtube.com/v/smiFk6KHr_8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Tuomas Holopainen', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11449', 'NULL', 'NULL', 'NULL', '1', 'Symphonic rock', '309');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2914', 'Hair (Lady Gaga)', 'Hair è un brano musicale della cantante statunitense Lady Gaga incluso nel suo secondo album, Born This Way. È stato pubblicato il 16 maggio 2011 in tutto il mondo come singolo promozionale in attesa della pubblicazione dell\'album. È stato scritto da Lady Gaga e Nadir Khayat e prodotto dalla stessa Gaga in collaborazione con RedOne. Lady Gaga ha spiegato che Hair non è stato pianificato come singolo, ma che sarebbe stato lanciato come tale se avesse venduto bene su iTunes Store. Secondo Gaga, la melodia di Hair richiama i lavori di band metal come i KISS e gli Iron Maiden e, secondo quanto confermato da Gaga, è stata ispirata da Bruce Springsteen. L\'idea della canzone risale a quando la cantante era una ragazza e i suoi genitori la costringevano a vestirsi e presentarsi in un modo che non la rappresentava. È entrata alla quinta posizione della classifica digitale statunitense vendendo 147.000 copie nella sua prima settimana.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Hair_(Lady_Gaga_song)', 'https://www.youtube.com/v/Okq8xHrIZ8I?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Lady Gaga', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11450', 'NULL', 'NULL', 'NULL', '1', 'Electronic rock', '310');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2915', '1+1 (Beyoncé Knowles)', '1+1 è una canzone interpretata dalla cantante statunitense Beyoncé Knowles, pubblicata il 25 maggio 2011 come singolo promozionale per l\'album 4. Il brano è stato scritto dalla Knowles con Terius Nash, Christopher Stewart e Corey Jackson Carter, ed è prodotto da The-Dream. La cantante ha interpretato il brano nella puntata finale di American Idol il 25 maggio dichiarando che si trattava della sua canzone preferita. Il brano è una power ballad Soul con influenze Indie rock, incisa originariamente da The-Dream con il titolo Nothing But Love, ma poi non utilizzata per l\'album Love vs. Money (2009). 1+1 ha ricevuto delle critiche molto positive, l\'interpretazione della Knowles è stata particolarmente apprezzata. Il video prodotto per 1+1 è comparso in rete il 26 agosto 2011 ed è stato trasmesso in anteprima alle sette di sera sul canale E! News. È stato diretto dalla stessa Beyoncé insieme a Lauren Briet ed Ed Burke.. La Protagonista è una sensuale Beyoncé, che gioca con effetti di luce, sdoppiamenti e sguardi provocanti.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/1+1_(song)', 'https://www.youtube.com/v/KaasJ44O5lI?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Beyonc%C3%A9 Knowles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11451', 'NULL', 'NULL', 'NULL', '1', 'Contemporary R&B', '311');
