INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2918', 'Send It On', 'Send It On è una canzone pop cantata da Miley Cyrus, Selena Gomez, Demi Lovato e dai Jonas Brothers. Il gruppo, promosso come \"Disney Amici per il cambiamento\" (titolo originale Disney Friends For Change), deriva dall\'iniziativa Disney per l\'ambiente che prende lo stesso nome, appunto Disney Friends For Change. La canzone è stata pubblicata l\'11 agosto 2009 negli Stati Uniti come singolo di beneficenza a vantaggio delle associazioni internazionali per l\'ambiente. È stata scritta da Adam Anders, Nikki Hassman and Peer Astrom, gli stessi che hanno scritto \"Hoedown Throwdown\" per Miley Cyrus. Il 23 dicembre 2009 è stato creato il primo forum su Send It On.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Send_It_On_(song)', 'https://www.youtube.com/v/ZYnDC7f8aJU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Disney\'s Friends for Change', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11454', 'NULL', 'NULL', 'NULL', '1', 'Pop music', '314');
