INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2920', 'Shadowplay', 'Shadowplay è una canzone composta da Ian Curtis ed interpretata dal gruppo musicale Joy Division, inserita come settima traccia nell\'album Unknown Pleasures, pubblicato dall\'etichetta discografica Factory Records nel 1979. Nel 2007 il gruppo statunitense The Killers ha prodotto una cover del brano, incisa inizialmente per la colonna sonora del film Control e pubblicata per il download il 9 ottobre di quell\'anno.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Shadowplay_(song)', 'https://www.youtube.com/v/juD4ayBbHdY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Joy Division', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11456', 'NULL', 'NULL', 'NULL', '1', 'Post-punk', '316');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2921', 'Love Me (Lena Meyer-Landrut)', 'Love Me è un singolo della cantante pop tedesca Lena Meyer-Landrut, pubblicato il 13 marzo 2010 dall\'etichetta discografica Universal. È incluso nell\'album d\'esordio dell\'artista, My Cassette Player, pubblicato il 7 maggio 2010. Questo brano, scritto da Lena Meyer-Landrut e Stefan Raab, è stato presentato alla trasmissione Unser Star für Oslo 2010 insieme ai brani Satellite e Bee. Il singolo ha fatto il suo debutto alla quarta posizione della classifica tedesca, ma è scomparso dalla classifica 12 settimane dopo. Ha avuto un discreto successo anche in Austria e in Svizzera.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Love_Me_(Lena_Meyer-Landrut_song)', 'https://www.youtube.com/v/rFznS5-vb50?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Lena Meyer-Landrut', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11457', 'NULL', 'NULL', 'NULL', '1', 'Pop music', '317');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2922', 'Birthday Cake', 'Birthday Cake è il quarto singolo estratto da Talk That Talk, album del 2011 di Rihanna. Il brano era inizialmente un interlude di settantotto secondi inserito nell\'album, ma il 20 febbraio 2012 è stato pubblicata la versione completa del brano raffigurante il featuring di Chris Brown. Il brano verrà pubblicato come singolo il 6 marzo 2012. Il pezzo ha riscontrato favori misti a polemiche, date dal fatto che il cameo nel brano è Chris Brown, con cui Rihanna nel 2009 ha avuto problemi in vita privata. Un altro fatto che ha confuso i fan è il fatto che Rihanna aveva già altre tre canzoni in radio, cioè Princess of China, Take Care e Talk That Talk. Il brano è stato registrato a Copenaghen. Birthday Cake era stata pubblicata inizialmente come sesta traccia dell\'album Talk That Talk e aveva una durata di settantotto secondi. Il pezzo si era ben presto fatto notare e in rete iniziavano a girare finte versioni complete, che in realtà erano semplicemente state fatte dai fan. Tutto ciò avvenne finché i produttori del pezzo hanno annunciato su Twitter la versione completa per il febbraio 2012. Rihanna ha con questo iniziato a dare indizi ai fan per indovinare il featuring della traccia. All\'inizio si pensava a Christina Aguilera, ma poi la notizia fu smentita. Alla fine la versione completa uscì il 20 febbraio 2012 raffigurante il featuring di Chris Brown.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Birthday_Cake_(song)', 'https://www.youtube.com/v/m2JTFyg2hcU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11458', 'NULL', 'NULL', 'NULL', '1', 'NULL', '318');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2923', 'Bang a Drum', 'Bang a Drum è un brano musicale country-rock scritto da Jon Bon Jovi ed originariamente interpretato dal gruppo di cui fa parte, i Bon Jovi. Fu inserito nell\'album Blaze of Glory, ispirato dal film Young Guns II. Nel 1998 il cantante country Chris LeDoux ne interpretò una cover, con Jon Bon Jovi nel ruolo di guest star. Fu inserita nell\'album di LeDoux One Road Man, e pubblicata come singolo, che raggiunse la posizione #68 nella classifica delle canzoni country degli Stati Uniti.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Bang_a_Drum', 'https://www.youtube.com/v/p2HKQhw3578?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Jon Bon Jovi', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11459', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '319');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2924', 'Girl from the North Country', 'Girl from the North Country, conosciuta anche come Girl of the North Country,\" è una canzone scritta da Bob Dylan. È stata pubblicata per la prima volta nell\'album Freewheelin\' Bob Dylan, e successivamente in Nashville Skyline, quest\'ultima versione cantata in duetto con Johnny Cash. Gli album Real Live e The 30th Anniversary Concert Celebration contengono due esecuzioni live della canzone.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Girl_from_the_North_Country', 'https://www.youtube.com/v/9n83VFE83kM?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11460', 'NULL', 'NULL', 'NULL', '1', 'Folk music', '320');
