INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2926', 'Flamenco Sketches', 'Flamenco Sketches è un composizione jazz scritta dal trombettista americano Miles Davis e dal pianista Bill Evans. È la quinta traccia dell\'album Kind of Blue considerato il disco jazz più venduto di tutti i tempi. I musicisti che suonano Flamenco Sketches sono: Miles Davis, John Coltrane, Cannonball Adderley e Bill Evans. La canzone è caratterizzata da 5 scale modali per l\'improvvisazione e da una serie di accordi che fanno da tappeto sonoro. I modi utilizzati da Miles Davis in questa composizione sono i seguenti: Scala Ionica di DO (accordo DO7+) Scala Misolidia di LA?(accordo LA?7sus4) Scala Ionica di SI? (accordo di SI?7+) Scala minore armonica di SOL (accordo di RE7 con 6 e 9 bemolle) Scala Dorica di SOL (accordo SOLm7)', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Flamenco_Sketches', 'https://www.youtube.com/v/F3W_alUuFkA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Miles Davis', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11462', 'NULL', 'NULL', 'NULL', '1', 'Jazz', '322');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2927', 'Sleazy', 'Sleazy è un brano musicale della cantante statunitense Kesha, estratto come primo singolo promozionale dal suo EP Cannibal. Sleazy è stata scritta da Kesha Sebert, Lukasz Gottwald, Benjamin Levin, Shondrae Crawford e Klas Åhlund e prodotta da Bangladesh, Dr. Luke e Benny Blanco. È stata pubblicata su iTunes il 2 novembre 2010 ed è entrata alla posizione numero 51 negli Stati Uniti e alla 46 in Canada grazie alle forte venditi digitali. Esiste anche un remix della canzone in collaborazione con il rapper André 3000, poi inserito nell\'album di remix della cantante, uscito a marzo 2011. La collaborazione è nata quando Kesha gli ha inviato una copia della canzone, sperando che gli piacessere per collaborarvi. La critica è stata generalmente positiva: è stato detto che il pezzo è una grande canzone da club che sembra trarre ispirazione dalla musica di grandi artisti di musica dance come Jennifer Lopez, Gwen Stefani e Lil Wayne.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Sleazy_(Kesha_song)', 'https://www.youtube.com/v/n2kdCJRAiNk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Kesha', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11463', 'NULL', 'NULL', 'NULL', '1', 'Dance-pop', '323');
