INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2932', 'Jesus Want Me for a Sunbeam', 'Jesus Want Me for a Sunbeam è un brano musicale originariamente registrato dal gruppo musicale alternative rock scozzese The Vaselines per il loro EP Dying for It del 1988. Si tratta di una parodia sull\'inno dei bambini I\'ll Be a Sunbeam (\"Sarò un raggio di sole\"). Il brano è stato un successo solo nel genere indie pop fino a quando nel 1992 i The Vaselines ripubblicato il brano con un lieve cambiamento di titolo Jesus Doesn\'t Want Me for a Sunbeam (\"Gesù non mi vuole per un raggio di sole\") sulla compilation The Way of The Vaselines: A Complete History del 1992. Poi viene anche pubblicato nelle raccolte All the Stuff and More... del 2003 e Enter the Vaselines del 2009. Jesus Doesn\'t Want Me for a Sunbeam Artista Nirvana Autore/i Eugene Kelly, The Vaselines Genere Grunge Stile Edito da Tempo Riferimento Esecuzioni notevoli Pubblicazione Incisione \' Data 1994 Data seconda pubblicazione Etichetta Sub Pop Records Durata 4:37, 3:57 e 3:32 Note Campione audio Tracce Precedente Successiva – –', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Jesus_Wants_Me_for_a_Sunbeam', 'https://www.youtube.com/v/-zYwjhJuNAE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Vaselines', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11468', 'NULL', 'NULL', 'NULL', '1', 'Alternative rock', '328');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2933', 'I\'ve Seen All Good People', 'I\'ve Seen All Good People è un brano del gruppo musicale inglese di rock progressivo Yes, uscito nel 1971 e contenuto nell\'album The Yes Album. Scritta principalmente da Jon Anderson, è una delle canzoni più note della band.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I\'ve_Seen_All_Good_People', 'https://www.youtube.com/v/uJM7TdshUbw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Yes (band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11469', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '329');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2934', 'I Know There\'s an Answer', 'I Know There\'s an Answer è un brano musicale del gruppo pop rock statunitense The Beach Boys, contenuto nel loro album Pet Sounds del 1966. È la nona traccia sul disco. La canzone venne composta e prodotta da Brian Wilson su testi di Terry Sachen (all\'epoca road manager del gruppo) e Mike Love. La composizione, fortemente influenzata dalle droghe psichedeliche, fu scritta durante la seconda occasione nella quale Brian prese dell\'LSD. A proposito di ciò, successivamente Wilson affermò: \"«Si. Prendevo un sacco di droghe, ed ero dentro quel genere di cose. Penso che la canzone mi venne spontanea». Il titolo originario del brano avrebbe dovuto essere Hang on to Your Ego (\"Aggrappati al tuo Ego\"), ma parte del testo ed il titolo furono cambiati su richiesta di Mike Love perché troppo correlati all\'utilizzo di LSD. In seguito, Hang on to Your Ego è stata inclusa come bonus track nelle ristampe in formato CD di Pet Sounds degli anni novanta e duemila.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I_Know_There\'s_an_Answer', 'https://www.youtube.com/v/DtAhuchxIkk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beach Boys', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11470', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '330');
