INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2943', 'When the Ship Comes In', 'When the ship comes in (Quando la nave attraccherà) è una canzone di Bob Dylan che fa parte del repertorio del suo primo periodo, quello del folk e della contestazione. Fu pubblicata nel 1964 nell\'album The Times They Are A-Changin\', nel quale risalta per il ritmo vivace in mezzo ad altre composizioni più cupe e monotone. La parte musicale è molto semplice, basata su un giro circolare di chitarra acustica su cui si inseriscono il canto e intermezzi di armonica; il testo ricco di rime interne e allitterazioni accentua la musicalità del tutto. Il canto è profetico, nasale e appassionato: fin dal primo verso (The time will come up / when the wind will stop, Il tempo giungerà / quando il vento si fermerà) assume il tono solenne di chi annuncia la fine (o l\'inizio) del mondo. Il tema non è nuovo, ma svolto con vena esemplare: una metaforica nave viaggia in mezzo a mille insidie, diretta verso un fantasmagorico porto al quale attraccherà nell\'ora in cui i \"nemici\" saranno sconfitti. Da notare l\'uso della specifica parola \"nemici\": a quel tempo Dylan aveva una certa propensione a dividere il mondo fra ciò che riteneva buono e ciò che riteneva cattivo, fra \"nemici\" e \"amici\" a suo insindacabile giudizio, come ammetterà più tardi in My Back Pages (I screamed / lies that life is black and white, gridavo bugie che la vita è bianca e nera). Il testo si dipana fra descrizioni della natura giubilante (the fishes will laugh / as they swim out of the path, e i pesci rideranno / quando nuoteranno fuori dalla scia) e impennate metaforiche (the chains of the sea / will have busted in the night, le catene del mare/saranno spezzate nella notte), per giungere alle ultime strofe, dove si descrive il risveglio improvviso dei nemici, che si sforzano in tutti i modi di \"fare fronte alle domande\" incalzanti, senza potere nulla contro l\'umanità scatenata loro contro (and like pharao\'s tribe / they\'ll be drowned in the tide / and like goliath they\'ll be conquered, e come le armate del faraone / saranno annegati nella marea / e come Golia saranno sconfitti, è il verso conclusivo). In una semplice canzone di due minuti e mezzo Dylan riesce a condensare il secolare tema romantico dell\'uomo in lotta con un nemico enormemente più forte e la stessa lotta per i diritti civili in America, che in quegli anni viveva una fase cruciale - è facile riconoscere nei \"nemici\" che dicono \"Faremo fronte alle vostre domande\" leader politici o personaggi di rilievo desiderosi di difendersi presso l\'opinione pubblica - entrambe inserite in un\'ottica biblica di ineluttabilità e di certezza di vittoria, riscontrabile sia nelle citazioni dirette delle armate del faraone e di Davide e Golia sia e soprattutto nel tono solenne della voce; Dylan non invoca né spera, semplicemente racconta ciò che accadrà quando la nave attraccherà, senza lasciar trasparire dubbi sul dovuto e voluto trionfo. In questo senso un modello plausibile può essere quella We shall overcome cantata dal compagno di folk Pete Seeger, anch\'essa granitica nella fede in un futuro successo. In chiave country rock il brano è stato eseguito in cover da numerosi artisti fra cui, fra gli altri, Arlo Guthrie, Peter, Paul & Mary e The Pogues e al Live Aid 1985 dallo stesso Dylan con Keith Richards e Ron Wood dei Rolling Stones. È stato poi inserito nella colonna sonora del film I\'m Not There nella versione di Marcus Carl Franklin. La canzone è stata interpretata anche da Vinicio Capossela tradotta in italiano ed è presente nell\'EP \"La nave sta arrivando\" in uscita nel numero di aprile della rivista Repubblica XL.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/When_the_Ship_Comes_In', 'https://www.youtube.com/v/BXJlBGRLLWM?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11479', 'NULL', 'NULL', 'NULL', '1', 'Folk music', '339');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2944', 'Chocolate Love', 'Chocolate Love è un brano musicale interpretato dai gruppi sudcoreani Girls\' Generation e f(x) pubblicato come singolo per promuovere il telefono cellulare LG Cyon New Chocolate Phone. E\' stato pubblicato il 7 ottobre 2009, mentre gli spot televisivi sono iniziati il 10 ottobre 2009. Esistono due versioni del brano: la \"Retro Pop Version\" cantata principalmente dalle Girls\' Generation, e la \"Electronic Pop Version\" cantata principalmente dalle f(x). La versione \"Electronic Pop\" differisce dalla \"Retro Pop\" in quanto il brano è cantato più velocemente, e contiene una parte rap interpretata da Amber.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Chocolate_Love', 'https://www.youtube.com/v/A2NkGHkqDZk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'F(x) (band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11480', 'NULL', 'NULL', 'NULL', '1', 'Electronic music', '340');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2945', 'What Do You Want from Me', '\"What Do You Want from Me\" è la seconda canzone dell\'album dei Pink Floyd del 1994 The Division Bell. È stata composta da Richard Wright, David Gilmour e Polly Samson. La parte introduttiva della canzone ricorda l\'inizio live di Embryo, brano eseguito nei concerti del gruppo tra il 1970 e il 1971.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/What_Do_You_Want_from_Me_(Pink_Floyd_song)', 'https://www.youtube.com/v/X1Fqn9du7xo?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11481', 'NULL', 'NULL', 'NULL', '1', 'Chicago blues', '341');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2946', 'Flower of Scotland', 'Flower of Scotland (fiore di Scozia) è uno degli inni nazionali \"non ufficiali\" della Scozia, che ufficialmente non ne ha nessuno. Tra gli altri vengono usati a questo scopo anche Scotland the Brave e Scots Wha Hae. Flower of Scotland commemora la battaglia di Bannockburn quando l\'armata scozzese comandata da Robert Bruce sconfisse l\'esercito di Edoardo II d\'Inghilterra. Questa canzone fu composta da Roy Williamson, componente del gruppo musicale folk The Corries, nel 1967 e venne adottata dagli sportivi scozzesi negli anni settanta. Buckingham Palace ne permise l\'uso negli eventi sportivi, nonostante sia una canzone profondamente anti-inglese, e attualmente viene suonata prima degli incontri internazionali di calcio e rugby. Da segnalare una cover dell\'inno eseguita dal gruppo Folk-Power Metal Alestorm, presente sul loro debut album Captain Morgan\'s Revenge', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Flower_of_Scotland', 'https://www.youtube.com/v/zJ5fLBEpKo8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11482', 'NULL', 'NULL', 'NULL', '1', 'NULL', '342');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2947', 'Isolation (John Lennon)', 'Isolation è una canzone del 1970 scritta da John Lennon, che appare nel primo album ufficiale da solista dell\'ex-Beatle: John Lennon/Plastic Ono Band. Roger Waters, ex membro fondatore della band inglese Pink Floyd, cita Isolation come una delle sue canzoni preferite di tutti i tempi.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Isolation_(John_Lennon_song)', 'https://www.youtube.com/v/42ot0i2w8zY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'John Lennon', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11483', 'NULL', 'NULL', 'NULL', '1', 'Blues rock', '343');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2948', 'The Lady Is a Tramp', 'The Lady Is a Tramp è un brano musicale facente parte del musical del 1937 Babes in Arms di Rodgers and Hart, nel quale veniva interpretato dall\'ex attrice bambina Mitzi Green. La canzone prende in giro l\'alta società di New York e la sua rigida etichetta . Il brano è diventato uno standard pop. Fra le prime registrazione del brano nel 1937 si possono citare quelle di Tommy Dorsey and His Orchestra featuring Edythe Wright, Midge Williams and Her Jazz Jesters, Sophie Tucker e Bernie Cummins per l\'etichetta discografica Vocalion. Lena Horne registrò il brano con l\'orchestra della Metro Goldwyn Mayer il 30 marzo 1948 e la sua performance fu utilizzata nel film, Words and Music, una biografia romanzata di Rodgers ed Hart. The Lady Is a Tramp fu registrato anche da Frank Sinatra ed Ella Fitzgerald negli anni cinquanta e da Shirley Bassey nei sessanta, diventando in entrambi i casi una delle loro interpretazioni più celebri. Anche Sammy Davis, Jr. fece entrare il brano nel suo repertorio da eseguire dal vivo. Interpretazioni meno convenzionali del brano includono quelle di Alice Cooper, Yes, Tokyo Jihen r They Might Be Giants. Le Supremes incisero il brano sul loro album tributo a Rodgers and Hart intitolato The Supremes Sing Rodgers & Hart. Il gruppo ne registrò anche una versione dal vivo, eseguita presso il prestigioso night club Copacabana di New York nel 1967. Madonna ed Anthony Kiedis dei Red Hot Chili Peppers interpretarono il brano dal vivo in occasione del millesimo episodio del The Arsenio Hall Show. Lily Allen e Jools Holland e la sua Rhythm and Blues Orchestra hanno interpretato una versione del brano durante l\'annuale special di capodanno del Jools Hollands Hootenanny. Kerry Ellis ha interpretato il brano durante l\'Henley festival il 10 luglio 2009, in seguito trasmesso da BBC Radio 2 il 28 agosto 2009. Durante la serie televisiva Glee, il brano è stato interpretato da due dei protagonisti della serie, Noah Puckerman e Mercedes Jones, nel corso dell\'episodio Senza voce. Anche durante la serie televisiva The Playboy Club il brano è stato interpretato dal personaggio interpretato da Laura Benanti.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_Lady_Is_a_Tramp', 'https://www.youtube.com/v/ZPAmDULCVrU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11484', 'NULL', 'NULL', 'NULL', '1', 'NULL', '344');
