INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2951', 'Kashmir (brano musicale)', 'Kashmir è il titolo di una famosa canzone del gruppo hard rock inglese Led Zeppelin. Compare nell\'album Physical Graffiti. È annoverata al 140º posto nella lista delle 500 migliori canzoni secondo Rolling Stone.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Kashmir_(song)', 'https://www.youtube.com/v/CydqCNKrGmE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Led Zeppelin', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11487', 'NULL', 'NULL', 'NULL', '1', 'Hard rock', '347');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2952', 'Stone Cold Crazy', 'Stone Cold Crazy è un brano della band rock britannica dei Queen, pubblicato nel 1974 all\'interno dell\'album Sheer Heart Attack. Composto da Freddie Mercury nel 1970 per la band nella quale allora militava, i Wreckage, Stone Cold Crazy è considerato da alcuni come uno dei brani precursori dell\'heavy metal, nonostante il genere si fosse in realtà già ufficialmente affermato da alcuni anni, grazie a svariate altre band come Led Zeppelin, Black Sabbath e Deep Purple. Il brano, proposto dalla band in quasi tutti i suoi concerti nei primi anni della loro carriera, è stato pubblicato come singolo quindici anni dopo la pubblicazione, nel 1989, come lato B del singolo The Miracle. Per l\'occasione è stata pubblicata la versione live proposta durante un concerto tenuto nel 1974 al Rainbow Theatre. Brian May nel DVD compreso nel Queen Rock Montreal, uscito nel 2007, dice \"la canzone fu composta da Freddie con una chitarra elettrica\".', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Stone_Cold_Crazy', 'https://www.youtube.com/v/Mmt2mgmrSUw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Queen (band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11488', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '348');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2953', 'One After 909', 'One After 909 (noto anche come The One After 909) è un brano dei Beatles, composto da John Lennon e Paul McCartney e presente nell\'album Let It Be. Il pezzo pubblicato è un rock ruvido e folgorante. Era stato scritto nel 1957 da Lennon e McCartney (anche se era opera principalmente di John) sotto l’influsso del rock\'n\'roll di Chuck Berry, e assieme a I Call Your Name è la prima composizione del duo a essere pubblicata su un disco di successo. Il pezzo, che rimase nella scaletta live del gruppo per cinque anni fino al 1962, si richiama per la prima volta nella carriera del gruppo di Liverpool alla matrice delle railroad songs statunitensi, ripresa in Inghilterra da artisti britannici skiffle come Lonnie Donegan, il Chas McDevitt Skiffle Group e Johnny Duncan. Registrato il 5 marzo 1963 (durante le sedute di registrazione di From Me to You e Thank You Girl), fu giudicato non adatto alla pubblicazione e per questo motivo venne accantonato. Dopo altri sei anni di abbandono, il brano fu ripescato e registrato dapprima in sala d’incisione il 28 e 29 gennaio 1969 e il giorno successivo nel \"Rooftop Concert\", con una coda di Lennon che beffardamente chiude il pezzo accennando le note iniziali di Danny Boy, una canzone eseguita fra gli altri da Conway Twitty nel 1959. Versioni differenti del brano, relative alla seduta di incisione tenuta il 5 marzo 1963, sono incluse nell\'album Anthology 1.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/One_After_909', 'https://www.youtube.com/v/l3fZynJUV-8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11489', 'NULL', 'NULL', 'NULL', '1', 'Rock and roll', '349');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2954', 'Gimme Shelter (brano musicale)', 'Gimme Shelter è una canzone del gruppo rock The Rolling Stones. Fu pubblicata per la prima volta come traccia di apertura dell\'album del 1969 Let It Bleed. Benché la prima parola del titolo viene pronunciata \"Gimmie\", viene comunemente accreditata come \"Gimme\", anche nei dischi dei Rolling Stones. Nonostante la canzone non sia mai stata pubblicata come disco singolo, Gimme Shelter è da sempre considerata una delle canzoni più rappresentative della carriera del gruppo ed in generale della musica rock, al punto che la rivista Rolling Stone ha classificato il brano alla posizione 38 della Lista delle 500 migliori canzoni della storia. Nel corso degli anni sono state registrate numerose cover del brano, fra cui si ricordano principalmente quelle di Merry Clayton, Grand Funk Railroad, Goo Goo Dolls, Inspiral Carpets, John Mellencamp, Meat Loaf, Hawkwind, Michael Hedges, London Symphony Orchestra, Patti Smith, Stereophonics, Sheryl Crow, Keith Urban e Alicia Keys, Angélique Kidjo, Joss Stone, Thunder, Sisters of Mercy e Puddle of Mudd.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Gimme_Shelter', 'https://www.youtube.com/v/CkzKfLeN4ME?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Rolling Stones', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11490', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '350');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2955', 'Son of Your Father', 'Son of Your Father è un brano country rock scritto ed interpretato da Elton John; il testo è di Bernie Taupin.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Son_of_Your_Father', 'https://www.youtube.com/v/QXbrS3Msgww?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Elton John', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11491', 'NULL', 'NULL', 'NULL', '1', 'Country rock', '351');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2956', 'The Masterplan (brano musicale)', 'The Masterplan è un brano della band inglese Oasis, pubblicato per la prima volta come b-side del singolo Wonderwall nel 1995. Sicuramente il migliore lato b degli Oasis. Nel 1998 infatti fu inserito nella raccolta di b-side del gruppo, che prende il nome proprio dalla canzone.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_Masterplan_(song)', 'https://www.youtube.com/v/IErcps_Zjmw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Oasis (band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11492', 'NULL', 'NULL', 'NULL', '1', 'Britpop', '352');
