INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2958', 'A Change Is Gonna Come', 'A Change Is Gonna Come è una canzone del cantante R&B Sam Cooke, scritta ed originariamente registrata nel 1963, e pubblicata per la RCA Victor poco dopo la sua morte nel 1964. Benché si sia trattato di un modesto successo per Cooke, soprattutto in confronto dei suoi precedenti singoli, la canzone assunse particolare importanza negli anni sessanta in quanto inno del movimento per i diritti civili degli afroamericani. Anche per tale ragione la canzone ha assunto sempre più importanza nel corso degli anni.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/A_Change_Is_Gonna_Come', 'https://www.youtube.com/v/gbO2_077ixs?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Sam Cooke', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11494', 'NULL', 'NULL', 'NULL', '1', 'R&B', '354');
