INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2960', 'That Smell', 'That Smell è una canzone della band americana Lynyrd Skynyrd. Scritta dal cantante Ronnie Van Zant e dal chitarrista Allen Collins, è stata inizialmente rilasciata nell\'album Street Survivors del 1977. La canzone parla di droghe e alcool, ed è stata scritta in seguito ad un incidente in auto del chitarrista Gary Rossington, ubriaco. Una cover è presente nell\'EP Another 700 Miles del gruppo alternative rock 3 Doors Down.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/That_Smell', 'https://www.youtube.com/v/zBZrm-gHw1M?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Lynyrd Skynyrd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11496', 'NULL', 'NULL', 'NULL', '1', 'Southern rock', '356');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2961', 'Corporal Clegg', 'Corporal Clegg è un brano musicale dell\'album del 1968 A Saucerful of Secrets della progressive rock band inglese Pink Floyd. Clegg è un nome burlesco inglese derivato probabilmente da cleg (tafano). È stata scritta da Roger Waters ed hanno partecipato David Gilmour, Nick Mason e Richard Wright ai cori.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Corporal_Clegg', 'https://www.youtube.com/v/Nn_E4bGgYJE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11497', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic_rock', '357');
