INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2965', 'You Still Believe in Me', 'You Still Believe in Me è il titolo di un brano musicale dei The Beach Boys, seconda traccia dell\'album Pet Sounds pubblicato nel 1966. Il testo della canzone, originariamente intitolata In My Childwood (\"nella mia infanzia\") come nostalgica incursione nell\'infanzia, ha come autore il paroliere Tony Asher. Nella versione mono, Brian Wilson canta insieme al fratello Carl, con la voce di Mike Love che si inserisce nei cori finali, mentre la versione stereo si caratterizza per la sola voce di Brian.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/You_Still_Believe_in_Me', 'https://www.youtube.com/v/FC1SJTmG4Ts?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beach Boys', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11501', 'NULL', 'NULL', 'NULL', '1', 'Baroque pop', '361');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2966', 'I Me Mine', 'I Me Mine è un brano dei Beatles incluso nell\'album Let It Be. Si tratta dell\'ultimo brano registrato ufficialmente del gruppo inteso come tale, anche se alle sessioni di registrazione non era presente John Lennon, in quel periodo in vacanza in Danimarca e comunque già da tempo allontanatosi dalla band. In ordine cronologico, l\'ultima canzone che i Beatles avevano inciso in studio era stata Because per l\'album Abbey Road, ultimata il 5 agosto dell\'anno precedente, ma anche in quell\'occasione – assente Ringo che non aveva parte attiva nel pezzo – i componenti del gruppo erano solo tre. Nel caso di I Me Mine vi erano, tuttavia, degli obblighi contrattuali da rispettare a causa del film Let It Be - Un giorno con i Beatles, cosa questa che costrinse i Beatles a tornare in sala d\'incisione.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I_Me_Mine', 'https://www.youtube.com/v/ed88MqPh--c?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11502', 'NULL', 'NULL', 'NULL', '1', 'Hard rock', '362');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2967', 'Good Rockin\' Tonight', 'Good Rocking Tonight era in origine una canzone jump blues edita nel 1947 dallo stesso autore, Roy Brown e fu oggetto di cover successive da parte di molti altri artisti. Il brano include il famoso ritornello: «Well I heard the news, there\'s good rocking tonight!» (in italiano \"Ho sentito le novità, C’è del buon rock stanotte\").', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Good_Rocking_Tonight', 'https://www.youtube.com/v/6FeWJHUB8aU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Roy Brown (blues musician)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11503', 'NULL', 'NULL', 'NULL', '1', 'Jump blues', '363');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2968', 'Spanish Castle Magic', 'Spanish Castle Magic è una canzone del secondo album di Jimi Hendrix del 1967 Axis: Bold as Love. La canzone parla di un viaggio immaginario attraverso un drago volante dove ci sono fantastiche visioni (ad es. nuvole inondate di zucchero filato) tutto questo visto nelle menti di tutti. L\'origine della canzone è una giornata felice vissuta da Jimi quando suonò in un club di Des Moines vicino a Seattle chiamato The Spanish Castle, da qui il titolo della canzone. Alla fine della canzone parla invece delle sue frustrazioni.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Spanish_Castle_Magic', 'https://www.youtube.com/v/JdRT9XaPHqc?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Jimi Hendrix Experience', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11504', 'NULL', 'NULL', 'NULL', '1', 'Blues rock', '364');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2969', 'Going to California', 'Going to California è la settima e penultima canzone eseguita dai Led Zeppelin nell\'album Led Zeppelin IV, rilasciato nel 1971. La malinconica musicalità folk della canzone, con la voce di Robert Plant accompagnata dalla chitarra acustica di Jimmy Page e dal mandolino di John Paul Jones, contrasta con l\'heavy rock delle altre tracce. Il testo si riferisce alla cantautrice Joni Mitchell, della quale sia Plant che Page erano infatuati. Nelle esecuzioni dal vivo del brano, Plant pronunciava il nome \"Joni\" dopo ogni strofa.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Going_to_California', 'https://www.youtube.com/v/luDgb5vVHuA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Led Zeppelin', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11505', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '365');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2970', 'Cymbaline', 'Cymbaline è una canzone della progressive rock band Pink Floyd, uscito nel 1969 dall\'album Soundtrack from the Film More. Nella canzone si fà riferimento ad un mago-eroe: \"dr. Strange\". Il brano presenta un arrangiamento di chitarra con corde di nylon, basso, pianoforte, batteria, bongo, e organo Farfisa. I Pink Floyd Hanno suonato \"Cymbaline\" dal 1969 fino al loro ultimo spettacolo del 1971. La canzone è stata coperta dal collega inglese gruppo space rock Hawkwind. La versione del 1996 ristampa in CD del loro album di debutto omonimo (1970) include \"Cymbaline\" come traccia 13, nella sezione bonus tracks.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Cymbaline', 'https://www.youtube.com/v/qLw0C7CvL_8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11506', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '366');
