INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2972', 'Talkin\' John Birch Paranoid Blues', 'Talkin\' John Birch Paranoid Blues, conosciuta anche come Talkin\' John Birch Society Blues e Talkin\' John Birch Blues, è una canzone scritta da Bob Dylan nel 1962 e contenuta nel triplo album del 1991 intitolato The Bootleg Series Volumes 1–3 (Rare & Unreleased) 1961–1991. Il brano è contenuto anche nelle rarissime prime copie stampate dell\'album The Freewheelin\' Bob Dylan, prima che il brano fosse eliminato e rimpiazzato da un altro per ordine della CBS.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Talkin\'_John_Birch_Paranoid_Blues', 'https://www.youtube.com/v/AylFqdxRMwE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11508', 'NULL', 'NULL', 'NULL', '1', 'Talking blues', '368');
