INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2976', 'Two of Us', 'Two of Us è un brano musicale del 1970 del gruppo britannico The Beatles e contenuta nel loro ultimo album Let it Be ed anche nell\'album Let It Be... Naked e nella raccolta Anthology 3. La canzone è stata scritta da Paul McCartney (pur essendo attribuita, come sempre, alla coppia Lennon/McCartney) ed è un duetto tra il compositore e John Lennon. In un\'intervista rilasciata a Playboy nel 1980 però Lennon affermò, probabilmente confondendosi con un\'altra canzone, di aver scritto lui questo pezzo. Two of Us parla della relazione fra Paul McCartney e Linda Eastman, colei che da lì a poco sarebbe diventata sua moglie.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Two_of_Us_(song)', 'https://www.youtube.com/v/iobhxO7W6Ow?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11512', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '372');
