INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2982', 'The Battle of Evermore', 'The Battle of Evermore è una canzone della famosa rock band Led Zeppelin, pubblicata nel 1971 e contenuto nell\'album Led Zeppelin IV. Si tratta di un brano suonato interamente a mandolino e chitarra folk, scritto da Jimmy Page mentre suonava il mandolino dell\'amico John Paul Jones. The Battle of Evermore è l\'unica canzone dei Led Zeppelin in cui Robert Plant non è l\'unico cantante: vi è infatti un duetto con Sandy Denny, cantante del gruppo folk Fairport Convention. In live, The Battle of Evermore è stata presentata con Plant alla voce principale, Jones alla seconda voce al posto di Denny, e alla chitarra folk, e Page al mandolino. Il testo della canzone è pieno di riferimenti alle opere di Tolkien, di cui Plant era un grande appassionato: si citano personaggi come Frodo, Galadriel, Gandalf, Aragorn, tutti appartenenti alla saga del Signore degli Anelli, oltre a luoghi e avvenimenti come i Campi del Pelennor, la battaglia del Fosso di Helm e Le due Torri. Il testo potrebbe essere ispirato anche alle battaglie dell\'Apocalisse e la vittoria del Bene sul Male, ma l\'ispirazione tolkieniana sembra prevalere.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_Battle_of_Evermore', 'https://www.youtube.com/v/mHJH0ETi8D4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Led Zeppelin', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11518', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '378');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2983', 'Jai Ho', 'Jai Ho è una canzone scritta in hindi da A.R. Rahman e Gulzar, ed interpretata da Sukhwinder Singh e Rahman, per la colonna sonora del film The Millionaire del 2008. In esso accompagna una coreografia in stile Bollywood. La canzone figura anche la partecipazione vocale di Tanvi Shah, Mahalakshmi Iyer e Vijay Prakash. Jai Ho fu originariamente composta per il film del 2008 Yuvvraaj, ma fu scartata dal regista Subhash Ghai, che non la ritenne adatta alla voce dell\'attore Zayed Khan che avrebbe dovuto interpretarla nel film. In seguito, A.R. Rahman ha rivelato in una intervista che fu proprio Ghai a chiedergli di utilizzare le parole Jai Ho nella canzone. Dopo l\'inserimento del brano in The Millionaire, il brano ha vinto l\'oscar per la migliore canzone, battendo Down to Earth di Peter Gabriel e O... Saya, sempre tratta dalla colonna sonora di The Millionaire. La parola Jai Ho può essere tradotta come vittoria, ma anche come elogio, saluto o Hallelujah. La maggior parte del testo è in lingua hindi, con alcune parti in spagnolo. Il 23 febbraio 2009 Rahman ha interpretato il brano dal vivo durante The Oprah Winfrey Show. Su richiesta della Winfrey, A.R. Rahman ha detto che Jai Ho vuol dire Che la vittoria possa essere tua.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Jai_Ho', 'https://www.youtube.com/v/Yc5OyXmHD0w?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11519', 'NULL', 'NULL', 'NULL', '1', 'World_music', '379');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2984', 'Golden Slumbers', 'Golden Slumbers è un brano musicale dei Beatles. La canzone inizia la progressione che porta alla fine dell\'album, ed è seguita da Carry That Weight. Le due canzoni sono state registrate insieme come un unico pezzo, ed entrambe sono state scritte da Paul McCartney (accreditata a Lennon/McCartney).', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Golden_Slumbers', 'https://www.youtube.com/v/2qP4Ye15J0Y?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11520', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '380');
