INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2986', 'Vincent (brano musicale)', 'Vincent è un brano musicale di Don McLean, tratto dall\'album American Pie del 1971. È dedicato al quadro Notte stellata di Vincent van Gogh. Il pezzo è stato reso noto in Italia dallo sceneggiato televisivo Lungo il fiume e sull\'acqua del 1973 di cui è stato colonna sonora. Francesco De Gregori l\'ha tradotta in italiano con il titolo Come un anno fa, e la sua versione è stata incisa da Little Tony; un\'altra traduzione è stata realizzata ed incisa da Roberto Vecchioni. Il gruppo punk rock dei NOFX ha creato una cover di questa canzone, inserendola nell\'album 45 or 46 Songs That Weren\'t Good Enough to Go on Our Other Records.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Vincent_(song)', 'https://www.youtube.com/v/F_mwfgiBhUk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Don McLean', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11522', 'NULL', 'NULL', 'NULL', '1', 'Folk music', '382');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2987', 'Speak Softly Love', 'Speak Softly Love (Love Theme From \"The Godfather\") è un brano musicale scritto per la colonna sonora del film Il padrino, il primo film della trilogia. Mentre la sua celeberrima versione strumentale è conosciuta semplicemente come The Godfather theme, Speak Softly Love è la versione dotata di testo. Le parole del brano furono scritte da Larry Kusik, mentre la musica da Nino Rota. Il brano, della durata di 2:41, compare anche nella parte II e III del film.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Speak_Softly_Love_(Love_Theme_from_The_Godfather)', 'https://www.youtube.com/v/PQBW6G0hSrs?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11523', 'NULL', 'NULL', 'NULL', '1', 'NULL', '383');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2988', 'Kiss the Girl', 'Kiss The Girl (nella versione in italiano Baciala), è una canzone della Disney del 1989 del cartone animato La sirenetta, scritta da Alan Menken (musica) e da Howard Ashman (testo). Nel film, è cantata da Samuel E. Wright, che dà la voce al granchio Sebastian, il quale canta il brano nel tentativo di convincere Eric a baciare Ariel.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Kiss_the_Girl', 'https://www.youtube.com/v/tXmLRHnoSAs?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Samuel E. Wright', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11524', 'NULL', 'NULL', 'NULL', '1', 'Calypso music', '384');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2989', 'Ticket to Ride', 'Ticket to Ride è una canzone dei Beatles del 1965, scritta in maggioranza da John Lennon, poi abbellita da Paul McCartney con un semplice ma azzeccato riff. Nella lista delle 500 migliori canzoni secondo Rolling Stone si piazza alla 384ª posizione. Si trova nell\'album Help! e viene eseguita anche nel film che porta lo stesso titolo dell\'album. Riscosse un buon successo in USA rimanendo prima in classifica per tre settimane, in Inghilterra rimase invece al vertice della classifica solo per una settimana. In Italia il disco stazionò nella hit-parade per quattro settimane, raggiungendo, al massimo, solo il tredicesimo posto della classifica. Non è chiara l\'origine della canzone: alcuni dicono che si riferisca alla riuscita di un esame di guida di Lennon, alcuni all\'uscita dalla sua vita di una ragazza, altri ritengono sia stata ispirata dall\'acquisto di un biglietto ferroviario per Ryde. Dopo lo scioglimento dei Beatles, Lennon affermò che Ticket to Ride è stata la prima canzone heavy metal in assoluto; infatti la canzone presenta molte caratteristiche di questo genere. La canzone fu accolta con enorme entusiasmo anche dai critici musicali dell\'epoca, come ad esempio Richie Unterberger di \"Allmusic\", che evidenziarono soprattutto l\'evoluzione tecnica dei musicisti, la base ritmica senza dubbio all\'avanguardia per quei tempi, la chitarra elettrica incisiva e penetrante e il lavoro alla batteria di Ringo Starr martellante ed esaustivo come mai in passato. Nel 1967 la band di Rock psichedelico Vanilla Fudge registrò una cover di questa canzone. Una versione orchestrale è a stento udibile alla fine dell\'album dei Pink Floyd The Dark Side of the Moon, molto probabilmente a causa del fatto che i pezzi di quest\'album furono registrati su bobine precedentemente usate negli Abbey Road Studios. Una sorprendente cover fu quella incisa dai Carpenters, nel 1969, che la trasformarono in una lenta ballata.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Ticket_to_Ride', 'https://www.youtube.com/v/VMxyK9azXR4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11525', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '385');
