INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2998', 'Instrumedley', 'L\'Instrumedley (abbreviazione di Instrumental Medley), chiamato anche The Dance of Instrumentals, è un medley strumentale suonato dalla band progressive metal statunitense dei Dream Theater nei tournée degli album Six Degrees of Inner Turbulence e Train of Thought. È stato suonato la prima volta il 10 agosto 2002 a Los Angeles nel World Tourbulence. Si può ascoltare nel triplo cd o doppio dvd chiamato Live at Budokan. Al termine della ripresa di Universal Mind la band esegue una breve citazione dell\'Entrata dei gladiatori (la musica associata alle esibizioni circensi), già presente nel brano originale: in alcune esibizioni, durante questo spezzone, James LaBrie ha attraversato il palco a bordo di un monopattino.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Instrumedley', 'https://www.youtube.com/v/tM0Y1Ajqq7g?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Dream Theater', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11534', 'NULL', 'NULL', 'NULL', '1', 'Progressive metal', '394');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('2999', 'Circle the Drain', 'Circle the Drain è un brano musicale della cantante statunitense Katy Perry, pubblicato il 10 agosto 2010 come singolo promozionale dal suo secondo album Teenage Dream e promosso dall\'etichetta discografica Capitol Records. Il singolo è stato scritto da Katy Perry, Christopher \"Tricky\" Stewart e Monte Neuble e prodotto dal secondo. È entrato alle posizioni numero 30, 36 e 58 nelle classifiche rispettivamente del Canada, della Nuova Zelanda e degli Stati Uniti. Il testo di Circle the Drain parla della continua assunzione di droghe di un ex fidanzato, che è la causa della tensione creatasi nella coppia. Molti media hanno poi riportato che la persona in questione è Travie McCoy. I critici si sono divisi sulla canzone: alcuni hanno considerato la cantante un\'ipocrita, sentendo il testo degli altri brani sull\'album, mentre altri hanno trovato positivo il fatto che la cantante abbia mostrato un altro lato di sé.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Circle_the_Drain_(song)', 'https://www.youtube.com/v/Q3gAPBmJQBE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Katy Perry', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11535', 'NULL', 'NULL', 'NULL', '1', 'Electronic rock', '395');
