INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3002', 'Lucifer Sam', 'Lucifer Sam è una canzone dei Pink Floyd, inserita nel loro album di debutto, The Piper at the Gates of Dawn. La canzone è costruita su di una riff discendente, il cui elemento dominante è la chitarra elettrica di Syd Barrett, effettata con quello che oggi si chiamerebbe \"delay\"; il suono risultante è stato spesso definito come un sinistro Duane Eddy. L\'effetto viene aumentato dal resto della strumentazione, che segue il ritmo di Barrett. Nonostante il testo parli frequentemente di Lucifer Sam come un gatto, spesso sono sorte alcune controversie riguardanti il fatto che forse, invece, Barrett volesse riferirsi all\'amante (hip cat), reale o immaginario, che fece finire la sua relazione con la fidanzata di allora, Jenny Spires (la Jennifer Gentle della canzone). Ad ogni modo, Sam era semplicemente il soprannome che Barrett affibbiava al proprio animale domestico, il gatto Rover; la traccia era originariamente stata intitolata Percy the Rat Catcher durante le sessioni di registrazione.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Lucifer_Sam', 'https://www.youtube.com/v/wbIMx2MYNXk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11538', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '398');
