INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3005', 'All Together Now', 'All Together Now è un brano musicale registrato dai Beatles il 12 maggio 1967 e pubblicato per la prima volta negli Stati Uniti il 13 gennaio 1969. La canzone è composta da un testo molto semplice ed elementare, con una melodia che ricorda le canzoni cantate dai bambini durante i loro giochi. Il video della canzone inoltre appare in una sequenza del film Yellow Submarine. Il brano è stato registrato il 12 maggio 1967 presso gli Abbey Road Studios e mixato nello stesso giorno, ma non è stato pubblicato fino al 13 gennaio 1969, quando è apparso nell\'album Yellow Submarine. Successivamente, All Together Now è stata riarrangiata da Ferdinando Arnò e utilizzata per alcuni spot della TIM.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/All_Together_Now', 'https://www.youtube.com/v/XLnK3agYQIw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11541', 'NULL', 'NULL', 'NULL', '1', 'Skiffle', '401');
