INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3009', 'Sing, Sing, Sing (With a Swing)', 'Sing, Sing, Sing (With a Swing) è un brano musicale del 1936, scritto da Louis Prima ed originariamente registrato da Prima con la New Orleans Gang che lo pubblicò nel 1936 attraverso l\'etichetta Brunswick Records (con It\'s Been So Long come lato b). E\' considerato uno dei brani più rappresentativi del genere big band e swing. Del brano hanno interpretato celebri cover Fletcher Henderson e Benny Goodman. Originariamente il brano era intitolato Sing, Bing, Sing, in riferimento a Bing Crosby, benché poi si preferì utilizzare il titolo Sing, Sing, Sing per poter utilizzare il brano in un contesto più ampio.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Sing,_Sing,_Sing_(With_a_Swing)', 'https://www.youtube.com/v/62ZSQUyU00s?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Louis Prima', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11545', 'NULL', 'NULL', 'NULL', '1', 'Big band', '405');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3010', 'Coming Back to Life', 'Coming Back to Life è un brano musicale della progressive rock band inglese Pink Floyd, contenuto nell\'album The Division Bell. È stato scritto e arrangiato interamente da David Gilmour.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Coming_Back_to_Life', 'https://www.youtube.com/v/nVxnNNGjubg?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11546', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '406');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3011', 'Atom Heart Mother (brano musicale)', 'Atom Heart Mother è una suite musicale in sei parti, di quasi 24 minuti, scritta dai Pink Floyd e Ron Geesin, un compositore d\'avanguardia. Occupa l\'intera prima facciata dell\'omonimo album in vinile del 1970.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Atom_Heart_Mother_(suite)', 'https://www.youtube.com/v/yu9F44lHkYY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11547', 'NULL', 'NULL', 'NULL', '1', 'Avant-garde music', '407');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3012', 'Father and Son (brano musicale)', 'Father and Son è un popolare brano musicale scritto ed originariamente interpretato dal cantante inglese Cat Stevens nel suo album del 1970 Tea for the Tillerman. La canzone è impostata come un dialogo fra un padre che non capisce il desiderio del figlio di cominciare una nuova vita, ed il figlio che non riesce a spiegare il perché ma sa che deve farlo. Per la parte del padre, Stevens canta con un tono più profondo, mentre usa un registro più alto ed emotivamente più coinvolgente per \"recitare\" la parte del figlio. Stevens inizialmente scrisse il brano come parte di un progetto per un musical con l\'attore Nigel Hawthorn chiamato Revolussia, ed ambientato durante la rivoluzione russa. Nelle intenzioni originale la canzone doveva parlare di un ragazzo che voleva unirsi ai moti rivoluzionari, nonostante il parere contrario del genitore. Il progetto per il musical non si realizzò, ma \"Father and Son\" vide la luce lo stesso, in un contesto più generico, che rifletteva non soltanto i conflitti generazionali dell\'epoca di Cat Stevens, ma di qualunque periodo. Benché mai pubblicato come singolo, \"Father and Son\" ricevette una massiccia programmazione radiofonica, e contribuì sostanzialmente a far conoscere il cantante. Nel 1970 il brano fu scelto come lato B del singolo Moon Shadow, edito dalla Island Records.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Father_and_Son_(song)', 'https://www.youtube.com/v/wIuc_6uE7ys?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Cat Stevens', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11548', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '408');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3013', 'Ne me quitte pas', 'Ne me quitte pas è una canzone di Jacques Brel scritta nel 1958 e pubblicata la prima volta l\'11 settembre 1959 nell\'album La Valse à Mille Temps. È una delle canzoni più note dell\'autore belga, reincisa più volte da Brel e reinterpretata da numerosi autori nel corso del Novecento.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Ne_me_quitte_pas', 'https://www.youtube.com/v/i2wmKcBm4Ik?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11549', 'NULL', 'NULL', 'NULL', '1', 'NULL', '409');
