INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3015', 'Outside the Wall', '\"Outside the Wall\" è una canzone dei Pink Floyd pubblicata nel 1979, all\'interno dell\'album The Wall, scritta interamente da Roger Waters. Questo brano rappresenta la conclusione dell\'album, e non è incentrato sul resto della storia, la cui conclusione è effettivamente in The Trial, dato che non racconta ciò che è accaduto a Pink dopo la caduta del muro. È piuttosto una sorta di morale della storia.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Outside_the_Wall', 'https://www.youtube.com/v/uZqS7LAyup4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11551', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '411');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3016', 'Foxy Lady (Jimi Hendrix)', 'Foxy Lady è una canzone del primo album di Jimi Hendrix del 1967 Are You Experienced; nell\'edizione americana appare a volte come Foxey Lady. La canzone è forse dedicata alla sua ragazza del tempo, Kathy Etchingham che ha detto più volte di esser stata la sua ispirazione per \"Foxy Lady\". La canzone è conosciuta per il suo riff e per il suo assolo oltre a essere uno dei primi esempi di feedback acustico usato a fini artistici nel rock.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Foxy_Lady', 'https://www.youtube.com/v/R0KgjQEiME4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Jimi Hendrix Experience', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11552', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '412');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3017', 'Revolution (The Beatles)', 'Revolution è una canzone dei Beatles, scritta da John Lennon anche se attribuita alla coppia Lennon/McCartney. La canzone è apparsa in due differenti versioni: una elettrica di genere \"Hard\", uscita come Lato B dell\'hit Hey Jude, e l\'altra, invece, una lenta ballata acustica denominata Revolution 1, pubblicata nell\'album The Beatles (White Album). Nello stesso album è stata incisa un\'altra canzone dal titolo Revolution 9, di genere sperimentale e di avanguardia.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Revolution_9', 'https://www.youtube.com/v/KrkwgTBrW78?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11553', 'NULL', 'NULL', 'NULL', '1', 'Experimental music', '413');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3018', 'If I Didn\'t Care', 'If I Didn\'t Care è un brano musicale scritto da Jack Lawrence, originalmente inciso dai The Ink Spots nel 1939. Lawrence ha dichiarato di avere spedito, prima della pubblicazione del brano, una sua registrazione ad alcuni amici, i quali avevano avuto una reazione perlopiù negativa, ma lui ha deciso comunque di pubblicarlo e successivamente è diventato uno dei suoi più grandi successi. La canzone nella sua versione originale, sotto la casa discografica Decca, è divenuta una fra le poche ad aver venduto più di 10 milioni di copie nel mondo, precisamente 19 milioni. Negli anni \'50 sia The Hilltoppers e Connie Francis incisero il brano, come fece David Cassidy nel 1974. Un\'altra cover importante fu realizzata da The Platters. Nel 1970, il gruppo soul The Moments (successivamente conosciuto come Ray, Goodman & Brown) ebbe successo raggiungedo la 44 posizione nella Billboard Hot 100. Una cover è stata realizzata dai Madness per il loro album Wonderful nel 1999. È stata aggiunta alla Grammy Hall of Fame al numero 271 della lista \"Songs of the Century\".', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/If_I_Didn\'t_Care', 'https://www.youtube.com/v/rvwfLe6sLis?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Ink Spots', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11554', 'NULL', 'NULL', 'NULL', '1', 'Rhythm and blues', '414');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3019', 'Elderly Woman Behind the Counter in a Small Town', 'Elderly Woman Behind the Counter in a Small Town è una canzone dei Pearl Jam contenuta nell\'album Vs. del 1993. Una versione acustica può essere trovata sul singolo del brano Go. La canzone è inclusa anche nell\'album del 2004 Rearviewmirror: Greatest Hits 1991-2003.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Elderly_Woman_Behind_the_Counter_in_a_Small_Town', 'https://www.youtube.com/v/YF-5vW4GbsQ?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pearl Jam', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11555', 'NULL', 'NULL', 'NULL', '1', 'Acoustic music', '415');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3020', 'Where to Now St. Peter?', 'Where to Now St. Peter? è un brano interpretato da Elton John e scritto dallo stesso cantante col testo di Bernie Taupin.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Where_to_Now_St._Peter%3F', 'https://www.youtube.com/v/mOHLQg4VfqE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11556', 'NULL', 'NULL', 'NULL', '1', 'Progressive_rock', '416');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3021', 'The Elements: Fire', 'The Elements: Fire, conosciuto anche con i titoli The Elements, Fire, e Mrs. O\'Leary\'s Cow, è un brano strumentale composto dal musicista statunitense Brian Wilson. La traccia doveva originariamente essere inclusa nel celebre \"album perduto\" dei Beach Boys del 1967 intitolato SMiLE, come parte di una suite ispirata ai quattro elementi naturali: acqua, fuoco, terra, aria. Tuttavia il brano vide la luce soltanto nel 2004, quando, riregistrato e reintitolato Mrs. O\'Leary\'s Cow, venne incluso nell\'album solista di Wilson intitolato Brian Wilson Presents Smile, sua personale versione dello SMiLE mai pubblicato. Nel 2011 The Elements: Fire è stata infine pubblicata nella sua forma originale ancorché incompleta nel cofanetto The Smile Sessions, box set antologico che ricostruisce filologicamente l\'album originale.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_Elements:_Fire', 'https://www.youtube.com/v/31pCY1uDRzY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11557', 'NULL', 'NULL', 'NULL', '1', 'Instrumental_rock', '417');
