INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3024', 'Alabama Song', 'L\'Alabama Song (conosciuta anche come Whisky Bar, Moon over Alabama o Moon of Alabama) era originariamente un brano scritto nella Hauspostille di Bertolt Brecht. È stata messa in musica la prima volta da Kurt Weill nello stesso anno. Successivamente verrà ripresa da molti altri autori.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Alabama_Song', 'https://www.youtube.com/v/YdPoqfcB3Gk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Doors', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11560', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '420');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3025', 'Helter Skelter (brano musicale)', 'Helter Skelter è un brano musicale dei Beatles. La canzone fu scritta principalmente da Paul McCartney (sebbene porti anche la firma di John Lennon, secondo la convenzione che i due autori rispettarono sempre). Il brano apparve nell\'album The Beatles del 1968, noto come White Album (\"album bianco\"). La canzone è nota per aver anticipato diversi elementi di generi rock che si sarebbero sviluppati solo nei decenni successivi, come hard rock e heavy metal. Del brano sono state realizzate numerosissime cover, incluse quelle dei Mötley Crüe, Oasis, U2, Spite Extreme Wing, Aerosmith e Siouxsie and the Banshees. L\'espressione inglese helter skelter indica i grandi scivoli di forma elicoidale dei luna park.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Helter_Skelter_(song)', 'https://www.youtube.com/v/99mCn34mW64?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11561', 'NULL', 'NULL', 'NULL', '1', 'Hard rock', '421');
