INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3027', 'The Ground Beneath Her Feet', '\"The Ground Beneath Her Feet\" è una canzone del gruppo rock irlandese U2, inclusa nella colonna sonora del film, The Million Dollar Hotel. La canzone è stata registrata insieme a Daniel Lanois alla pedal steel guitar. Nei crediti della canzone compare anche lo scrittore Salman Rushdie, dato che il testo proviene proprio dal suo romanzo La terra sotto i suoi piedi (titolo originale The Ground Beneath Her Feet).', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_Ground_Beneath_Her_Feet_(song)', 'https://www.youtube.com/v/sZfBR5G8FZ8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Daniel Lanois', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11563', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '423');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3028', 'Song to Woody', 'Song to Woody è una canzone del cantautore statunitense Bob Dylan, registrata sul suo primo omonimo album. Presentato da Dylan come il primo pezzo da lui scritto, Song to Woody è dedicata alla figura di Woody Guthrie, di grande ispirazione per Dylan negli anni precedenti alla registrazione del primo album. Nel pezzo sono inoltre citati Cisco Houston e Leadbelly, altri artisti che hanno influenzato Dylan, nonché amici di Guthrie stesso. La melodia è presa direttamente da 1913 Massacre, pezzo scritto e registrato dallo stesso Guthrie nel 1941.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Song_to_Woody', 'https://www.youtube.com/v/-hygKtKhSLc?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11564', 'NULL', 'NULL', 'NULL', '1', 'Folk music', '424');
