INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3030', 'Don\'t Bother Me', 'Don\'t Bother Me è una canzone scritta da George Harrison ed eseguita dai Beatles. È stata inserita come quarta traccia nel secondo album del quartetto di Liverpool, With the Beatles, pubblicato nel 1963. Si tratta della prima canzone composta da George Harrison, che ne è anche l\'interprete come voce solista. La canzone fu composta nell\'estate del 1963 e registrata nel mese di settembre per essere pubblicata per la prima volta nel Regno Unito, con l\'album With the Beatles, il 22 novembre dello stesso anno. La canzone fa inoltre parte della colonna sonora del film A Hard\'s Day\'s Night del 1964.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Don\'t_Bother_Me', 'https://www.youtube.com/v/uGxvhAiOt-A?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11566', 'NULL', 'NULL', 'NULL', '1', 'Rock and roll', '426');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3031', 'Dig a Pony', 'Dig a Pony è un brano del gruppo inglese The Beatles, pubblicato sull\'album Let It Be del 1970. Il suo titolo originale era All I Want Is You, ed è possibile trovare versioni del brano con questo titolo in alcuni dei primi bootleg che pubblicano brani delle Get BackLet It Be Sessions. Nelle copie americane dell\'album il brano è stato erroneamente intitolato I Dig a Pony.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Dig_a_Pony', 'https://www.youtube.com/v/0ZWXtSIl0gk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11567', 'NULL', 'NULL', 'NULL', '1', 'Hard rock', '427');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3032', 'Voodoo Chile', '?? Voodoo Chile Artista Jimi Hendrix Autore/i Jimi Hendrix Genere Blues Stile Edito da Reprise Records Tempo Riferimento Esecuzioni notevoli Pubblicazione Incisione Electric Ladyland Data 1968 Data seconda pubblicazione Etichetta Durata 14\'59\" Note Campione audio Electric Ladyland – tracce Precedente Successiva – – Voodoo Chile è una canzone della band rock The Jimi Hendrix Experience inserita nel loro terzo album Electric Ladyland. La canzone è la più lunga mai registrata da Hendrix.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Voodoo_Chile', 'https://www.youtube.com/v/NfOHjeI-Bns?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Jimi Hendrix Experience', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11568', 'NULL', 'NULL', 'NULL', '1', 'Blues rock', '428');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3033', 'Sympathy for the Devil', 'Sympathy for the Devil è una canzone dei Rolling Stones, traccia iniziale dell\'album uscito nel 1968 Beggars Banquet. Non è stato tratto nessun singolo dalla canzone. È annoverata al 32º posto nella lista delle 500 migliori canzoni secondo Rolling Stone.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Sympathy_for_the_Devil', 'https://www.youtube.com/v/vBecM3CQVD8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Rolling Stones', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11569', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '429');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3034', 'Today Was a Fairytale', 'Today Was a Fairytale è una canzone della cantante statunitense country pop Taylor Swift, inclusa nella colonna sonora del film Appuntamento con l\'amore. Il singolo è stato pubblicato nel solo formato di download digitale il 19 gennaio 2010 per promuovere il film dall\'etichetta discografica Big Machine Records. Today Was a Fairytale è entrata alla seconda posizione della Billboard Hot 100 nel febbraio 2010. Ha venduto 325.000 copie digitali in una sola settimana, stabilendo così il nuovo record per la cantante con più vendite digitali di un singolo nella settimana di debutto, prima detenuto da Britney Spears con la canzone Womanizer. Nella settimana successiva la canzone è scesa alla ventiduesima posizione della Billboard Hot 100. Ha trascorso in totale 15 settimane su quella classifica. È inoltre entrato alla vetta della classifica canadese e alla terza di quella australiana. Il singolo è stato certificato disco di platino sia negli Stati Uniti, per aver venduto più di un milione di copie, sia in Australia, dove le sue vendite ammontano a oltre 70.000 copie.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Today_Was_a_Fairytale', 'https://www.youtube.com/v/wUqnrjSFXtE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11570', 'NULL', 'NULL', 'NULL', '1', 'Pop_music', '430');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3035', 'Maxwell\'s Silver Hammer', 'Maxwell\'s Silver Hammer è un brano musicale dei Beatles, presente nell\'album Abbey Road del 1969 come terza traccia, cui segue Oh! Darling. La canzone è stata scritta e cantata da Paul Mc Cartney, anche se venne firmata, come di consueto, sia da John che da Paul. Manca l\'apporto di John Lennon, poiché ricoverato in ospedale a causa di un lieve incidente stradale che lo ha interessato in Scozia. Il brano venne in realtà composto nel 1968, per poco in ritardo per poter essere inserito nel White Album.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Maxwell\'s_Silver_Hammer', 'https://www.youtube.com/v/qpCV2wgoxC8?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11571', 'NULL', 'NULL', 'NULL', '1', 'Pop rock', '431');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3036', 'When I\'m Sixty-Four', 'When I\'m Sixty-Four è una canzone dei Beatles, scritta da Paul McCartney (ma co-accreditata anche a John Lennon) e pubblicata nel 1967 sull\'album Sgt. Pepper\'s Lonely Hearts Club Band.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/When_I\'m_Sixty-Four', 'https://www.youtube.com/v/eCss0kZXeyE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11572', 'NULL', 'NULL', 'NULL', '1', 'Pop music', '432');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3037', 'Comfortably Numb', 'Comfortably Numb è una canzone dei Pink Floyd pubblicata nel 1979 all\'interno dell\'album The Wall e, nello stesso anno, come singolo, in combinazione con Hey You. È una delle tre canzoni dell\'album i cui diritti d\'autore sono divisi tra Roger Waters e David Gilmour, in quanto la melodia e gran parte della musica sono state scritte da Gilmour e il testo da Waters. Comfortably Numb è una delle canzoni più famose dei Pink Floyd, specialmente per l\'assolo di chitarra che Gilmour esegue alla fine del brano. Nel 1989 la rivista amatoriale degli appassionati dei Pink Floyd \"The Amazing Pudding\" vota il brano come la più bella canzone della band. Nel 2004 la canzone viene inserita alla posizione numero 314 nella lista \"Le 500 canzoni più belle di tutti i tempi\" dalla rivista Rolling Stone. Il commediografo Tom Stoppard ha affermato di aver scritto la maggior parte della trilogia The Coast of Utopia ascoltando ripetutamente questo brano. Il brano è anche stato usato nella colonna sonora del film The Departed - Il bene e il male, nella versione live tratta dal concerto del 1990 The Wall Live In Berlin, cantata da Roger Waters, Levon Helm, Garth Hudson, Rick Danko e Van Morrison.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Comfortably_Numb', 'https://www.youtube.com/v/Bpzxf_flm8M?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11573', 'NULL', 'NULL', 'NULL', '1', 'Progressive_rock', '433');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3038', 'Siberian Khatru', 'Siberian Khatru è una canzone della progressive rock band inglese Yes, tratta dall\'album Close to the Edge, edito nel 1972 dalla Atlantic Records. Versioni dal vivo del brano sono presenti negli album Yessongs, Keys to Ascension, e Live at Montreux 2003, mentre la versione in studio compare in diverse compilation. Si tratta dell\'unica traccia dell\'album che non è suddivisa in più parti, sebbene contenga diversi temi musicali e cambi di tonalità nella tradizione del rock progressivo.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Siberian_Khatru', 'https://www.youtube.com/v/r0HnIr6jYWU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Yes (band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11574', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '434');
