INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3040', 'Party\'s Just Begun (Again)', 'Party\'s Just Begun (Again) conosciuta anche come Party è il primo singolo estratto dall\'album di debutto di Nelly Furtado, Whoa, Nelly!. È stato pubblicato in formato 12\" vinile che conteneva, oltre alla canzone, tutti i suoi remix.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Party\'s_Just_Begun_(Again)', 'https://www.youtube.com/v/2WNcO1Q-NBQ?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Nelly Furtado', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11576', 'NULL', 'NULL', 'NULL', '1', 'Trip hop', '436');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3041', 'Freddie Freeloader', 'Freddie Freeloader è una composizione di Miles Davis, contenuta nel famoso disco Kind Of Blue registrato dal trombettista nel 1959. Il brano ha la forma del classico blues in 12 battute. La versione incisa è in si bemolle, ed è suonata da Davis, John Coltrane, Julian \"Cannonball\" Adderley, Wynton Kelly, Paul Chambers e Jimmy Cobb. È l\'unico brano del disco Kind Of Blue in cui il piano è suonato da Wynton Kelly, in tutti gli altri brani il pianista è invece Bill Evans. Il tema è esposto dai fiati arrangiati in sezione di Davis, Coltrane e Cannonball Adderley, con il piano che fa da contrappunto. Gli assoli sono nell\'ordine di: Wynton Kelly, Miles Davis (6 chorus), John Coltrane (5 chorus), Cannonball Adderley (5 chorus), Paul Chambers (2 chorus). Il titolo Freddie Freeloader (\"Freddie lo scroccone\"), sembra si riferisca a Fred Tolbert, un barista di Philadelphia, amico di Miles Davis.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Freddie_Freeloader', 'https://www.youtube.com/v/RPfFhfSuUZ4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Miles Davis', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11577', 'NULL', 'NULL', 'NULL', '1', 'Cool jazz', '437');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3042', 'War Pigs', 'War Pigs (inizialmente intitolata Walpurgis) è uno dei più celebri brani del gruppo heavy metal Black Sabbath, lunga 7 minuti e 52 secondi. Appartiene all\'album Paranoid, disco del 1970, il più famoso di tutta la loro carriera. Il testo della canzone presenta molti temi anti-guerra, ed in particolare contro la guerra in Vietnam. Molto celebre l\'assolo eseguito da Tony Iommi.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/War_Pigs', 'https://www.youtube.com/v/pZCyOWLrRTE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Black Sabbath', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11578', 'NULL', 'NULL', 'NULL', '1', 'Heavy metal music', '438');
