INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3044', 'Guaranteed (Eddie Vedder)', 'Guaranteed è una canzone di Eddie Vedder inclusa nella colonna sonora del film Into the Wild - Nelle terre selvagge. Come per le altre canzoni della colonna sonora, Vedder nello scrivere il testo si è ispirato alla vera storia di Christopher McCandless. Il brano ha vinto un Golden Globe 2008 per la migliore canzone originale ed è stato nominato ai Broadcast Film Critics Association Award e ai Grammy Award. Nel videoclip diretto da Marc Rocco, Eddie Vedder si esibisce in una stanza scura mentre scorrono varie immagini del film Into the Wild - Nelle terre selvagge.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Guaranteed_(Eddie_Vedder_song)', 'https://www.youtube.com/v/Mwx3RvDWvDM?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Eddie Vedder', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11580', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '440');
