INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3051', 'Pretty Tied Up', '\"Pretty Tied Up (The Perils of Rock N\' Roll Decadence)\" è il titolo di una canzone dei Guns N\' Roses. Fa parte del loro quarto album in studio, Use Your Illusion II.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Pretty_Tied_Up', 'https://www.youtube.com/v/sFbujpjmTzs?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Guns N\' Roses', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11587', 'NULL', 'NULL', 'NULL', '1', 'Heavy metal music', '447');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3052', 'Cross-Eyed Mary', 'Cross-Eyed Mary è una canzone del gruppo rock britannico dei Jethro Tull, pubblicata come seconda traccia dell\'album Aqualung del 1971. La canzone narra di una giovane ragazza, Mary, di famiglia povera che per tirare avanti si prostituisce, concedendosi però soltanto a uomini che come lei versano in disastrose condizioni economiche, probabilmente per il fatto che nessun uomo benestante accetterebbe mai di avere un rapporto con lei. Ciononostante i senzatetto di Londra accettano ben volentieri le prestazioni di Mary, essendo lei l\'unica donna disposta a concedersi a loro. Per questo viene definita la Robin Hood di Highgate (un quartiere nel nord della capitale inglese), dal momento che solo con lei i clochard a Highgate riescono a provare qualche attimo di piacere nella loro devastata vita. Nel testo viene anche nominato Aqualung, il barbone protagonista dell\'omonima canzone dello stesso album, indubbiamente uno dei clienti di Mary. Il pezzo è stato riproposto dal vivo anche dagli Iron Maiden, in una delle loro rarissime cover.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Cross-Eyed_Mary', 'https://www.youtube.com/v/M7jLiXeFm_E?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11588', 'NULL', 'NULL', 'NULL', '1', 'Progressive_rock', '448');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3053', 'Aqualung (brano musicale)', 'Aqualung è probabilmente la più famosa canzone del gruppo britannico rock dei Jethro Tull, pubblicata come prima traccia dell\'omonimo album del 1971, e scritta dal leader della band, Ian Anderson, in collaborazione con la sua prima moglie, Jennie Franks. La registrazione originale dura 6 minuti e 32 secondi. Al pari di molte altre canzoni dei Jethro Tull, \"Aqualung\" narra una storia, nella fattispecie riassume la vita di un senzatetto. L\'assolo di chitarra di Martin Barre all\'interno del pezzo è uno dei più noti ed apprezzati nella storia del rock mondiale, così come il riff iniziale entrambi eseguiti utilizzando una Gibson Les Paul Junior del 1958. Secondo quanto sostenuto dallo stesso Anderson, l\'idea di questa canzone venne dopo che egli vide una fotografia scattata dalla moglie a Londra che ritraeva un clochard.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Aqualung_(song)', 'https://www.youtube.com/v/0q9whvolePo?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Jethro Tull (band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11589', 'NULL', 'NULL', 'NULL', '1', 'Hard rock', '449');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3054', 'Do the Evolution', 'Do the Evolution è una canzone dei Pearl Jam, settima traccia del disco del 1998 Yield. Nonostante non sia stata pubblicata come singolo la canzone raggiunse il trentatreesimo posto della Billboard Modern Rock Tracks chart. Nel 1999 la canzone ricevette una nomination ai Grammy Award nella categoria Best Music Video, Short Form. \"Do the Evolution\" è contenuta anche sul greatest hits Rearviewmirror: Greatest Hits 1991-2003. La musica della canzone è stata scritta da Stone Gossard, mentre il testo da Eddie Vedder. Il bassista Jeff Ament non appare sulla canzone; Gossard registrò le linee di basso per la canzone. Esecuzioni dal vivo di \"Do the Evolution\" sono disponibili su Live on Two Legs e Live at the Gorge 05/06. Dal vivo, la canzone è anche disponibile sui DVD Single Video Theory, Touring Band 2000, Live at the Showbox e Live at the Garden. Su Touring Band 2000 Eddie Vedder aggiunse il verso \"free the West Memphis Three!\" alla canzone. Il video, invece, è disponibile come contenuto speciale.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Do_the_Evolution', 'https://www.youtube.com/v/aDaOgu2CQtI?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pearl Jam', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11590', 'NULL', 'NULL', 'NULL', '1', 'Garage rock', '450');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3055', 'Achilles Last Stand', 'Achilles Last Stand è una canzone del gruppo hard rock Led Zeppelin, contenuta nell\'album Presence, del 1976, con la quale il disco si apre. La canzone è stata scritta da Jimmy Page e da Robert Plant, durante la convalescenza di quest\'ultimo in seguito ad un incidente d\'auto.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Achilles_Last_Stand', 'https://www.youtube.com/v/p6S9oqJRclo?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Led Zeppelin', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11591', 'NULL', 'NULL', 'NULL', '1', 'Heavy metal music', '451');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3056', 'Stuck Inside of Mobile with the Memphis Blues Again', 'Stuck Inside of Mobile with the Memphis Blues Again è una canzone di Bob Dylan contenuta nel suo album del 1966 Blonde on Blonde. La versione contenuta nel disco compare anche nella raccolta Bob Dylan\'s Greatest Hits Vol. II del 1971. Una diversa versione invece appare nell\'album live Hard Rain del 1976, e venne fatta uscire come singolo con il brano Rita May sul lato B. Una versione iniziale in studio, eseguita in maniera più veloce e ritmata, è stata inclusa nell\'album The Bootleg Series Vol. 7: No Direction Home: The Soundtrack.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Stuck_Inside_of_Mobile_with_the_Memphis_Blues_Again', 'https://www.youtube.com/v/60k3fhp9kpY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Bob Dylan', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11592', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '452');
