INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3059', 'Close to the Edge (brano musicale)', 'Close to the Edge è un brano del gruppo di rock progressivo britannico Yes, considerato uno dei loro capolavori. Si tratta di una lunga suite di oltre 18 minuti di durata che occupa un intero lato dell\'omonimo LP ed è suddivisa in quattro movimenti.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Close_to_the_Edge_(song)', 'https://www.youtube.com/v/Tr7zSaWgSKw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Yes (band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11595', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '455');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3060', 'Think About You', 'Think About You è l\'ottava traccia dell\'album Appetite for Destruction dei Guns N\' Roses. Il testo della canzone è simile a quello di Sweet Child O\' Mine (che la succede nella scaletta del disco) nella quale Axl Rose parla del suo amore verso la sua futura moglie, Erin Everly. Think About You fu scritta da Izzy Stradlin, che suona anche l\'assolo di chitarra. La canzone inizia con un ritmo molto veloce e mantiene questo ritmo fino a 29 secondi dalla fine. Il riff finale però è quasi completamente diverso dal resto della canzone, infatti il tempo viene rallentato di molto.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Think_About_You', 'https://www.youtube.com/v/F15IjgyHd60?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Guns N\' Roses', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11596', 'NULL', 'NULL', 'NULL', '1', 'Heavy metal music', '456');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3061', 'Maggot Brain (brano musicale)', 'Maggot Brain è un brano del gruppo Funkadelic, contenuto nell\'omonimo album del 1971. La registrazione originale del brano, lunga oltre 10 minuti, consta di un breve testo recitato come introduzione ed il resto un assolo di chitarra di Eddie Hazel; il brano è collocato al numero 60 della classifica delle 100 Greatest Guitar Songs redatta dalla rivista Rolling Stone. Secondo resoconti, il titolo della canzone prende il nome dal soprannome di Hazel, mentre altre fonti suggeriscono che il titolo sia riferito al ritrovamento, da parte di George Clinton, del \"corpo morto in stato di decomposizione, con il cranio rotto, in un appartamento di Chicago\" di suo fratello. Michael Hampton, che ha sostituito Hazel alla chitarra solista, ha registrato una sua interpretazione nel 1978, la quale fu inclusa in un vinile bonus che venne distribuito con l\'album One Nation Under a Groove. Secondo la leggenda, George Clinton, sotto l\'influenza dell\'LSD, chiese a Eddie Hazel di suonare la prima parte della canzone come se sua madre fosse appena morta e la seconda parte come se lui l\'avesse trovata ancora viva; altre varianti della storia suggeriscono che gli fu semplicemente detto di suonare come se lui avesse trovato sua madre morta.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Maggot_Brain_(song)', 'https://www.youtube.com/v/giPb42wCy3E?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Funkadelic', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11597', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '457');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3062', 'Karn Evil 9', 'Karn Evil 9 è un brano della progressive rock band inglese Emerson, Lake & Palmer (ELP), pubblicato nell\'album Brain Salad Surgery nel 1973. Si tratta di una lunga suite di quasi 30 minuti, sviluppata attraverso tre movimenti autonomi detti Impressions. La più famosa citazione dalla suite è probabilmente la frase iniziale della seconda parte della prima Impression, \"Welcome back my friends to the show that never ends\", frase che darà anche il titolo (non casuale) al seguente triplo disco live del gruppo.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Karn_Evil_9', 'https://www.youtube.com/v/UeQsZOQqO6I?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Emerson, Lake & Palmer', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11598', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '458');
