INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3067', 'Naima', 'Naima è una delle composizioni più celebri ed eseguite tra quelle composte dal sassofonista jazz John Coltrane. È una ballata composta da John Coltrane nel 1959 in forma AABA, con la tecnica \"Coltrane Changes\" da lui stesso ideata. Il pezzo è dedicato alla prima moglie di Coltrane, Juanita Naima Grubb, con il quale l\'artista fu sposato dal 1955 al 1963.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Naima', 'https://www.youtube.com/v/p_ywkpVJ624?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'John Coltrane', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11603', 'NULL', 'NULL', 'NULL', '1', 'Jazz', '463');
