INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3069', 'Shaman\'s Blues', 'Shaman\'s Blues è un singolo del gruppo The Doors. È la terza traccia del loro quarto album, The Soft Parade. La canzone parla di uno sciamano che implora la sua ex-amante di ritornare da lui, dichiarando che conosce il suo umore e la sua mente, ma ciò nonostante non sembra sia capace di persuaderla. Questo brano è piuttosto insolito per l\'album, poiché sembra che i Doors riprendano ritmi decisamente più accaniti, soprattutto rispetto a canzoni come Wishful Sinful e Tell All the People.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Shaman\'s_Blues', 'https://www.youtube.com/v/YmF8mP968YQ?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Doors', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11605', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '465');
