INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3071', 'Express (Christina Aguilera)', 'Express è un brano musicale della cantante pop statunitense Christina Aguilera, pubblicato come singolo il 3 novembre 2010 dall\'etichetta discografica RCA. Il singolo che promuove l\'uscita del film Burlesque, contenuto nella colonna sonora originale interamente interpretata da Christina Aguilera e Cher. Il brano è stato scritto dalla stessa Aguilera insieme a Claude Kelly e Tricky Stewart e prodotto da quest\'ultimo. . In Italia il brano è stato usato sia dalle veline di Striscia La Notizia che dalle Professoresse dell\'eredità per i loro stacchetti.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Express_(Christina_Aguilera_song)', 'https://www.youtube.com/v/OvOAxWiqVhI?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Christina Aguilera', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11607', 'NULL', 'NULL', 'NULL', '1', 'Contemporary R&B', '467');
