INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3076', 'Stairway to Heaven', 'Stairway to Heaven è una celebre canzone del gruppo britannico Led Zeppelin, e una delle più famose nella storia della musica rock. Fu pubblicata nel 1971 nel quarto album del gruppo, Led Zeppelin IV . È una delle canzoni più richieste dalle stazioni radio FM negli Stati Uniti, nonostante non ne sia mai stato fatto un singolo. Fu invece pubblicata negli Stati Uniti anche come disco promozionale, e come EP acustico in Australia; negli anni novanta ne è stata fatta una pubblicazione promozionale per il ventesimo anniversario. È annoverata al 31º posto nella lista delle 500 migliori canzoni secondo Rolling Stone.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Stairway_to_Heaven', 'https://www.youtube.com/v/9Q7Vr3yQYWQ?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Led Zeppelin', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11612', 'NULL', 'NULL', 'NULL', '1', 'Folk rock', '472');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3077', 'Life\'s What You Make It (Hannah Montana)', 'Life\'s What You Make It è un singolo di Hannah Montana, ispirato alla seconda stagione della serie tv Hannah Montana. La canzone si può trovare in diversi CD: \"Hannah Montana 2: Meet Miley Cyrus\", \"Hannah Montana 2: Rockstar Edition\", \"Hannah Montana & Miley Cyrus: Best of Both Worlds Concert\". Sul sito della Disney Channel vi è il video ufficiale della canzone. Esiste inoltre un video promozionale del brano andato in onda su Disney Channel durante gli spot pubblicitari. La canzone è stata inoltre eseguita durante il concerto della cerimonia di apertura dei Disney Channel Games 2007. Nel luglio 2007 la canzone è entrata nella Billboard Hot 100 degli USA alla posizione 25. Nella stessa settimana l\'album \"Hannah Montana 2: Meet Miley Cyrus\" ha debuttato nella stessa classifica al primo posto. \"Life\'s What You Make It\" è la canzone della serie televisiva Hannah Montana ad aver raggiunto i posti in classifica più alti.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Life\'s_What_You_Make_It_(Hannah_Montana_song)', 'https://www.youtube.com/v/e5eyaBD9Jn4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Miley Cyrus', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11613', 'NULL', 'NULL', 'NULL', '1', 'Power pop', '473');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3078', 'Little Wing', 'Little Wing è il titolo di una canzone della rock band The Jimi Hendrix Experience, scritta dal chitarrista e leader del gruppo Jimi Hendrix e registrata sull\'album del 1967 Axis: Bold as Love. Il noto periodico musicale Rolling Stone Magazine l\'ha piazzata al 357º posto nella sua classifica delle 500 canzoni più belle di sempre.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Little_Wing', 'https://www.youtube.com/v/FupHDRVd22I?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Jimi Hendrix Experience', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11614', 'NULL', 'NULL', 'NULL', '1', 'Psychedelic rock', '474');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3079', 'What Shall We Do Now?', 'What Shall We Do Now? è un brano dei Pink Floyd scritto interamente da Roger Waters. Il brano sarebbe dovuto essere incluso nell\'album The Wall, pubblicato nel 1979, ed è presente nelle demo dell\'album, ma fu scartato per una decisione dell\'ultimo momento del gruppo. Al suo posto fu inserito Empty Spaces. What Shall We Do Now? veniva eseguito nei concerti dal vivo di The Wall, infatti è incluso nell\'album registrato dal vivo Is There Anybody Out There? The Wall Live 1980-81. Fu anche eseguito nel concerto di Waters The Wall - Live in Berlin, nel 1990. Curiosamente i membri dei Pink Floyd hanno spesso chiamato, erroneamente, questo brano \"Empty Spaces\", confondendo ancor di più le idee riguardo alle tracce.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/What_Shall_We_Do_Now%3F', 'https://www.youtube.com/v/cFevDtxbBHM?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11615', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '475');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3080', 'Supper\'s Ready', 'Supper’s ready è un brano tratto dall\'album Foxtrot dei Genesis pubblicato nel 1972. Si tratta di una suite divisa in sette frammenti ed è uno dei brani più interessanti del progressive rock e della musica degli anni settanta. Firmata da tutti i componenti del gruppo, è altresì una sorta di Concept a sé stante che riempie quasi interamente la seconda facciata dell\'album, preceduta da Horizons, brano strumentale per chitarra eseguito da Steve Hackett. Peter Gabriel e compagni esprimono al massimo livello il loro modo di trattare argomenti di ispirazione biblica e mitologica condensando - negli oltre venti minuti della suite - temi che, racchiusi nel breve attimo dell\'abbraccio di due amanti, si intrecciano fra di loro creando un affresco che prova a ritrarre la storia dell\'umanità fino ad un\'Apocalisse (Apocalypse in 9/8) che lascia sgomenti per la forza espressiva del brano e riapre il sussurrato dialogo fra amanti che intravedono, preannunciata da un angelo, la via della nuova Gerusalemme. La suite è caratterizzata da un testo molto particolare, che si avvale di metafore e bislacchi scioglilingua per esprimere i concetti; tuttavia, questo è uno dei fattori, insieme alla complessità delle melodie, che contribuiscono a rendere questo brano fra i più curiosi e meglio congegnati della storia del rock.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Supper\'s_Ready', 'https://www.youtube.com/v/-kORf_0uVTw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Genesis (band)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11616', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '476');
