INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3089', 'Breath', 'Breath è una canzone dei Pearl Jam, apparsa per la prima volta nella colonna sonora del film Singles - L\'amore è un gioco del 1992. La canzone è una delle prime registrate con il batterista Dave Abbruzzese. Nella stessa session furono registrate \"State of Love and Trust\", \"Dirty Frank\" e la nuova registrazione di \"Even Flow\". La canzone appare sul gretaest hits dei Pearl Jam, Rearviewmirror: Greatest Hits 1991-2003. Dopo lo show dell\'11 aprile 1994 a Boston la canzone non fu più ri-performata per ben quattro anni. Durante lo Yield Tour del 1998 i fan intrapresero la cosiddetta \"Breath Campaign\", affinché questa fosse riproposta dal vivo nuovamente. Breath infine ritornò nelle scalette della band l\'11 settembre 1998, in uno show al Madison Square Garden; una performance live della canzone è disponibile sul DVD Live at the Garden.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Breath_(Pearl_Jam_song)', 'https://www.youtube.com/v/mCYfw2CyUdA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pearl Jam', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11625', 'NULL', 'NULL', 'NULL', '1', 'Grunge', '485');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3090', 'Miracle Drug', 'Miracle Drug è la seconda traccia dell\'album How to Dismantle an Atomic Bomb degli U2, pubblicato nel 2004. La canzone è stata scritta da Bono ed è dedicata allo scrittore irlandese Christopher Nolan, che fu compagno del cantante e degli altri membri della band alla Mount Temple Comprehensive School di Dublino. Bono disse su Nolan: \"Andavamo tutti alla stessa scuola e proprio quando frequentavamo l\'ultimo anno arrivò un tizio di nome Christopher Nolan. Quando è nato, rimase senza ossigeno per due ore. Ed è per questo motivo che è diventato paraplegico. Ma sua madre credette sin dall\'inizio che Christopher fosse in grado di capire cosa succedesse intorno a lui e cominciò ad insegnargli qualcosa a casa. In seguito scoprirono una medicina che gli permetteva di muovere i muscoli del collo. Decisero allora di attaccargli sulla fronte un congegno a forma di unicorno e a poco a poco imparò così a battere a macchina. Col tempo uscirono fuori tutte le poesie che aveva come immagazzinato nella sua testa. In seguito le raccolse in un libro intitolato Dam-Burst of Dreams, che vinse tantissimi premi. Andò all\'università e divenne un vero genio. Tutto ciò grazie all\'amore di sua madre e alle scoperte in campo medico\". Miracle Drug è l\'unica canzone, dopo Numb, in cui ad accompagnare la voce principale di Bono, oltre a quella di The Edge è possibile ascoltare anche la voce del batterista Larry Mullen Jr.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Miracle_Drug', 'https://www.youtube.com/v/RNm7P2lY9DA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'U2', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11626', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '486');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3091', 'The Great Gig in the Sky', '\"The Great Gig in the Sky\" (letteralmente \"Il Grande Carro nel Cielo\") è la quinta traccia dell\'album The Dark Side of the Moon, pubblicato nel 1973 dai Pink Floyd. La canzone è divenuta celebre in tutto il mondo per il lungo assolo vocale che contiene, eseguito da Clare Torry.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_Great_Gig_in_the_Sky', 'https://www.youtube.com/v/UqCEPytSFqU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11627', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '487');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3092', 'Time Warp', 'The Time Warp è un brano musicale presente nel musical del 1973 The Rocky Horror Show e nel suo adattamento cinematografico del 1975 The Rocky Horror Picture Show, oltre che il nome della danza che accompagna il ritornello del brano. Il brano rappresenta sia un esempio sia una parodia del genere musicale Dance song, in cui il testo stesso del brano da indicazioni dei passi della coreografia da seguire. Si tratta di uno dei brani più popolari della colonna sonora, e di esso sono state registrate innumerevoli cover da parte di molti artisti come Alvin and the Chipmunks, Black Lace, Damian, Groovie Ghoulies, Jive Bunny and the Mastermixers e Sebastian Bach, del gruppo musicale heavy metal Skid Row. Ne esiste anche una versione in lingua spagnola intitolata El baile del sapo ed interpretata dal gruppo musicale messicano Timbiriche ed una in lingua italiana intitolata Balla coi Barlafus interpretata da Elio e le storie tese, ed utilizzata come sigla del programma Mai dire gol. Il brano è anche interpretato e danzato per intero dal cast di Glee in un episodio della seconda stagione. Nel musical The Rocky Horror Show, The Time Warp rappresentava il quinto momento musicale dello show, dopo Sweet Transvestite, mentre nel film è diventato il quarto, prima di Sweet Transvestite. Le rappresentazioni teatrali dello show continuarono ad utilizzare il posizionamento originale del brano sino al 1990, anno in cui Richard O\'Brien revisionò la sceneggiatura e rese coerente il musical con il film, piazzando The Time Warp come quarto brano della scaletta. Il testo del brano consiste di versi cantati alternativamente dai personaggi e funge da introduzione per due di loro. Questi personaggi sono, in ordine, Riff-Raff, Magenta e Columbia. Il ritornello è invece interpretato dal coro dei Transylvanians (nel film) o dai Phantoms (nel musical), con alcune frasi interpretate dal narratore.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Time_Warp_(song)', 'https://www.youtube.com/v/Rtkdo7bOmJc?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Charles Gray (actor)', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11628', 'NULL', 'NULL', 'NULL', '1', 'Glam rock', '488');
