INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3100', 'When the Tigers Broke Free', 'When the Tigers Broke Free (o talvolta When the Tygers Broke Free) è un singolo della progressive rock band inglese Pink Floyd, pubblicato per la prima volta nel 1982 all\'interno del film Pink Floyd The Wall, scritto da Roger Waters, e nella relativa colonna sonora. Nella sceneggiatura appare diviso in due parti: la prima fa da sfondo alla scena in cui il padre di Pink pulisce le canne della pistola (poi sfocerà nella più nota In the Flesh?), mentre la seconda parte quando il piccolo Pink trova nel mobile della camera di sua madre le condoglianze del Re per la morte in guerra del marito. Il brano apparirà successivamente nel 2001 nell\'album Echoes: The Best of Pink Floyd, e nella rimasterizzazione del 2004 di The Final Cut, inserita tra One of the Few e The Hero\'s Return.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/When_the_Tigers_Broke_Free', 'https://www.youtube.com/v/YKfwwlEcowk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11636', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '496');
