INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3102', 'Shine On You Crazy Diamond', 'Shine On You Crazy Diamond è un brano musicale dei Pink Floyd, scritto da David Gilmour, Roger Waters e Richard Wright nel 1974. La canzone è uno struggente omaggio all\'ex componente della band Syd Barrett, che aveva lasciato il gruppo nel 1968. La canzone fu eseguita per la prima volta durante il tour francese del 1974, e l\'anno successivo fu inserita nel concept album Wish You Were Here del 1975. La lunga suite, registrata tra gennaio e luglio 1975, è composta da 9 parti e viene solitamente suddivisa in due: la prima va dalla parte I alla parte V, la seconda dalla parte VI alla parte IX. In origine i Pink Floyd avevano in mente di inserire l\'intera canzone su un solo lato del vinile; successivamente però la lunghezza della canzone li obbligò a dividere l\'intera suite nelle due parti: I-V (all\'inizio del lato a) e VI-IX (alla fine nel lato b); le due parti quindi aprono e chiudono l\'album. La sezione conclusiva (o parte IX) della suite rende l\'ennesimo omaggio a Syd Barrett, con il sintetizzatore che, in coda al brano accenna la melodia di See Emily Play, una delle prime canzoni pubblicate da Barrett con i Pink Floyd. Durante il tour francese del giugno 1974 fu per la prima volta eseguita con il titolo di Shine On. Fu eseguita come Shine On You Crazy Diamond durante il tour inglese nel novembre 1974. Nel 1976 un estratto dalla canzone è stato pubblicato in Italia come singolo, insieme a Have a Cigar.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Shine_On_You_Crazy_Diamond', 'https://www.youtube.com/v/BLKiMbC6s2k?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11638', 'NULL', 'NULL', 'NULL', '1', 'Progressive rock', '498');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3103', 'Party (Beyoncé Knowles)', 'Party è un brano musicale della cantante statunitense Beyoncé Knowles, pubblicato il 24 ottobre 2011 singolo radiofonico dal suo quarto album 4. Il brano è stato scritto da Kanye West, Jeff Bhasker, Beyoncé Knowles, André Lauren Benjamin, Dexter Mills, Douglas Davis e Ricky Walters e prodotto da Beyoncé Knowles, Kanye West e Jeff Bhasker. Il singolo è accompagnato da un video musicale. È stato molto apprezzato dalla critica, che ha esaltato il verso rappato di André 3000. Ha raggiunto la ventesima posizione della classifica di musica R&B statunitense.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Party_(song)', 'https://www.youtube.com/v/XWCwc1_sYMY?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Beyonc%C3%A9 Knowles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11639', 'NULL', 'NULL', 'NULL', '1', 'Contemporary R&B', '499');
