INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3105', 'Octopus\'s Garden', 'Octopus\'s Garden è un brano musicale dei Beatles, composto da Ringo Starr, pubblicato nell\'album Abbey Road (album). George Harrison lavorò sulla canzone con Starr; forse perché le proprie canzoni venivano spesso respinte da John Lennon e Paul McCartney. Harrison commentò: «Octopus\'s Garden è una canzone di Ringo. È soltanto la seconda canzone che Ringo abbia mai scritto, ed è bella». Aggiunse anche: «La canzone è anche molto profonda perché è così pacifica. Suppongo che Ringo stia scrivendo canzoni cosmiche in questi ultimi tempi senza rendersene conto».', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Octopus\'s_Garden', 'https://www.youtube.com/v/cgPqmRNjoTE?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11641', 'NULL', 'NULL', 'NULL', '1', 'Pop rock', '501');
