INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3109', 'Endless Dream', 'Endless Dream è un brano del gruppo musicale inglese di rock progressivoYes, uscito nel 1994 e contenuto nell\'album Talk . Il brano è diviso in tre tracce, Silent Spring, Talk e Endless Dream, ed è la prima suite dopo Machine Messiah, dell\'album Drama, del 1980.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Endless_Dream', 'https://www.youtube.com/v/aiXBz3eyek0?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11645', 'NULL', 'NULL', 'NULL', '1', 'Progressive_rock', '505');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3110', 'MLK (U2)', 'MLK è la decima ed ultima traccia di The Unforgettable Fire, l\'album degli U2 uscito nel 1984. La canzone è una ninnananna in onore di Martin Luther King, caratterizzata da un testo semplice ma meditativo. E proprio grazie a questa canzone, assieme a Pride (In the Name of Love) altro tributo a dottor King, che Bono (leader della band irlandese) ottiene il più grande onore del King Centre, un\'organizzazione fondata da Coretta Scott King.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/MLK_(song)', 'https://www.youtube.com/v/C8lP7ZXe5t4?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'U2', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11646', 'NULL', 'NULL', 'NULL', '1', 'Ambient music', '506');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3111', 'I\'ve Got You Under My Skin', 'I\'ve Got You Under My Skin è un brano musicale del 1936 scritto da Cole Porter per il film musicale Nata per danzare (Born to Dance), in cui viene cantato da Virginia Bruce. Il motivo riscosse subito grande successo e venne candidato all\'Oscar per la migliore canzone nel 1937, ma non ottenne il premio perché questo fu assegnato a un altro motivo destinato ugualmente a diventare un evergreen: The Way You Look Tonight. La fama definitiva arrivò tuttavia una ventina d\'anni dopo, quando Frank Sinatra ne incise una prima versione, includendola nel celebre concept album Songs for Swingin\' Lovers!. Il brano, già nel repertorio di Sinatra dal 1946 (lo aveva eseguito anche nel suo show radiofonico), venne arrangiato da Nelson Riddle con una inconfondibile sezione di fiati e la canzone divenne un \"marchio di fabbrica\" per il cantante, che da allora in poi la incluse nelle scalette di quasi tutti i suoi concerti. Molti artisti hanno poi registrato cover di questo brano: Lee Wiley, Steve Barton, Michael Bolton, Ella Fitzgerald, Diana Krall, Dinah Washington, Michael Bublé, James Darren, Neneh Cherry. Nel 1966 il brano entrò nella classifica dei 45 giri nell\'interpretazione del gruppo The Four Seasons. Ci sono due ulteriori esecuzioni del brano da parte di Frank Sinatra, la prima del 1963, inclusa nell\'album Sinatra\'s Sinatra, la seconda del 1993 incisa in duo con Bono degli U2, ed inclusa nel CD Duets. Nel 1961 il musicista e direttore d\'orchestra Piero Umiliani conduce in RAI la trasmissione \"Moderato Swing\" e in una puntata la canzone viene interpretata dalla neviorkese di origini croate Helen Merrill, all\'epoca già nota come una delle grandi voci \"bianche\" del jazz (aveva esordito a metà dei Cinquanta con la band di Earl Hines Band): il testo, quindi, mentre l\'orchestra esegue il ritornello, viene recitato dall\'attore Fernando Cajati. Questa canzone è anche il titolo di un episodio degli Happy Tree Friends. Il 14 novembre 2011 in occasione della prima puntata de \"Il più grande spettacolo dopo il weekend\" di Fiorello, è stata cantata in duetto dallo stesso presentatore siculo e dal leader dei Negramaro Giuliano Sangiorgi.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I\'ve_Got_You_Under_My_Skin', 'https://www.youtube.com/v/_XCVnV5CGh0?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Frank Sinatra', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11647', 'NULL', 'NULL', 'NULL', '1', 'Vocal jazz', '507');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3112', 'Tomorrow Never Knows', 'Tomorrow Never Knows è una canzone dei Beatles, traccia conclusiva dell’album Revolver, pubblicato dai Beatles il 5 agosto del 1966. Il brano, ufficialmente attribuito a John Lennon/Paul McCartney, venne in realtà quasi esclusivamente composto dal solo John Lennon. Tomorrow Never Knows viene considerata come uno dei più riusciti esperimenti di rock psichedelico del gruppo di Liverpool.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Tomorrow_Never_Knows', 'https://www.youtube.com/v/spjcPS4ekOA?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Beatles', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11648', 'NULL', 'NULL', 'NULL', '1', 'Raga rock', '508');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3113', 'Maybe I\'m Amazed', 'Maybe I\'m Amazed è una canzone di Paul McCartney pubblicata il 17 aprile 1970 nell\'album McCartney. La canzone è dedicata alla moglie di McCarteny, Linda, che lo aveva sostenuto durante la separazione dei Beatles. Nel 1976, gli Wings, il nuovo gruppo di McCartney, pubblicarono un singolo con un\'incisione live del brano, tratta da un tour, che entrò nelle top-ten degli Stati Uniti.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Maybe_I\'m_Amazed', 'https://www.youtube.com/v/cm2YyVZBL8U?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Paul McCartney', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11649', 'NULL', 'NULL', 'NULL', '1', 'Rock music', '509');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3114', 'My Way', 'My Way è una delle canzoni più famose di tutti i tempi; scritta in francese da Claude François col titolo \"Comme d\'habitude\" su musica di Jacques Revaux, fu successivamente tradotta in inglese da Paul Anka. Incisa dal cantante Frank Sinatra nel dicembre del 1968, divenne una delle canzoni più rappresentative del suo repertorio. In seguito questa canzone è stata ripresa da vari cantanti tra cui Elvis Presley, Mireille Mathieu, Sid Vicious, Nina Hagen e più recentemente Michael Bublé.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/My_Way_(song)', 'https://www.youtube.com/v/6E2hYDIFDIU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Frank Sinatra', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11650', 'NULL', 'NULL', 'NULL', '1', 'Traditional pop music', '510');
