INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3116', 'Keep Talking', 'Keep Talking è un brano musicale del gruppo progressive rock inglese Pink Floyd, contenuto nell\'album The Division Bell e scritto da David Gilmour e Bob Ezrin. È uno dei pochi brani in cui Gilmour esegue un assolo con la talk box. All\'inizio del brano e al suo termine sono presenti le registrazioni telefoniche generate dal sintetizzatore vocale di Stephen Hawking con cui il fisico è costretto a comunicare a causa di atrofia muscolare progressiva.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Keep_Talking', 'https://www.youtube.com/v/r-XtvR6-ckg?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pink Floyd', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11777', 'NULL', 'NULL', 'NULL', '1', 'Space rock', '512');
