INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3120', 'Suspicious Minds', 'Suspicious Minds è il titolo di una celebre canzone interpretata da Elvis Presley, scritta nel 1956 da Mark James (alias Francis Zambon) e registrata da Presley nel 1969.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Suspicious_Minds', 'https://www.youtube.com/v/SBmAPYkPeYU?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11781', 'NULL', 'NULL', 'NULL', '1', 'NULL', '516');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3121', 'Mambo No. 5', 'Mambo No. 5 è un singolo di Lou Bega del 1999 basato sull\'omonimo brano registrato da Pérez Prado nel 1952. La popolarità del brano venne rinnovata da Lou Bega che campionò il pezzo originale, pubblicandolo nell\'album di debutto A Little Bit of Mambo. Fu un enorme successo negli Stati Uniti, nel Regno Unito, ed in Australia, dove raggiunse la posizione numero 1 nel 1999. Inoltre il singolo entrò nella top 10 di quasi tutte le classficihe d\'Europa e soprattutto rimase al numero uno in Francia per 20 settimane consecutive, battendo ogni record precedente. Nella Billboard Hot 100 invece si fermò alla posizione numero 3, ma è stata dichiarata come una delle 10 canzoni di maggior successo dell\'ultima decade. In Italia ha raggiunto invece la vetta della classifica risultando il terzo singolo più venduto del 1999. Nel brano vengono nominati diversi nomi di donna: Angela, Pamela, Sandra, Rita, Marica, Erica, Tina, Mary, Jessica.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Mambo_No._5', 'https://www.youtube.com/v/EK_LN3XEcnw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Pérez Prado', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11782', 'NULL', 'NULL', 'NULL', '1', 'Jazz', '517');
