INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3124', 'Guantanamera', 'Guantanamera è il titolo di una canzone popolare cubana di grande fama internazionale, le cui origini risalgono al XIX secolo. La serenata dedicata a tempo di bolero ad una \"guajira guantanamera\" (\"contadina della città di Guantánamo\"), ha come sfondo le lotte di indipendenza che infiammavano la allora colonia spagnola alla fine del XIX secolo. Il suo carattere romantico unito ai valori patriottici che esprime, ne fanno una delle canzoni più amate dai cubani.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/Guantanamera', 'https://www.youtube.com/v/b3oxFc_CnVw?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11785', 'NULL', 'NULL', 'NULL', '1', 'NULL', '520');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3125', 'The Guns of Brixton', 'The Guns of Brixton è una canzone dei Clash, presente nel loro terzo album, London Calling, pubblicato nel 1979. È scritta e cantata dal bassista Paul Simonon, cresciuto a Brixton, quartiere nel sud di Londra. Il brano presenta sfumature reggae, il testo riflette sulla cultura dell\'area, accennando un riferimento al film giamaicano \"The Harder They Come\". È uno dei due brani scritti da Simonon assieme a Crooked Beat, presente su Sandinista!. Simonon canta anche nel pezzo Red Angel Dragnet, incluso nell\'album Combat Rock.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/The_Guns_of_Brixton', 'https://www.youtube.com/v/hiQoq-wqZxg?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'The Clash', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11786', 'NULL', 'NULL', 'NULL', '1', 'Reggae rock', '521');
INSERT INTO `reminiscensdb`.`Public_Memento` (`public_memento_id`, `headline`, `text`, `type`, `resource_type`, `category`, `source`, `source_url`, `resource_url`, `resource_thumbnail_url`, `author`, `collection`, `collection_type`, `is_collection`, `nationality`, `locale`, `haschcode`, `file_hashcode`, `file_name`, `contributor_type`, `contributor`, `creation_date`, `last_update`, `fuzzy_startdate`, `location_start_id`, `fuzzy_enddate`, `location_end_id`, `indexed`, `tags`, `migration_id`) VALUES ('3126', 'I Dreamed a Dream (brano musicale)', 'I Dreamed a Dream è una ballata tratta dal Musical Les Miserables, composta da Claude-Michel Schönberg, col testo inglese di Herbert Kretzmer, basata sul testo francese di Alain Boublil. Nella canzone, il personaggio di Fantine ricorda i tempi andati, quando lei sperava e sognava una vita felice e lieta, confrontandola con la disperazione della sua vita attuale, che ha spezzato tutti i sogni di gioventù. Il brano si apre con il recitativo There was a time when men were kind (spesso omesso nelle esecuzioni in concerto), cui segue l\'aria vera e propria, nella quale si alternano due temi principali. Quello di apertura si ripete due volte identico sulle prime otto strofe (I Dreamed a Dream ... No Wine Untasted), cui segue un secondo tema (but the Tigers ... turn your Dream to Shame) e nuovamente il primo in una chiave più alta (He slept a Summer... Storms We cannot weather) e, dopo un intermezzo strumentale, si conclude con la ripresa del secondo, anch\'esso riproposto in una diversa chiave (I had a Dream my Life ... Life has killed The Dream I dreamed). La canzone è presente nella prima versione parigina del musical del 1980, originariamente intitolata J\'avais rêvé d\'une autre vie e con testi di Alain Boublil. Tuttavia il brano definitivo, con il titolo inglese con cui oggi è noto, prende forma solo nel 1985, nella storica edizione londinese dello spettacolo, con testi in lingua inglese di Herbert Kretzmer. Cantata in scena e nella successiva incisione discografica dello show da Patti LuPone, ottiene un immediato successo e diviene uno dei brani più popolari dello spesttacolo, oltre che uno dei più importanti standard per i cantanti di musical (soprattutto femminili). Nelle incisioni ufficiali dello spettacolo è stata interpretata, dopo Patti LuPone, da Randy Graff (1987 Broadway Cast), Debra Byrne (1988 Complete Symphonic Recording), Ruthie Henshall (1995 10th Anniversary Concert), Madalena Alberto (2010 Anniversary Tour Album) e Lea Salonga (25th Anniversary Concert). Tra gli altri interpreti di rilievo, Elaine Paige, Petula Clark, Allison Crowe, Michael Crawford, Aretha Franklin, Neil Diamond, Kiri Te Kanawa, Michael Ball e Lesley Garrett, raggiungendo una notevole fama al di fuori del mondo del musical dopo essere stata eseguita dalla cantante scozzese Susan Boyle nella terza edizione del programma inglese Britain\'s Got Talent, e in numerose successive esibizioni (incluso un singolo discografico). Il brano è stato inoltre utilizzato in un episodio di Glee, interpretato da Lea Michele e Idina Menzel.', 'SONG', 'VIDEO', 'SONG', 'dbpedia', 'http://dbpedia.org/resource/I_Dreamed_a_Dream', 'https://www.youtube.com/v/wLS9CKlSLRk?version=3&f=videos&d=AYcmKYILM6rpFUn86Vnl8m4O88HsQjpE1a8d1GxQnGDm&app=youtube_gdata', 'NULL', 'Rose Laurens', 'NULL', 'NULL', '0', 'NULL', 'it_IT', 'NULL', 'NULL', 'NULL', 'SYSTEM', 'NULL', 'NULL', 'NULL', '11787', 'NULL', 'NULL', 'NULL', '1', 'Pop music', '522');
